INSERT INTO `ampliacionescontratos` (`id`, `fecha`, `tiempo_ampliacion`, `periodo`, `razonamiento`, `attermino_id`, `solicitante`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, '2014-11-11', 22, 'Dias', 'Como parte de la asistencia, se ha iniciado un proceso de negociación con algunas cadenas de supermercado como Walmart y Grupo Callejas para proveer el producto. Consideramos que en estas dos semanas se pueden terminar de cumplir con los requisitos exigidos por ellos y obtener un cierre favorable de dicha negociación, para lo cual es conveniente el acompañamiento durante el proceso.', 8, 'Consultor', NULL, '2014-12-09 01:58:15', '2014-12-09 01:59:11'),
(2, '2014-11-17', 18, 'Dias', 'Debido a que se necesitaba más  tiempo para  fermentación de los  productos.', 40, 'Consultor', NULL, '2014-12-10 00:16:31', '2014-12-10 00:16:31'),
(3, '2014-11-28', 5, 'Dias', 'No pude asistir a la entrega de la propuesta de crédito, en la fecha establecida debido a tener otras actividades como ferias gastronómicas del negocios.', 41, 'Empresario', NULL, '2014-12-10 04:07:07', '2014-12-10 04:07:07'),
(4, '2014-11-14', 20, 'Dias', 'Debido a que dentro de la Cooperativa las y los  asociados se mantienen unos en la finca de producción y otras distribuyendo productos en las tienda y mercado, por lo que durante el desarrollo de la consulta de la asistencia técnica no se encontraban para socializar con todos el catálogo por lo que nos implico un atraso en la planificación programada, en los días de ampliación solicitado creemos que son suficientes para la elaboración del material publicitario de la Cooperativa.', 55, 'Empresario', NULL, '2014-12-10 20:49:17', '2014-12-10 20:49:17'),
(5, '2014-11-14', 4, 'Semanas', 'El empresario no ha podido atender las reuniones programadas y no ha aprobado los artes propuestos.', 24, 'Consultor', NULL, '2014-12-11 20:22:06', '2014-12-11 20:22:06'),
(6, '2014-12-06', 6, 'Dias', 'Aun faltan piezas por terminar los procesos.', 56, 'Consultor', NULL, '2014-12-12 21:51:37', '2014-12-12 21:51:37'),
(7, '2015-07-14', 23, 'Dias', 'Lamentablemente el trabajo se ha retrasado más de lo esperado por la complejidad del mismo, además de agregarle la semana de vacaciones que se ha tenido en este tiempo. Por lo que para poder garantizar un buen trabajo es necesario la ampliación del contrato.', 59, 'Consultor', NULL, '2015-08-12 20:50:17', '2015-08-12 20:52:49'),
(8, '2015-07-20', 21, 'Dias', 'se necesitó más tiempo por producción de productos y toma de fotografías para incluirlas en el sitio web.', 69, 'Consultor', NULL, '2015-08-14 03:37:26', '2015-08-14 03:37:26'),
(9, '2015-07-30', 14, 'Dias', 'Debido a que dentro de las cuatro semanas de ejecución de la asistencia técnica el empresario tuvo un periodo de temporada alta de turistas, lo que no le permitió asistir a las reuniones previamente programadas con el consultor.', 74, 'Empresario', NULL, '2015-08-24 23:05:55', '2015-08-29 01:07:15'),
(10, '2015-07-31', 3, 'Dias', 'Debido a que el día en que se tenía programada la entrega final de la asistencia técnica, tuve la visita en mi negocio de mis proveedores por lo que no pude asistir a la entrega final.', 76, 'Empresario', NULL, '2015-08-27 21:08:04', '2015-08-27 21:14:26'),
(11, '2015-08-22', 4, 'Dias', 'Debido a que el día de entrega del documento final de la propuesta de crédito se tiene programado reunión con los Socios de la Cooperativa.', 75, 'Empresario', NULL, '2015-08-29 21:06:11', '2015-08-29 21:06:11'),
(12, '2015-09-18', 11, 'Dias', 'Debido a problemas personales al inicio de la consultoría, no pude atender a la empresa consultora para dar inicio a las actividades del plan de trabajo.', 85, 'Empresario', NULL, '2015-10-02 23:22:04', '2015-10-02 23:22:59'),
(13, '2015-09-03', 25, 'Dias', 'Por motivos personales no he podido dar el seguimiento necesario en las ultimas semanas para aprobar los artes finales de la consultoría retrasando así el trabajo de la consultora.', 86, 'Empresario', NULL, '2015-10-03 01:48:24', '2015-10-03 01:52:12'),
(14, '2015-09-17', 12, 'Dias', 'Debido a trámites que se tuvieron que hacer en el ministerio de Hacienda y en el ministerio de educación se me hizo algunas veces imposible reunirme con el consultor para poder darle seguimiento al trabajo, por lo que es necesaria la ampliación del contrato para poder finalizar exitosamente la asistencia técnica.', 90, 'Empresario', NULL, '2015-10-03 21:59:24', '2015-10-03 22:04:47'),
(15, '2015-09-19', 16, 'Dias', 'Durante el desarrollo de la asistencia técnica tuve problemas de salud (Chikimgunya), por lo que solicito tiempo de 16 días, para la finalización de la asistencia técnica.', 88, 'Empresario', NULL, '2015-10-07 20:30:42', '2015-10-07 20:30:42'),
(16, '2015-09-21', 10, 'Dias', 'En referencia al cumplimiento de los productos esperados en la consutoria, como representante de la Cooperativa  Artilobasquense de RL, solicito prorroga de 10  días a partir del día 25 de septiembre hasta el día 3 de octubre, por el motivo siguiente:\r\nLlenado de Formulario de aplicación para gestión de fondos ante instituciones de apoyo y la elaboración del diseño de la presentación en formato Power Point como herramienta de apoyo, los cuales no se realizaron en el tiempo establecido por otros compromisos adquiridos en la Cooperativa los cuales atrasaron el cierre en la fecha establecida.', 103, 'Empresario', NULL, '2015-10-07 21:43:08', '2015-10-07 21:56:55'),
(17, '2015-09-18', 18, 'Dias', 'Solicito 18 días para la finalización de  asistencia técnica debido al compromiso de entregar prendas de vestir a utilizar el día 15 de septiembre del presente año.', 87, 'Empresario', NULL, '2015-10-07 21:45:54', '2015-10-07 21:45:54'),
(18, '2015-10-02', 26, 'Dias', 'Por correcciones al plan de negocios y elaboración de proyecto para ser presentado a FONDEPRO para concurso de desarrollo territorial, a solicitud de empresarios y COMAYPE Regional de Ilobasco.', 100, 'Consultor', NULL, '2015-11-06 14:35:28', '2015-11-06 14:37:07'),
(19, '2015-10-07', 27, 'Dias', 'Por este medio queremos ponerle al tanto que el desarrollo del proyecto El Salvador y Su Cultura se ha visto retrasado y será necesaria ampliación para finalizar satistactoriamente con los productos esperados. \r\n<br><br>\r\nEste atraso ha ocurrido ya que el ingeniero a cargo del proyecto tuvo problemas de salud lo cual retrasó algunas semanas el trabajo', 72, 'Consultor', NULL, '2015-11-06 16:27:18', '2015-11-06 16:28:02'),
(20, '2015-10-13', 11, 'Dias', 'En base a la cláusula NOVENA: VIGENCIA Y ORDEN DE INICIO Y PRÓRROGAS del contrato profesional sostenido con la empresaria Nicolasa Cristina Rivera de González, representante de Embutidos El Caulote, solicito la presente ampliación del mismo, debido a que la actividad que servirá para validar los nuevos productos formulados se ha programado para el día 27 de octubre, por motivos de organización y disponibilidad de tiempo de los invitados especiales. Ello implica además, agregar una jornada para discutir los resultados de dicho evento.', 94, 'Consultor', NULL, '2015-11-06 21:10:40', '2015-11-06 21:10:40'),
(21, '2015-10-19', 22, 'Dias', 'Solicito ampliación de contrato debido a problemas de salud (virus sika)', 99, 'Consultor', NULL, '2015-11-11 16:33:49', '2015-11-11 16:34:01'),
(22, '2015-10-29', 17, 'Dias', 'Solicito 17 días de ampliación de contrato por problemas económicos los cuales no me permitián hacer el pago de aporte empresarial.', 92, 'Empresario', NULL, '2015-11-18 19:19:21', '2015-11-18 19:20:14'),
(23, '2015-11-03', 16, 'Dias', 'Solicito la ampliación de 16 días, debido a que las propuestas de artes enviadas por la consultora se han sometido a presentación y aprobación de toda la cooperativa por lo que implico más tiempo del estipulado en el contrato de la Asistencia Técnica.', 98, 'Empresario', NULL, '2015-11-19 17:00:18', '2015-11-19 17:00:18'),
(24, '2015-11-19', 10, 'Dias', 'El diseño y desarrollo de la página web fue retrasada por que no se entregó a tiempo toda la información requerida.\r\n<br>\r\nPor lo que es necesaria la ampliación para poder finalizar satisfactoriamente con la asistencia técnia.', 124, 'Consultor', NULL, '2015-12-04 15:41:46', '2015-12-04 15:41:46'),
(25, '2015-11-03', 4, 'Semanas', 'Debido a los retrasos que hemos tenido porque el cliente ha tardado en entregar la información requerida, ha estado incompleta o no ha entregado dicha información en el formato solicitado.', 82, 'Consultor', NULL, '2015-12-04 15:44:59', '2015-12-04 16:13:56'),
(26, '2015-11-30', 8, 'Dias', 'Se solicitan 7 días de ampliación de contrato debido a que al tener las artes finales el empresario solicitó hacer nuevamente el  buho en bulto para lograr un mejor producto.', 113, 'Consultor', NULL, '2015-12-09 22:40:22', '2015-12-09 22:40:22'),
(27, '2015-11-09', 30, 'Dias', 'Solicito una ampliación de 30 días debido a que al inicio de la consultoría tuve problemas de salud me diagnosticaron Dengue y por tal razón no pude terminar la consultoría en el tiempo estipulado en el contrato.', 112, 'Consultor', NULL, '2015-12-12 17:54:13', '2015-12-12 17:54:13'),
(28, '2015-12-09', 4, 'Dias', 'Atraso en la información solicitada al empresario para completar estudio de mercado.\r\nEntrega tardía de las cotizaciones del equipo para determinar los costos de instalación de la planta.', 132, 'Consultor', NULL, '2015-12-21 17:34:36', '2015-12-21 17:34:36');
