(17, 'Sesion de inicio / Diagnóstico', 16, '2015-01-20', '2015-01-20', '08:00:00', '12:00:00', 'Inicial', 5, 10, 62, 'Comentarios iniciales: la cooperativa ha recibido visita de personal de Fondepro y tienen propuesta de apoyo para completar el equipamiento de la planta.\r\nLlenado de diagnóstico: se realizó análisis de lás áreas principales de la empresa, utilizando la herramienta de la metodología CCSN.\r\nModelo de negocios: Se explicó las generalidades del modelo de negocios.\r\n\r\nAcuerdos:\r\nPróxima reunión: martes 27, 9:00 am.\r\nConvocar a representantes de la imprenta Imprimilo para negociar impresión de viñetas para JEPSE.', 'Completada', 3, 168, '2015-01-20 03:23:22', '2015-01-31 02:04:41'),
(18, 'Inicio asesoría ACAASS de R.L', 204, '2015-01-20', '2015-01-20', '08:23:00', '08:23:00', 'Inicial', 3, 0, NULL, 'Visita in situ para evaluación de las necesidades e identificación de proyectos a desarrollar en el año. ', 'Completada', 4, 167, '2015-01-20 20:23:29', '2015-01-21 04:21:35'),
(19, 'Reunión con Rosa de UNIKE', 16, '2015-01-22', '2015-01-22', '10:00:00', '11:32:00', 'Inicial', 7, 0, NULL, 'Renunión para dar seguimiento a las acciones programadas en años anteriores con la empresa, hoy con nuevo propietario al frente de la empresa.', 'Programada', 8, 91, '2015-01-21 21:35:09', '2015-01-21 21:35:09'),
