INSERT INTO `atterminos` (`id`, `tema`, `obj_general`, `obj_especifico`, `productos`, `tiempo_ejecucion`, `trabajo_local`, `fecha`, `financiamiento`, `aporte`, `estado`, `especialidad_id`, `usuario_id`, `empresa_id`, `empresario_id`, `informe`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Procesos y técnicas de producción de dulces artesanales', 'Proporcionar a la empresaria los conocimientos y procesos necesarios para la elaboración de una variedad de duces artesanales de frutas', 'Demostrar a las empresarias de forma práctica y teórica el proceso adecuado de la elaboración de dulces artesanales de variedad de frutas. \r\nEnseñar la técnica correcta de elaboración de dulces artesanales. \r\nQue las empresarias aprendan a elaborar dulces artesanales de frutas.', 'Proceso de elaboración de cada producto (dulces de: nance, coco rallado, tamarindo, camote, manzanilla, cocada, leche, piña, zapote, sandia, etc.) \r\nDar a conocer las técnicas el uso de moldes y diseños, cortes y formas de la presentación de los dulces. \r\nProporcionar de forma práctica y luego por escrito un informe que contenga, el proceso de elaboración (con medidas exactas) de cada uno de los productos, las técnicas a utilizar, el uso de utensilios y el detalle de la materia prima para cada uno de los productos. \r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para la empresaria).', 30, 70, '2014-09-06', 800.00, 4.33, 'Finalizada', 7, 7, 153, 7, '', NULL, '2014-09-03 03:48:43', '2015-10-28 03:17:01'),
(2, 'Propuesta de crédito', 'Obtener financiamiento para la empresa Arte en Cuero.', 'Obtener financiamiento para aumentar la produción de calzado. \r\nMejorar las condiciones de financiamiento de la empresa. \r\n', 'Historial y desempeño de la empresa desde su creación hasta la fecha.\r\nEvolución de su gestión empresarial.\r\nCumplimiento de los compromisos crediticios anteriores.\r\ncapacidad administrativa y de gestión de la empresa.\r\nAnalisis financieros histórico y proyectado.\r\nEstados financieros de los años anteriores.\r\nRazón de liquidez.\r\nPrueba ácida.\r\nCapital de trabajo.\r\nRotación de activos.\r\nMargen de ganancia.\r\nRendimiento del patrimonio.\r\nRazón de apalancamiento o endeudamiento.\r\nRazón de eficiencia o actividad.\r\nRotación de inventario.\r\nCiclo neto de comercialización.\r\nAnálisis de la garantía ofrecida por la empresa y su máxima responsabilidad crediticia.\r\nAnálisis del crédito desde el punto de vista financiero de la inversión.\r\nImpacto del crédito\r\nConclusiones y recomendaciones.', 30, 70, '2014-09-06', 800.00, 0.00, 'Finalizada', 8, 12, 12, 8, '', NULL, '2014-09-03 20:47:27', '2014-10-27 20:14:53'),
(3, 'Patronaje y nuevas técnicas en la elaboración de prendas de vestir.', 'Fortalecer los conocimientos de corte y confección y obtener los respectivos patrones de diferentes prendas de vestir.  ', 'Dar a conocer de forma práctica las técnicas de cómo hacer patrones según el diseño. \r\nAyudar a los socios de la cooperativa a implementar nuevas técnicas de corte y confección que le permitan facilitar la toma de medidas, el corte, confección, armado y pegado de las diferentes prendas de vestir.\r\nRealizar de forma práctica la elaboración de las diferentes prendas de vestir', 'Colección de diseños de ropa para damas y sus respectivos patrones.\r\nColección diseño prendas para niños/as y sus respectivos patrones.\r\nCamisas para damas y caballeros y sus respectivos patrones.\r\nSocios con conocimientos firmes en la confección de prendas de vestir.\r\nPatrón para pantalón de vestir (Hombre).\r\nPatrón para pantalón de vestir (Mujer).\r\nFicha técnica de cada diseño. \r\nResolver las dudas de los participantes en relación a la confección de las prendas de vestir.\r\nObtener prendas de vestir de máxima calidad.\r\nInforme Final.\r\n\r\n\r\n', 30, 80, '2014-09-30', 800.00, 4.17, 'Finalizada', 10, 5, 114, 29, '', NULL, '2014-09-10 22:11:46', '2015-12-15 16:50:11'),
(4, 'Propuesta de crédito', 'Evaluar la factibilidad del proyecto para la empresa MULTIACTIVOS, S.A de C.V.', ' Mejorar las condiciones del financiamiento actual e invertir en nuevo lote de autos.\r\nTener capital de trabajo para invertir en el negocio.\r\n', 'Nombre de la empresa que solicita la propuesta de crédito\r\nNombre del representante del negocio\r\nDirección y contactos\r\nHistoria del origen de la empresa.\r\nEvolución de la gestión empresarial\r\nCumplimiento de los compromisos crediticios anteriores\r\nCapacidad de administrar la empresa\r\nMonto solicitado del financiamiento \r\nDestino del financiamiento\r\nPlazo recomendado  del financiamiento \r\nAnálisis financiero: histórico y proyectado\r\nRazón de Liquidez\r\nPrueba ácida\r\nCapital de trabajo\r\nMargen de ganancia\r\nRendimiento del patrimonio \r\nRazón de Apalancamiento o endeudamiento \r\nRazón de Eficiencia o Actividad\r\nAnálisis de la garantía \r\nGarantía ofrecida por la empresa y su máxima responsabilidad crediticia \r\nAnálisis del crédito desde el punto de vista financiero de la inversión.\r\nImpacto del crédito.', 30, 70, '2014-09-26', 800.00, 1.00, 'Finalizada', 6, 12, 164, 155, '', NULL, '2014-09-10 22:47:30', '2014-10-31 01:51:09'),
