(10, 'Nuevos diseños de miniaturas en barro que cubran los estándares de calidad', 'Crear nuevos diseños de miniaturas en barro.', 'Diseñar una colección de miniaturas en barro. \r\nDemostrar y enseñar el proceso de elaboración de tapaderas.\r\nEnseñar técnicas de elaboración de miniaturas incluyendo colores', 'Colección de nuevos diseños de miniaturas en barro (al menos 10 diseños)\r\nproductos terminados de máxima calidad.\r\nEmpresaria capacitada en la elaboración de miniaturas especialmente en tapaderas.\r\nQue la empresaria aprenda el proceso de elaboración de las miniaturas.\r\nDiseñar los moldes para cada uno de los productos.\r\n\r\n\r\n\r\n', 30, 70, '2014-09-20', 800.00, 4.67, 'Finalizada', 11, 7, 163, 154, '', NULL, '2014-09-17 02:39:58', '2014-11-13 20:58:57'),
(11, 'Creación de marca, diseño de etiquetas, material publicitario e imagen corporativa', ' 	Diseñar la línea grafica completa para los productos de la empresaria proporcionándole de elementos gráficos necesarios para comercializar sus productos en el mercado nacional.', 'Diseñar un logotipo que identifique visualmente a la empresa y a los productos.\r\n\r\nCrear marca comercial que cubra la línea de productos que la empresa posee de acuerdo al mercado que se pretende atender.\r\n\r\nElaborar papelería como paginas membretadas y tarjetas de presentación, herramientas de comercialización, como banners, brochure y flyers.\r\n', 'Creación de línea grafica para la empresa que incluya:\r\n\r\nDiseño de logotipo de nombre comercial.\r\nViñeta para cada uno de los productos Diseño de Marca comercial libre para registrar en Centro Nacional de Registros.\r\nManual de uso de marca.\r\nDiseño de empaques que incluya eslogan.\r\nDiseño de brochure informativo.\r\nToma de fotografía para el diseño de brochure (si aplica en el diseño)\r\nDiseño de flyer para imprimir y electrónico.\r\nDiseño de roll up y banner.\r\nDiseño de tarjetas de presentación y papel membretado.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para la empresaria).', 30, 70, '2014-09-05', 800.00, 4.67, 'Finalizada', 13, 7, 156, 147, '', NULL, '2014-09-17 03:26:21', '2014-11-26 20:23:05'),
(12, 'Nuevos diseños de arreglos florales', 'Enseñar nuevos diseños de arreglos florales naturales y artificiales para diferentes ocasiones.', 'Dar a conocer técnicas para la elaboración de arreglos florales naturales y artificiales.\r\n\r\nEnseñar a la empresaria diseños innovadores de arreglos de mesa para toda ocasión.\r\n \r\nCapacitar a la empresaria proporcionándole conocimientos de diseños de arreglos florales naturales y artificiales. \r\n', 'Colección de diseños de arreglos florales naturales y artificiales para diferentes ocasiones.\r\n\r\nColección de diseño de arreglos de mesas naturales y artificiales para toda ocasión.\r\n\r\nProporcionar un catálogo a la empresaria con todos los diseños innovadores, separado por ocasión. (día de San Valentín, día de la madre, etc).\r\n\r\nEmpresarias con conocimientos claros en la elaboración de arreglos florales y de mesa para toda ocasión.\r\n', 30, 70, '2014-09-04', 800.00, 5.17, 'Finalizada', 11, 7, 155, 146, '', NULL, '2014-09-17 03:42:46', '2014-10-16 20:58:43'),
(14, 'Refrescamiento de Marca e Imagen Comercial y Diseño de Medios Publicitarios Impresos', 'Refrescar la imagen comercial de Creaciones Nory y diseñar material publicitario que sirva de apoyo de comercialización y fortalezca su diseño e imagen para atraer la atención de un mayor Número de clientes.', 'Mejorar el logo existente con la adaptación de colores y demás elementos acordes al producto y al mercado al que se dirigen.\r\nAdaptar el refrescamiento de marca a los medios publicitarios impresos que contribuyan a lograr un mejor posicionamiento comercial de la empresa.\r\nDiseñar una propuesta de catálogo de productos que se adapte a la nueva imagen de la empresa.', 'Refrescamiento de marca.\r\nDiseño de catálogos de productos.\r\nDiseño de banner publicitario para fachadas del local.\r\nDiseño de tarjetas de presentación de acorde a la nueva imagen creada.\r\nRecomendaciones y conclusiones.\r\nEntrega de documentos final digital e impreso (Copia para CDMYPE y copia para empresario).\r\nTodos los artes en poder de empresario y CDMYPE-UNICAES.', 30, 70, '2014-05-22', 800.00, 30.00, 'Creado', 13, 6, 35, 32, '', NULL, '2014-09-19 02:16:48', '2014-10-03 04:28:20'),
(15, 'Nuevas Técnicas de Pintura en Productos de Morro Para Taller KETSALÍ', 'Obtener nuevas técnicas de pintura para piezas hechas en morro a un menor costo y con un menor tiempo de fabricación.', 'Adquirir nuevos conocimientos sobre técnicas de pintura fáciles de aprender y que no requiera una mayor inversión.\r\nLograr el incremento de las ventas de los productos, al ofrecer precios más accesibles al mercado atendido por Ketsalí Joyería Artesanal.\r\nMejorar la productividad de la empresa con un menor tiempo de fabricación de los productos.\r\nMejorar la calidad y presentación de los productos ofrecidos para acceder a nuevos mercados.', 'Nuevas técnicas de pintura para productos hechos en morro.\r\nManual con la información teórica y técnica de la nueva forma de pintar el producto que se impartirá al empresario.\r\nPresupuesto sobre los materiales, herramientas y todos los costos a incurrir con la nueva técnica de pintura.\r\nRecomendaciones y conclusiones.\r\nEntrega de informe final digital e impreso (Copia para CDMYPE y copia para empresario).', 30, 70, '2014-07-05', 800.00, 30.00, 'Creado', 16, 6, 33, 28, '', NULL, '2014-09-19 02:45:38', '2014-10-03 04:28:20'),
