(23, 'Diseño de servicios turísticos dentro de la Ruta Sitio Guazapa.', 'Diseñar los diferentes servicios turísticos de la cooperativa de acuerdo a los segmentos de mercado identificados.', 'Definir segmentos de mercado de interés para la cooperativa.\r\n\r\nDiseñar servicios turísticos a ofrecer a los diferentes segmentos.\r\n\r\nDeterminar costos y precios para los diferentes servicios turísticos.\r\n\r\nCapacitar al personal de la cooperativa en la prestación de los servicios turísticos diseñados.\r\n', 'Segmentos de mercado identificados.\r\nServicios turísticos diseñados.\r\nCostos y precios definidos para las diferentes líneas de servicios turísticos diseñados.\r\nTalleres de capacitación para los guías de la cooperativa en la prestación de los servicios turísticos diseñados.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 30, 70, '2014-10-06', 800.00, 4.17, 'Finalizada', 17, 3, 5, 4, '', NULL, '2014-09-20 23:09:38', '2014-12-05 19:31:21'),
(24, 'Diseño de Imagen Comercial Para La Empresa Santa Barbara Joyeros', 'Dotar a la empresa Santa Barbara Joyeros de una imagen empresarial y marca comercial, con la visión de desarrollo de sus propietarios, fortaleciendo así la estrategia de posicionamiento de la empresa. ', 'Diseñar el logotipo de Santa Barbara Joyeros y crear slogan de la empresa.\r\nDiseño de la marca comercial de la linea de joyería de la emrpesa.\r\nDesarrollar el material publicitario para posicionar la marca y la empresa. ', 'a.	Diseño de logotipo de Santa Barbara Joyeros y creación de Slogan.\r\nb.	Diseño de marca comerciales para la linea de joyería de la empresa, en la presentación que se necesite.\r\nc.	Diseño de tarjetas de presentación.\r\nd.	Catálogo de piezas de joyeria de la empresa, broshure informativo de la empresa y sus productos.\r\ne.	Roll up, rotulo y banner.\r\nf.	Diseño de papelería interna de la empresa para relaciones comerciales.\r\ng.	Productos promocionales y uniforme de empleados.\r\nh.	Manual de uso de la marca.\r\ni.	Documento de informe final en físico y digital (con copias a CDMYPE)\r\n', 30, 70, '2014-10-10', 800.00, 9.17, 'Finalizada', 13, 8, 79, 74, '', NULL, '2014-09-20 23:13:54', '2014-12-11 11:34:25'),
(25, 'Creación de imagen comercial y línea gráfica', 'Desarrollar el producto con atributos  que cumplan con una imagen y presentación competitiva para el acceso a nuevos mercados. ', '•	Diseñar marca y  elementos gráficos para el desarrollo del producto\r\n•	Proponer una distribución de espacios atractiva para sala de venta\r\n', 'Creación y diseño de marca \r\nBúsqueda de marca en registro de CNR\r\nManual de uso de marca\r\nRotulo externo \r\nPlanograma \r\nTarjeta de presentación\r\nDiseño de uniformes\r\nHojas membretadas\r\nStickers para frezeer\r\nViñetas para diferentes presentaciones (Vasitos, cuartos, medios y galones)\r\nHoja volante promocionales\r\nCover fan page\r\n', 30, 70, '2014-09-30', 800.00, 5.17, 'Finalizada', 13, 4, 212, 202, '', NULL, '2014-09-22 21:48:13', '2014-11-29 01:53:17'),
(26, '“DISEÑO DE MARCA, MATERIALES PUBLICITARIOS E IMAGEN CORPORATIVA PARA ACOPAIME DE R.L.”', 'Diseñar la línea gráfica completa de la empresa, dotándola de los elementos gráficos necesarios para ofrecer sus servicios en el mercado de embutidos.', 'Diseñar el logotipo de la empresa.\r\n\r\nDiseñar marca para los productos de la empresa.\r\n\r\nMostrar una imagen estándar que potencie la empresa en las diferentes herramientas publicitarias y administrativas.\r\n', 'Creación de línea gráfica para la empresa que incluya:\r\n\r\nDiseño de logotipo que identifique a la empresa.\r\nDiseño de marca para identificar la línea de productos de la empresa (incluir proceso de búsqueda en el CNR).\r\nManual de uso de marca.\r\nDiseño de empaque para el producto.\r\nDiseño de herramientas publicitarias: flyer editable para promociones, banner y afiche.\r\nToma de fotografía para el diseño (si aplica).\r\nDiseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado, facturas, folder empresarial y carta de presentación.\r\nImpresión de tiraje de muestra de herramientas publicitarias y papelería interna (excepto facturas).\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 30, 70, '2014-09-26', 800.00, 3.83, 'Finalizada', 13, 7, 275, 260, '', NULL, '2014-09-23 05:46:01', '2014-11-12 22:14:10'),
(27, 'Elaboración de platillos innovadores para comida a la vista.', 'Fortalecimiento de la autonomía económica familiar a través del aprendizaje en elaboración de platillos alimenticios para su comercialización. ', 'Innovar con nuevos platillos que se adapten a los gustos y preferencias del perfil de cliente al cual están dirigidos. \r\nConocer diferentes técnicas de decoración para presentar los platos \r\nSaber acerca de la manipulación de alimentos para la calidad de los mismos\r\nConocer el procedimiento de elaboración de los diferentes platillos buscando optimizar los costos.\r\n', 'Manual de recetas de aves, carnes y mariscos con su procedimiento.\r\nDiferentes tipos de aderezos, salsas  y ensaladas.\r\nPlatillos costeados.\r\nTips de cocina y términos de cocción.\r\nEmpresarias capacitadas en BPM.', 30, 70, '2014-09-27', 800.00, 5.17, 'Finalizada', 20, 7, 276, 261, '', NULL, '2014-09-23 06:04:25', '2014-12-04 02:26:33'),
(28, 'PLAN DE NEGOCIOS IMPLEMENTACION DE PLANTA DE PRODUCCION DE LACTEOS A FAVOR DE LA EMPRESA BIOLACT DE R.L.', 'Elaborar un plan de negocio para la creación y el desarrollo de una empresa procesadora, comercializadora y transportadora de leche enfriada, que sirva de intermediario entre los productores de leche cruda que no posean planta procesadora y los centros escolares que demandan el servicio, así como las empresas comercializadoras, mejorando la  competitividad de ambos actores.', 'Identificar las area de oportunidad que posee la empresa para generar desarrollo sostenible, desarrollo de mercados potenciales y estructura organizativa enfocada a los objetivos.\r\nElaborar un plan de negocios que permita conocer aspectos sobre el negocio y ayuden a tomar decisiones estratégicas\r\nInvolucrar a los interesados en la construcción del documento, de tal forma que tengan las herramientas necesarias para su respectiva interpretación.\r\n', 'Elaboración del perfil del negocio en base a su constitución.\r\nPartiendo del estudio de mercado, la identificación de clientes potenciales y estrategias de marketing respectivas para garantizar la distribución de la leche.  \r\nAnálisis de capacidad de producción \r\nAnálisis administrativo para fortalecer la estructura de la cooperativa.\r\nAnálisis financiero con proyecciones solidas a cinco años\r\nRecomendaciones y conclusiones\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario)\r\n', 30, 70, '2014-10-07', 800.00, 3.83, 'Finalizada', 22, 8, 100, 95, '', NULL, '2014-09-25 23:37:16', '2014-11-03 22:40:16'),
(29, 'Técnicas para elaboración de Calzado', 'Especializarse y conocer nuevas técnicas para la elaboración de calzado para el fortalecimiento de proyecto emprendedor con jóvenes. ', 'Conocer el proceso y procedimiento para elaborar calzado con técnicas nuevas\r\nIdentificar materiales para la elaboración de calzado de calidad y sus respectivos proveedores\r\nConocer sobre el costo de calzado \r\nAprender nuevos diseños de calzado para dama y caballero\r\nProponer mejoras en cuanto a la compra de mobiliario y equipo\r\n', 'Colección de calzado para dama (sandalias, zapato cerrado para dama de moda)\r\nColección calzado para caballero (Sandalia de cuero, zapato casual y de vestir)\r\nManual  de procedimiento para la elaboración de calzado. ', 30, 70, '2014-09-29', 800.00, 5.00, 'Finalizada', 21, 4, 278, 269, '', NULL, '2014-10-02 01:54:54', '2014-12-08 21:09:31'),
(30, '“DISEÑO DE DISTRIBUCION DE MOBILIARIO Y PRODUCTOS PARA TIENDA DE ARTESANÍAS CASA DE LA ABUELA"', 'Diseñar un concepto nuevo e innovador en CASA DE LA ABUELA, la distribución adecuada y la propuesta de mobiliario, paleta de colores de interiores y material Pop, que permita lograr el reconocimiento y posicionamiento de la tienda a nivel local, nacional e internacional.', 'Crear un concepto agradable de CASA DE LA ABUELA (concepto supermercado).\r\nContar con una propuesta de diseño y distribución de mobiliario y productos para CASA DE LA ABUELA\r\nMejorar la visibilidad de CASA DE LA ABUELA ante los clientes y turistas.\r\nContinuidad de los diferentes ambientes y rubros dentro de CASA DE LA ABUELA (hacer ver a CASA DE LA ABUELA con todas sus actividades como un ALL IN ONE).\r\n', 'Aplicación de concepto de diseño de marca de CASA DE LA ABUELA.\r\nDiseño de fachada para CASA DE LA ABUELA adaptado a la imagen comercial actual.\r\nPropuesta de distribución y ubicación de mobiliario y productos para CASA DE LA ABUELA.\r\nPropuesta y sugerencia de medidas y mobiliario adecuado para la tienda. \r\nDistribución por áreas o sectores para los productos artesanales.\r\nPaleta de colores de interiores.\r\nMaterial Pop.\r\nTodos los artes en poder del empresario y CDMYPE.\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 30, 70, '2014-10-08', 800.00, 9.17, 'Enviado', 13, 5, 61, 57, '', NULL, '2014-10-02 03:20:03', '2014-10-03 04:28:20'),
(31, 'Diseño de marca, etiquetas y materiales publicitarios.', 'Diseñar la línea gráfica de la empresa, dotándola de los elementos gráficos necesarios para ofrecer sus productos en el mercado.', 'Diseñar logotipo para identificación de la empresa.\r\nDiseñar marca para la línea de productos de la empresa.\r\nCrear las herramientas necesarias para mostrar una imagen estándar que potencie la empresa en el mercado.\r\n', 'Diseño de logotipo que identifique a la empresa.\r\nDiseño de marca para identificar la línea de filtros de la empresa (incluir proceso de búsqueda en el CNR).\r\nManual de uso de marca.\r\nDiseño de etiqueta para el producto.\r\nDiseño de herramientas publicitarias: flyer editable para promociones, banner y afiche.\r\nToma de fotografía para el diseño (si aplica).\r\nDiseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado, facturas, folder empresarial y carta de presentación.\r\nImpresión de tiraje de muestra de herramientas publicitarias y papelería interna (excepto facturas).\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 30, 70, '2014-10-13', 800.00, 5.00, 'Finalizada', 13, 3, 279, 272, '', NULL, '2014-10-02 03:56:58', '2014-12-04 05:10:23'),
(32, 'Proceso de Elaboración de fruta deshidratada ', 'Perfeccionar el proceso actual de deshidratacion de frutas realizado por las empresarias a un método técnico adecuado y con las normas de calidad y manejo de alimentos.', 'Enseñar al grupo de mujeres el proceso correcto de deshidratacion de frutas (plátano, piña, guineo, mango, papaya, naranja, otros)\r\nCapacitar al grupo de mujeres  en la elaboración de la deshidratación de frutas\r\nDemostrar de forma practica y teórica el proceso correcto en la deshidratacion de frutas.\r\n\r\n', 'Empresarias con conocimientos firmes en la deshidratacion de frutas\r\nEmpresarias capacitadas en el proceso de deshidratacion de frutas\r\nInforme que contenga el proceso completo de la deshidratacion de frutas\r\nBrindar a las empresarias una capacitación básica en Buenas Practicas de Manufactura', 30, 70, '2014-10-08', 800.00, 4.67, 'Finalizada', 7, 7, 277, 262, '', NULL, '2014-10-03 03:00:11', '2014-11-13 21:07:19'),
(33, 'Diseño de sistema de inventario para la empresa Dalvin', 'Diseñar un sistema informático de control de inventario para la empresa Dalvin, ubicada en el municipio de Sensuntepeque, del departamento de Cabañas, que automatice el proceso gestión de ventas y control de inventario de los productos de la empresa.', 'Diseñar un sistema de control de inventario y clientes para la empresa Dalvin.\r\nUn control del stock de productos que se tienen en venta..\r\nAutomatizar el proceso de ventas efectuadas en la empresa.\r\nUn control de operaciones y  estadísticas de la empresa', 'Modulo de Inventario: Controlar el stock de productos que se encuentran en el almacén, definiendo umbrales para la adquisición y compra de cada producto, de modo tal que el producto no se agote.\r\nLector de código de barras: para la venta de los productos el sistema debe leer los productos a través de código de barras, (el lector debe ser proporcionado por el consultor, pero el costo de este será por parte del empresario).\r\nModulo de clientes: Llevar registro y control de los clientes de la empresa.\r\nModulo ventas: Llevar un registro de las ventas efectuadas y que puedan ser consultadas en los reportes.\r\nModulo Reportes: El sistema debe de ser capaz de mostrar los reportes de las ventas, compras y clientes, identificando cuales son los productos que se venden más, el cliente que compra más, entre otros reportes que la empresaria pueda necesitar.\r\nModulo de costos y beneficios\r\nManual de usuarios para la utilización del sistema.\r\nCódigo fuente del sistema.\r\nCD de instalación del sistema para que la empresaria pueda instalarlo en nuevos equipos.\r\nInstalar el sistema en el/los equipos que se va a ejecutar. \r\nCapacitar a uno o dos integrantes de la empresa en el uso adecuado del sistema.\r\nElaborar un informe final el cual será entregado tanto físico como digital a la empresa como también a CDMYPE UNICAES ILOBASCO.', 30, 70, '2014-10-06', 800.00, 9.20, 'Finalizada', 18, 2, 64, 60, '', NULL, '2014-10-03 04:07:59', '2014-11-18 20:12:31'),
(34, 'Diseño e innovación de figuras humanas sin rostro. (8 Piezas)', 'Ampliar  la oferta de figuras humanas en barro del taller El Buen Gusto para fortalecer la identidad y el espíritu innovador que les caracteriza.\r\n', 'Diseñar nueva línea de productos de figuras humanas sin rostro, mejorando la tecnificación de los diseños\r\nFortalecer las características identificadoras de los diseños del taller El Buen Gusto\r\n', 'a.	Diseño de línea innovadora de figuras humanas sin rostro a trabajar son 8 piezas con sus respectivas pruebas.\r\n1.	Campesino.\r\n2.	Campesina.\r\n3.	Doctor.\r\n4.     Materna.\r\n5.	Una pareja de ángeles (2 piezas).\r\n6.	profesor \r\n7.	profesora.\r\nb.	Propuesta de diseño innovador para cada pieza. (coordinación empresario- consultor).\r\nc.	Las medidas de cada pieza serán: 35cm aproximadamente piezas.\r\nd.	Diseños de moldes para cada pieza (estos en poder del empresario).\r\ne.	Documento de informe final.', 30, 80, '2014-10-10', 800.00, 9.20, 'Ofertas Recibidas', 11, 5, 264, 251, '', NULL, '2014-10-07 04:24:37', '2014-10-15 04:00:01'),
(35, 'Técnicas de arreglos florales y manualidades para eventos', 'Mejorar la calidad de los servicios decorativos para diferentes eventos festivos demandados a nivel local y en segmentos potenciales.', '•	Aprender diferentes técnicas de arreglos florales naturales y artificiales para diferentes eventos (cumpleaños infantiles, juveniles, fiestas de boda, bautizos, comuniones, quince años, graduaciones, baby shower, despedidas de soltera, entre otros) \r\n•	Diversificar los servicios decorativos con la elaboración de diferentes manualidades para eventos festivos (Tarjetas, recuerdos, entre otros)\r\n', '•	Diseños y pruebas de arreglos florales naturales y artificiales para diferentes eventos\r\n•	Diseño de diferentes manualidades decorativas para eventos festivos\r\n•	Recomendaciones de proveedores \r\n•	Manual de costeo de los diferentes productos elaborados. \r\n', 30, 70, '2014-10-21', 800.00, 6.00, 'Finalizada', 30, 4, 280, 271, '', NULL, '2014-10-07 20:38:47', '2014-12-09 20:59:38'),
