(45, 'Diseño de imagen comercial para Clinica Daniel', 'Dotar a Clinica Daniel, de una imagen comercial en relación con la visión de desarrollo de su propietaria, fortaleciendo así la estrategia de posicionamiento de la empresa. ', '	Diseñar el logotipo de la empresa Clínica Daniel que se tiene en uso y crear junto a ellos un slogan.\r\n	Diseño de marcas comerciales de las líneas de los productos de la empresa.\r\n	Desarrollar material publicitario para posicionar la marca de la empresa. \r\n', 'Diseño de logotipo de empresa y creación de slogan.\r\nDiseño de tarjeta de presentación, banner, rotulo, broshure, afiche, roll up, hojas volante y artículos promocionales como camiseta, llavero, calendario y otros.\r\nPapelería interna de la empresa y sello.\r\nManual de uso de marca.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario)\r\n', 30, 70, '2014-10-23', 800.00, 4.33, 'Finalizada', 13, 8, 88, 83, '', NULL, '2014-10-17 03:02:59', '2014-12-10 02:58:09');
