(46, ' PROCEDIMIENTOS DE EVALUACIÓN FINANCIERA Y GESTIÓN DE MOROSIDAD', 'Garantizar el retorno de capital e intereses de las diferentes líneas de créditos otorgadas, así como el correcto análisis financiero en el otorgamiento y administración de cartera de clientes', 'Establecer procesos de análisis financieros para el otorgamiento de las diferentes líneas de créditos, avío, comercio y personal\r\nDesarrollar estrategias para la recuperación de créditos tendientes a la mora y aquellos que están en morosidad\r\nDesarrollar estrategias de recuperación de aportaciones en mora.\r\n', 'Elaborar diferentes herramientas o formularios con información financiera necesaria para un correcto análisis financiero\r\nManual de procedimientos  de análisis financiero y parámetros de otorgamiento según línea de crédito\r\nPlan de estrategias de acercamiento para recuperación de créditos tendientes a la mora o en morosidad\r\nPersonal capacitado en las diferentes herramientas para análisis financiero y recuperación de créditos vencidos\r\n', 30, 70, '2014-10-30', 800.00, 8.33, 'Finalizada', 6, 4, 220, 210, '', NULL, '2014-10-24 03:21:53', '2014-11-28 04:32:49'),
(47, 'Diseño de Imagen Comercial para ADACI', 'Dotar a la empresa de los elementos gráficos necesarios para fortalecer la comercialización de artesanías, mediante el diseño de la línea gráfica completa.', 'Diseñar el logotipo de la empresa.\r\nDiseñar marca para los productos de la empresa.\r\nMostrar una imagen estándar que potencie la empresa en las diferentes herramientas publicitarias y administrativas\r\n', 'Diseño de logotipo que identifique a la empresa.\r\nDiseño de marca para identificar la línea de productos de la empresa (incluir proceso de búsqueda en el CNR).\r\nManual de uso de marca.\r\nDiseño de empaque para el producto.\r\nDiseño de herramientas publicitarias: Sticker, viñetas, brochures, flyers, banner y afiche.\r\nToma de fotografía para el diseño (si aplica).\r\nDiseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado, facturas, y folder empresarial.\r\nImpresión de tiraje de muestra de herramientas publicitarias y papelería interna (excepto banner).\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 30, 70, '2014-11-01', 800.00, 5.48, 'Finalizada', 13, 3, 286, 277, '', NULL, '2014-10-30 21:15:23', '2014-12-05 23:15:26'),
(48, 'Diseño de viñetas y medios publicitarios para Distribuidora San Luis', 'Adquirir el diseño para las viñetas de los productos que se comercializan y de los medios publicitarios que les identifique dentro de los mercados en los que comercializan.\r\n', 'Creación de imagen comercial de cada uno de los productos congruente con el mercado que se atiende\r\nAdaptar la marca a los medios publicitarios impresos que contribuyan a lograr un mejor posicionamiento comercial de la empresa.\r\nDiseñar una propuesta de catálogo de productos que se adapte a la nueva imagen de la empresa.\r\n', 'Elaboración del diseño de viñeta para los 10 productos que elabora la empresa (puede adaptarse el mismo diseño a los diferentes productos)\r\nDiseño de catálogo de productos.\r\nDiseño de tarjetas de presentación de acorde a la nueva imagen creada.\r\nDiseño de hoja membretada\r\nDiseño de banner\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 30, 70, '2014-11-04', 800.00, 8.33, 'Finalizada', 13, 6, 15, 10, '', NULL, '2014-10-31 23:40:35', '2014-12-11 20:50:53'),
(49, 'Elaboración de Plan de Negocios', 'Elaboración de plan de negocio que permita a la empresa generar una visión estratégica de su negocio y la búsqueda de oportunidades en el mercado para el crecimiento y rentabilidad económica.', 'Elaboración de plan de negocio para la identificación de clientes/as potenciales, que puedan demandar los productos. \r\n\r\nEstablecer objetivos estratégicos que orienten a la empresa a la creación de una visión de futuro empresarial. \r\n', 'Contenido del plan de Negocio\r\n1.	Introducción \r\n–Descripción del negocio\r\n2.	Naturaleza de la empresa\r\n3.	Plataforma Estratégica\r\n-Imagen corporativa\r\n- Diseño de Banner\r\n-Logotipo\r\n-Lema\r\n-Misión\r\n-Visión\r\n- Valores\r\n\r\n-Objetivos Generales \r\n-Objetivos específicos \r\n4.	El mercado\r\n-Investigación de Mercado\r\n-Mercado objetivo\r\n-Estrategias de promoción de los productos: página de facebook y otros medios publicitarios\r\n –Proyección de Ventas para cinco años\r\n5.	Producción\r\n-Niveles de producción \r\n- proyección a cinco años\r\n6.	La prestación del servicio\r\n –Descripción del proceso de prestación de servicio y atención al cliente. \r\n7.	Organización \r\n- Análisis FODA\r\n-Planificación de las actividades de la empresa: horarios de trabajo.\r\n-Organigrama.\r\n7.   Finanzas \r\n  -Inversión Inicial, mobiliario y equipo, otros. (Cuadro de presupuesto)\r\n  -Gastos \r\n  -Análisis de costos \r\n8.    Anexos \r\nSe debe contar con dos documentos, una para la propietaria y otro para el CDMYPE en físico y CD\r\n', 30, 70, '2014-11-04', 800.00, 4.83, 'Finalizada', 22, 6, 38, 33, '', NULL, '2014-11-01 02:38:13', '2014-12-05 20:20:27'),
(50, 'Organización y distribución del sistema de producción de la planta de textil para determinar la capacidad productiva y el costo de producción de Industrias Ilomodas. ', 'Determinar la capacidad de producción de la planta de textiles de Industrias Ilomodas, realizando una distribución en sus lineas de producción.', 'Organizar las lineas de producción de la planta de textiles.\r\n\r\nConocer el punto de equilibrio de producción.\r\n\r\nDefinir el sistema de costos de producción.', 'Diagnostico preliminar de sistema de producción actual.\r\nDiagnosticar los elementos principales con que cuenta la empresa actualmente: Maquinarias, personal, recursos.\r\nElaboración de propuesta de nuevo sistema de producción.\r\nEstudio de los costos de producción.\r\nElaboración de organigrama de planta de producción.\r\nElaboración de diagrama de flujo de producción.\r\nElaboración del lay-out o distribución de planta.\r\nDefinición del punto de equilibrio.\r\nDeterminación de la capacidad productiva de la planta.\r\nRecomendaciones de lineas de producción diferente a los uniforme deportivos en base a la demanda del mercado.\r\nCopia de informe final en fisico y CD al empresario y al CDMYPE.\r\n', 30, 70, '2014-11-17', 800.00, 8.33, 'Finalizada', 10, 8, 295, 284, '', NULL, '2014-11-12 21:05:06', '2014-12-12 03:38:54'),
(51, 'Propuesta de Crédito', 'Obtener financiamiento para la empresa CREACIONES NORY', 'Obtener capital de trabajo para la confección de uniformes.\r\nMejorar las condiciones de producción de la empresa.\r\n', '-Historia y desempeño de la empresa desde su creación hasta la fecha\r\n-Evolución de la gestión empresarial\r\n-Monto solicitado \r\n-Destino del financiamiento\r\n-Plazo del financiamiento\r\n-Análisis de los estados financieros\r\n-Razones financieras\r\n-Liquidez\r\n-Endeudamiento\r\n-Rentabilidad \r\n-Cobertura.\r\n-Impacto del crédito.\r\n–Descripción del negocio\r\n-Misión\r\n-Visión\r\n- Valores\r\n-Objetivos Generales \r\n-Objetivos especifico\r\n-Mercado objetivo\r\n –Proyección de Ventas para cinco año\r\n-Análisis Financiero del proyecto, VAN y TIR\r\n-Se debe contar con dos documentos, una para la propietaria y otro para el CDMYPE en físico y CD', 30, 70, '2014-11-14', 800.00, 0.00, 'Contratada', 6, 12, 35, 32, '', NULL, '2014-11-13 01:52:13', '2014-12-10 00:03:21'),
(52, 'Estudio de factibilidad para proyecto de cria de pelibuey.', 'Proporcionar información fidedigna y real que refleje el grado de factibilidad económica financiera a largo plazo y que permita tomar decisiones acertadas para la correcta  ejecución del proyecto y la búsqueda de financiamiento del mismo. ', 'Elaborar un plan de factibilidad como instrumento para conocer los rendimientos del proyecto, con elementos que determinen la proyección financiera para implementar el proyecto de cria de pelibuey.\r\n\r\nInvolucrar al interesados en la construcción de cada uno de los componentes del plan para que lo puedan defender ante las posibles instituciones que financiaran el proyecto.\r\n', 'Información fidedigna, oportuna y  veraz. \r\nComprensión del documento Plan de factibilidad  por parte del empresario.\r\nIdentificación de potenciales fuentes de financiamiento.\r\nHistoria y desempeño de la empresa\r\nGrado de cumplimiento de los compromisos crediticios\r\nMonto solicitado \r\nForma de pago del Financiamiento\r\nPlazo de financiamiento\r\nAmortización del crédito\r\nEstados financieros de los años anteriores\r\nAnálisis financieros históricos y proyectado\r\nRazón de liquidez\r\nPrueba ácida\r\nCapital de trabajo\r\nMargen de ganancia\r\nRendimiento del patrimonio\r\nRazón de apalancamiento y endeudamiento \r\nimpacto del crédito \r\nDescripción del negocio\r\nMisión \r\nVisión \r\nValores\r\nObjetivos generales.\r\nRecomendaciones y conclusiones\r\nEntrega de informe fisico y CD a empreario y CDMYPE.', 30, 70, '2014-11-17', 800.00, 8.00, 'Enviado', 22, 8, 83, 78, '', NULL, '2014-11-13 03:07:02', '2014-11-14 22:11:07'),
(53, 'SISTEMA DE GESTION DE VENTAS', 'Desarrollar un sistema de gestión de ventas eficiente con un alto desempeño del personal de ventas en el logro de los objetivos de venta', 'Desarrollar un sistema de gestión de ventas eficiente con un alto desempeño del personal de ventas en el logro de los objetivos de venta', 'Planificación de ventas \r\nManual guía para la gestión comercial-ventas (identificación, seguimiento y control de clientes)\r\nAcompañamiento al personal de ventas para alcanzar las metas establecidas, logrando dos clientes potenciales.  \r\nPersonal de venta contratado con experiencia en venta de consumo masivo ', 30, 70, '2014-11-23', 800.00, 8.00, 'Finalizada', 9, 4, 237, 227, '', NULL, '2014-11-19 20:31:40', '2014-12-11 22:46:55'),
(54, 'REFRESCAMIENTO DE MARCA Y LÍNEA GRÁFICA COMERCIAL', 'Posicionar los atractivos turísticos de proyecto de turismo rural en Oratorio de Concepción administrado por Rancho El Potrillo JJ', '-Diseñar imagen comercial \r\n- Elaborar las herramientas gráficas que contribuyan a las estrategias de publicidad y promoción del lugar turístico\r\n', '-Búsqueda de marca en CNR\r\n-Refrescamiento de marca\r\n-Manual de uso de marca\r\n-Brochure/manual informativo sobre los servicios turísticos\r\n-Toma de fotografías necesarias para los artes\r\n-Tarjetas de presentación\r\n-Página membretada\r\n-Diseño de valla publicitaria\r\n-Hojas volantes\r\n-Diseño de uniforme para personal\r\n-Cover Fan Page\r\n', 30, 70, '2014-11-25', 800.00, 4.33, 'Enviado', 13, 4, 253, 240, '', NULL, '2014-11-22 20:18:57', '2014-11-22 20:20:13'),
(55, 'Diseño de Imagen Comercial, Marca y de Herramientas Publicitarias', 'Diseñar una marca comercial y una imagen que identifique a los productos de la Cooperativa del resto de los demás.', 'Introducción de los productos al mercado formal con una imagen acorde a las exigencias de los clientes tanto nacionales como internacionales.\r\nAdaptar la marca a los medios publicitarios que contribuyan a lograr un mejor posicionamiento comercial y a dar una mejor promoción de los productos de la Cooperativa.\r\nDiseñar una propuesta de nombre para la marca de la cooperativa que sea atractiva para el segmento de mercado al que se dirigen.\r\n', '•	Propuestas de nombres comerciales\r\n•	Diseño de medios publicitarios: tarjetas de presentación, banner, roll-up, hojas membretadas, flyer y rótulo. \r\n•	Diseño de logo\r\n•	Diseño de viñetas para productos\r\n•	Búsqueda de nombre comercial en CNR\r\n•	Diseño de folders \r\n•	Diseño de Uniformes\r\n•	Recomendaciones y conclusiones.\r\n•	Entrega de informe final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 30, 70, '2014-12-10', 800.00, 30.00, 'Contratada', 13, 6, 20, 15, '', NULL, '2014-12-10 20:26:57', '2014-12-19 21:02:22'),
(56, 'Ampliación de diseños y modelados de juegos y piezas artesanales.', 'Ampliar  la oferta de juegos de decoración  y piezas complementarias en barro del taller El Artesano fortaleciendo la identidad y el espíritu innovador del mismo.', 'Diseñar nueva línea de productos de piezas decorativas, mejorando la tecnificación de los diseños.\r\nFortalecer las características identificativas de los diseños del taller El Artesano.\r\n', 'Diseño de nuevas líneas de productos de artesanías en barro, juegos decorativos y piezas complementarias de la colección, con sus respectivas pruebas.\r\nMoldes de todas las piezas que se diseñaran.\r\nTécnicas básicas de modelado para que el artesano las conozca e implemente.\r\nPaleta de colores definido para cada diseño, así como técnicas de pintura a utilizar en los diseños.\r\nDocumento de informe final.\r\n', 30, 70, '2014-10-07', 800.00, 5.00, 'Finalizada', 12, 8, 68, 63, '', NULL, '2014-12-12 21:13:59', '2014-12-12 21:53:31'),
(57, 'PROCESO DE CUMPLIMIENTO DE NORMATIVAS SANITARIAS PARA EL DESARROLLO DE NUEVOS PRODUCTO EN LA LINEA DE GRANOS BÁSICOS EMPACADOS ', 'Llevar acabo gestiones de cumplimiento de normativa sanitaria, para el desarrollo de nuevos productos en la línea de granos básicos para la marca "Don Vicente"', '-Elaborar tabla nutricional para frijol rojo empacado y arroz \r\n-Realizar los análisis respectivos para la obtención de registro sanitario\r\n-Elaborar prototipo de etiqueta según normativas para alimentos pre-envasados o la normativa correspondiente\r\n', '-Tabla nutricional para frijol rojo empacado y arroz \r\nRegistro sanitario para nuevo producto "frijol rojo" presentación de 1lb, 2lb, 3lb y 4lb\r\n-Registro sanitario para nuevo producto "arroz" presentaciones de 1lb, 2lb, 3lb y 4 lb\r\n-Prototipo de viñetas que cumplan con la normativa de etiquetado para alimentos preenvasados para las diferentes presentaciones', 30, 70, '2015-03-16', 800.00, 15.00, 'Creado', 7, 4, 167, 158, '', NULL, '2015-03-17 02:14:52', '2015-03-17 02:14:52'),
(58, 'Diseño e implementación de campaña de relanzamiento de agencia de viajes Cojute´s Travel', 'Posicionar los servicios turísticos a través de la creación y ejecución de estrategias de publicidad y promoción dirigidas a segmento de mercado de Cojutepeque y sus alrededores. ', 'Crear estrategia de campaña de relanzamiento de Cojute´s Travel\r\nDiseñar y acompañar en la ejecución de estrategias publicitarias y promocionales convencionales y social media relacionadas a la campaña en mención\r\nElaborar plan de social media (Redes sociales-Fanpage)\r\nEjecutar plan de social media según la duración de campaña \r\n\r\n', 'Plan de campaña de relanzamiento con cronograma de ejecución\r\nPlan de estrategias de social media (Fanpage)\r\nAcompañamiento y asesoría para la ejecución de plan de estrategias de publicidad y promoción convencional y social media\r\nElaboración de guión y producción de cuña publicitaria\r\nPersonal entrenado en la ejecución de estrategias de social media (Fanpage)', 4, 70, '2015-05-08', 800.00, 9.17, 'Finalizada', 2, 4, 218, 208, '', NULL, '2015-04-16 02:52:59', '2015-10-14 21:58:34'),
(59, 'Diseño de página web', 'Diseñar una página web para la empresa Candy Kuilt ubicada en el municipio de Suchitoto del departamento de Cuscatlán en la cual pueda dar a conocer los productos de la empresa.', 'Diseñar una página web para la empresa.\r\nContar con un sitio en internet para la publicación de los productos de la empresa.\r\nMejorar la visibilidad de la empresa teniendo presencia en internet .', 'Pagina responsive que se adapte a cualquier dispositivo.\r\nPagina de inicio, contendrá la historia de la empresa.\r\nProductos, mostrará el producto de la empresa .\r\nComentarios, Sección para mostrar algunas historias de los clientes.\r\nContactenos,formulario de consultas en el que el usuario pueda enviar mensajes al administrador de la página.\r\nLa pagina debe de tener interacción con redes sociales en todas sus secciones, poseer el botón de me gusta de Facebook,y compartir par que se pueda compartir el contenido de la pagina.\r\nLa página web debe quedar en internet de manera que la empresa pueda utilizarla al finalizar la asistencia técnica.\r\nManual de usuario para la administración de la página web.\r\nElaborar un informe final el cual será entregado tanto en físico como en digital a la empresa como a CDMYPE.\r\nCapacitar al menos a un integrante de la empresa en la administración y uso de la página web.\r\na pagina web debe tener los logos de apoyo del cdmype.\r\n', 4, 70, '2015-05-22', 800.00, 4.67, 'Finalizada', 1, 2, 156, 147, '', NULL, '2015-04-20 22:40:38', '2015-09-01 22:55:51'),
(60, 'GUÍA PARA LA IMPLEMENTACIÓN DE SISTEMA DE TRAZABILIDAD PARA EMPACADO DE GRANOS BÁSICOS ', 'Diseñar un sistema de trazabilidad que permita conocer el histórico,la ubicación y el trayecto de los lotes de granos empacados a lo largo de la cadena de suministro, atendiendo a las exigencias de normativas sanitarias correspondientes', 'Diseñar una guía de implementación de las diferentes fases de trazabilidad(hacia atrás, interna y hacia adelante) considerando las exigencias de las normativas e instituciones afines\r\n\r\nCrear un sistema documental y de registros que permitan dar cumplimiento a la trazabilidad\r\n\r\nPlanificar un sistema de retiro de productos para la gestión del riesgo \r\n\r\n', 'Manual de trazabilidad para empacado de granos básicos\r\nHerramientas de registros sistematizadas \r\nPlan de retiro de productos en situaciones de riesgo \r\nPersonal capacitado para la implementar sistema de trazabilidad', 4, 70, '2015-05-22', 800.00, 15.00, 'Finalizada', 28, 4, 167, 158, '', NULL, '2015-04-21 02:49:05', '2015-08-15 04:10:35'),
(61, 'Diseño de herramientas de promoción comercial para prendas teñidas en añil', 'Diseñar herramientas de promoción comercial BTL para promocionar los productos teñidos en añil en el mercado nacional e internacional', 'Elaborar propuesta de refrescamiento de marca y viñeta del producto\r\nDiseñar herramientas promocionales BTL convencionales y digitales \r\nDiseñar elementos gráficos de comunicación y posicionamiento de marca\r\n', '-Refrescamiento de marca\r\n-Diseño de viñetas\r\n-Catalogo de productos\r\n-Diseño de empaque para producto\r\n-Planograma de sala de venta\r\n-Línea gráfica(Tarjetas de presentación, paginas membretadas)\r\n-Cover de Fanpage\r\n-Diseño de banner', 4, 70, '2015-05-14', 800.00, 7.50, 'Finalizada', 13, 4, 222, 212, '', NULL, '2015-04-21 22:50:57', '2015-08-10 20:15:40'),
(62, 'DISEÑO DE PLAN DE MARKETING', 'Mejorar el nivel de ventas de la empresa por medio de la planificación de estrategias de marketing orientadas a la ampliación de la comercialización en diferentes canales.', 'Re definir la estrategia de comercialización, identificando posibles clientes en restaurantes, salas de recepciones, tiendas de artesanías, distribuidores mayoristas y otros establecimientos con potencial de ser futuros clientes.', 'Diseño de plan de marketing que incluya como mínimo:\r\nAnálisis de la situación.\r\nDiagnóstico de la situación.\r\nObjetivos.\r\nEstrategias de marketing.\r\nPlanes de acción.\r\nIndicadores para el seguimiento del plan.\r\n Informe que evidencie la ejecución de las siguientes acciones:\r\nGestión de contactos con posibles clientes.\r\nAcompañamiento en reuniones de negocio con potenciales clientes.\r\nDos ejemplares de informe final en físico y digital (en CD) para la empresa y para CDMYPE.\r\n', 4, 70, '2015-05-08', 800.00, 6.33, 'Finalizada', 9, 9, 168, 159, '', NULL, '2015-05-06 03:14:08', '2015-10-14 21:58:11'),
(63, 'PLAN DE NEGOCIOS PARA FORTALECIMIENTO DE PLANTA FRUTANAL', 'Diseñar plan de negocios que guíe el crecimiento empresarial del proyecto “Planta de producción de jugo del falso fruto del marañón”.', 'Estudiar las generalidades del mercado del jugo de marañón, definir segmentos y estrategias para penetrar el mercado.\r\nDesarrollar la organización de la planta, enfatizando en el equipo de comercialización del producto.\r\nDeterminar la inversión en capital de trabajo y maquinaria para fortalecer la productividad de la planta, aumentando la producción en épocas de cultivo y minimizar los costos.\r\nRealizar las proyecciones financieras para determinar la rentabilidad y sostenibilidad del proyecto.\r\n', 'Diseño de plan de negocios que incluya como mínimo:\r\nResumen ejecutivo.\r\nEstudio de mercado.\r\nEstrategias de penetración del mercado.\r\nEstudio Técnico.\r\nEstudio de la Inversión.\r\nEstudio económico.\r\nEstudio Financiero.\r\n\r\nInforme que evidencie la ejecución de las siguientes acciones:\r\n\r\nActividades de levantamiento de información en campo y oficina de la empresa.\r\nTodas las demás actividades relacionadas con la ejecución de la consultoría.\r\n', 5, 70, '2015-05-08', 800.00, 6.33, 'Finalizada', 22, 9, 181, 298, '', NULL, '2015-05-09 04:08:03', '2015-10-14 21:57:53'),
(64, 'Diseño de piezas artesanales para UNIKE Artesanias', 'Dotar a la empresa UNIKE ARTESANIAS con una linea de productos diseñados acorde a la imagen que la empresa quiere proyectar.', 'Elaborar el diseño de piezas artesanales adecuadas a al imagen de la empresa.\r\n\r\nElaborar los moldes de las piezas artesanales.\r\n\r\nAyudar a la empresa con las técnicas de pintura y uso de la paleta de colores para la linea de diseño.', 'Diseño de linea artesanal de figuras "Religiosas" "animales" y otros, que estén de acuerdo a la imagen que la empresa quiere proyectar.\r\n\r\nElaborar los moldes de las piezas diseñadas.\r\n\r\nBrindar a los involucradas las técnicas de pintura a utilizar y el manejo de la paleta de  colores para la linea diseñada.\r\n\r\nElaborar informe físico y digital para empresario y CDMYPE\r\n\r\n', 4, 70, '2015-05-26', 800.00, 8.33, 'Finalizada', 12, 8, 91, 299, '', NULL, '2015-05-12 02:30:07', '2015-08-01 00:54:56'),
(65, 'TÉCNICAS DE DISEÑO PARA LA CONFECCIÓN DE ROPA DEPORTIVA', 'Proporcionar a la empresaria los conocimientos y las herramientas necesarias para que pueda confeccionar\r\nA partir de la asistencia técnica ropa deportiva.\r\n', 'Proporcionar patrones que permitan confeccionar uniformes deportivos para adultos y para niños.\r\nCapacitar e instruir a la empresaria en nuevas técnicas de confección,  armado y pegado de ropa deportiva.', 'Patrones para elaborar uniformes deportivos y ropa deportiva: Juego de uniforme de futbol para niño y adultos, juego de uniformes de básquet ball para niños y adultos, juego deportivo escolares (pants y camisas).\r\nDiferentes técnicas que faciliten la confección y armado de los juegos de uniforme y ropa deportiva.\r\nRecomendaciones en el uso adecuado de la maquinaria.\r\nRecomendaciones de las diferentes telas que se usan, hilos, elásticos y todo lo que tenga que ver con la confección de dichas prendas.\r\nLista de proveedores donde se pueda adquirir la materia prima.\r\nJuegos de patrones físicos y ensamblados en tamaño real para su uso, y en digital.\r\nElaborar prendas de los diferentes patrones, como prueba de funcionamiento de los mismos y satisfacción del empresario.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para la empresaria)\r\n', 5, 70, '2015-05-20', 800.00, 5.17, 'Finalizada', 10, 7, 304, 289, '', NULL, '2015-05-13 01:52:00', '2015-07-09 04:36:56'),
(66, 'Creación de herramientas publicitarias y promoción', 'Posicionar la imagen comercial de la Cooperativa en el mercado de opciones de financiamiento para mujeres empresarias', 'Mejorar la imagen comercial\r\nDesarrollar herramientas publicitarias\r\nProponer elementos publicitarios convencionales y digitales', 'Refrescamiento de marca\r\nLinea gráfica( papel membretado, tarjeta de presentación)\r\nRecomendación diseño rótulo en madera \r\nPlanograma\r\nBrochure\r\nBanner\r\nDiseño de vallas publicitarias\r\nCuña radial\r\n', 5, 70, '2015-06-05', 800.00, 8.33, 'Finalizada', 13, 4, 220, 210, '', NULL, '2015-05-20 03:19:07', '2015-10-13 21:37:14'),
(67, 'Desarrollo de diseño artesanales en barro para mercado internacional', '-Desarrollar nuevos productos artesanales de piezas en barro orientado a un mercado europeo y centroamericano ', 'Crear diseños de productos en barro de acuerdo a gustos y preferencias del mercado objetivo\r\nCapacitar al personal en el proceso de creación de diseños identificados\r\n', '- Prototipo linea decoración para salas de estar (tres piezas individuales que puedan conformar un set)\r\n- Prototipo linea de decoración para cocina (tres piezas individuales que puedan conformar un set)\r\n- Prototipo linea de decoración para estudios (tres piezas individuales que puedan conformar un set)', 6, 70, '2015-06-24', 800.00, 7.17, 'Finalizada', 11, 4, 309, 304, '', NULL, '2015-05-26 02:00:46', '2015-12-15 16:47:54'),
(68, 'Técnica de Pirograbado e Iconografía en morro, textil y barro para Taller Ketsalí', 'Adquirir conocimientos teóricos y prácticos en la técnica de pirograbado e iconografía para la aplicación en los productos que se comercializan.', 'Diversificar los productos con la aplicación de nuevas técnicas.\r\nRealizar nuevos diseños de grabados con la aplicación de iconografía en los diferentes tipos de productos.\r\nAmpliar los mercados en los que se comercializa tanto a nivel nacional como internacional\r\n', 'Nuevos diseños por producto (morro, textil y barro) con la aplicación de iconografía\r\nManual con la información teórica de la técnica de pirograbado.\r\nRecomendaciones y conclusiones\r\nEntrega de informe final digital e impreso (Copia para CDMYPE y copia para empresario).', 4, 70, '2015-06-08', 800.00, 8.00, 'Finalizada', 11, 6, 33, 28, '', NULL, '2015-05-28 22:02:13', '2015-07-28 20:09:31'),
(69, 'Diseño de página web para taller Ketsali', 'Diseñar una página web para el taller Ketsali, ubicado en el municipio de Sensuntepeque del  departamento de Cabañas en la cual pueda dar a conocer sus productos.', 'Diseñar una página web para la empresa.\r\nContar con un sitio en internet para la publicación de los productos de la empresa.\r\nMejorar la visibilidad de la empresa teniendo presencia en internet .', 'Pagina responsive que se adapte a cualquier dispositivo.\r\nPagina de inicio, contendrá la historia de la empresa.\r\nProductos, mostrará el producto de la empresa .\r\nComentarios, Sección para mostrar algunas historias de los clientes.\r\nContactenos,formulario de consultas en el que el usuario pueda enviar mensajes al administrador de la página.\r\nLa pagina debe de tener interacción con redes sociales en todas sus secciones, poseer el botón de me gusta de Facebook,y compartir par que se pueda compartir el contenido de la pagina.\r\nLa página web debe quedar en internet de manera que la empresa pueda utilizarla al finalizar la asistencia técnica.\r\nManual de usuario para la administración de la página web.\r\nElaborar un informe final el cual será entregado tanto en físico como en digital a la empresa como a CDMYPE.\r\nCapacitar al menos a un integrante de la empresa en la administración y uso de la página web.\r\na pagina web debe tener los logos de apoyo del cdmype.\r\n', 4, 70, '2015-06-04', 800.00, 8.00, 'Finalizada', 1, 2, 33, 28, '', NULL, '2015-05-29 22:50:06', '2015-10-01 21:52:43'),
(71, '“DISEÑO  DE CATALOGO FÍSICO Y DIGITAL Y FORTALECIMIENTO COMERCIAL A LINEA GRÁFICA PARA ARTESANÍAS CIUDAD VIEJA.', 'Obtener una herramienta que sirva de apoyo de comercialización y fortalecer las alianzas de negociación con empresas, instituciones, clientes y turistas que compran Artesanías de Ciudad Vieja.', 'Mejorar la visibilidad de la marca Artesanías Ciudad Vijea ante los clientes y turistas.\r\nLograr el incremento de las ventas de los productos  que ofrece el artesano.\r\nObtener una herramienta de promoción para dar a conocer los productos que ofrece Artesanías Ciudad Vieja.\r\n', 'Crear y diseñar un catálogo físico (en archivo editable y PDF), de los productos que ofrece el artesano.\r\nToma de fotografías de los diferentes productos que contendrá el catalogo.\r\nClasificar los productos  por sus especialidades y segmentos.\r\nRefrescamiento de marca comercial y logotipo de la empresa.\r\nDiseño de banner publicitario con línea gráfica refrescada.\r\nDiseño de una viñeta para los productos artesanales.\r\nDiseño de un sello de marca para productos artesanales.\r\nDiseño de tarjeta de presentación con marca refrescada.\r\nManual uso de Marca.\r\nTodos los artes en poder del empresario y CDMYPE.\r\nPresupuesto sobre los costos de impresión del catálogo físico.\r\nPropuestas de herramientas tecnológicas para publicación de catálogo virtual.\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 4, 70, '2015-08-18', 800.00, 5.50, 'Finalizada', 13, 5, 265, 252, '', NULL, '2015-05-30 22:23:49', '2015-09-23 01:36:37'),
(72, 'Diseño de página web para venta de libros.', 'Diseñar un sitio en el cual se pueda tener una ventana para que el empresario pueda dar a conocer sus libros.', 'Diseñar un sitio web para el empresario Antonio Mauricio Flores.\r\nContar con presencia en internet en la cual se pueda dar a conocer los libros del empresario.\r\nMejorar la visibilidad de la empresa teniendo presencia en internet . ', 'Pagina responsive que se adapte a cualquier dispositivo.\r\nPagina en la que se pueda mostrar el contenido del libro con la opción de compra del mismo.\r\nUn espacio para blog en el que el empresario pueda escribir.\r\nEl sitio web debe ser creado con un administrador de contenido, de preferencia Wordpress.\r\nEnlace a Google Analytics para que el empresario conozca las visitas que está teniendo el sitio web.\r\nContactenos,formulario de consultas en el que el usuario pueda enviar mensajes al administrador de la página.\r\nLa pagina debe de tener interacción con redes sociales en todas sus secciones, poseer el botón de me gusta de Facebook,y compartir par que se pueda compartir el contenido de la pagina.\r\nLa página web debe quedar en internet de manera que la empresa pueda utilizarla al finalizar la asistencia técnica.\r\nManual de usuario para la administración de la página web.\r\nElaborar un informe final el cual será entregado tanto en físico como en digital a la empresa como a CDMYPE.\r\nCapacitar al menos a un integrante de la empresa en la administración y uso de la página web.\r\nLa pagina web debe tener los logos de apoyo del cdmype.\r\n', 4, 70, '2015-06-10', 800.00, 5.50, 'Finalizada', 1, 2, 307, 301, '', NULL, '2015-06-05 22:32:01', '2015-11-06 17:12:44'),
(73, 'PLAN DE NEGOCIOS PARA AMPLIACIÓN DE OFERTA DE PANADERÍA RIKOPÁN', 'Planificar la ampliación y diversificación de la oferta de la panadería, desarrollando un proceso ordenado que minimice el riesgo del negocio.', '•	Estudiar las generalidades del mercado de alimentos en Sensuntepeque.\r\n•	Evaluar la capacidad y diseñar los procesos para atender el Mercado.\r\n•	Determinar la inversión en capital de trabajo y maquinaria para fortalecer la productividad.\r\n•	Realizar las proyecciones financieras para determinar la rentabilidad y sostenibilidad del proyecto.\r\n', 'Diseño de plan de negocios que incluya:\r\n\r\nResumen Ejecutivo.\r\nAnálisis de la oportunidad.\r\nModelo de negocios.\r\nAnálisis del sector.\r\nEstrategia de implementación del modelo de negocios:\r\nEstrategia comercial y plan de marketing.\r\nPlan de operaciones.\r\nGestión del talento humano.\r\nAnálisis económico-financiero.\r\nAnálisis de riesgos y mitigación\r\nConclusiones y recomendaciones.\r\n\r\nInforme que evidencie la ejecución de las siguientes acciones:\r\n\r\nActividades de levantamiento de información en campo y oficina de la empresa.\r\nTodas las demás actividades relacionadas con la ejecución de la consultoría.\r\n\r\nDos ejemplares de informe final en físico y digital (en CD) para la empresa y para CDMYPE.', 5, 70, '2015-06-16', 800.00, 16.67, 'Finalizada', 19, 3, 9, 5, '', NULL, '2015-06-13 04:10:50', '2015-09-10 04:36:08'),
