(76, 'Propuesta de crédito para empresa LUBRICANTES FIRESTONE', 'Obtener crédito para la empresa LUBRICANTES FIRESTONE, para invertir en el negocio.', 'Presentar una solicitud de crédito más formal en base a un estudio del mercado y empresa.\r\nTener las mejores condiciones de financiamiento que abonen al desarrollo empresarial.\r\nTener capital para invertir en la empresa.', 'Nombre de la empresa que solicita la propuesta de crédito.\r\nNombre del representante del negocio.\r\nDirección y contactos.\r\nHistoria del origen de la empresa.\r\nEvolución de la gestión empresarial.\r\nCumplimiento de los compromisos crediticios anteriores.\r\nCapacidad de administrar la empresa.\r\nMonto solicitado del financiamiento.\r\nDestino del financiamiento.\r\nPlazo recomendado del financiamiento.\r\nAnálisis financiero: histórico y proyectado\r\nRazón de Liquidez.\r\nRazón de Rentabilidad.\r\nRazón de Apalancamiento o endeudamiento.\r\nRazón de Eficiencia o Actividad.\r\nRazón de Cobertura.\r\nAnálisis de la garantía.\r\nGarantía ofrecida por la empresa y su máxima responsabilidad crediticia.\r\nAnálisis del crédito desde el punto de vista financiero de la inversión.\r\nImpacto del crédito.\r\n', 4, 70, '2015-06-20', 800.00, 0.00, 'Finalizada', 6, 12, 313, 308, '', NULL, '2015-06-17 02:29:25', '2015-12-15 16:47:23'),
(77, 'Diseño de Imagen Corporativa para la ACD ', 'Dotar a la ACD, de una imagen comercial en relación con la visión de desarrollo de su propietaria, fortaleciendo así la estrategia de posicionamiento de la empresa. ', 'Crear el logotipo de la empresa y crear junto a ellos un slogan.\r\nDiseño de marcas comerciales de las líneas de los productos de la empresa.\r\nDesarrollar material publicitario para posicionar la marca de la empresa. \r\n', 'Creación de logotipo de la empresa y creación de slogan.\r\nElaborar marca comercial para  las líneas de productos que la empresa sacara al mercado.\r\nDiseño de tarjeta de presentación, banner, rotulo, broshure y artículos promocionales como camiseta, llavero, calendario y otros.\r\nPapelería interna de la empresa y sello.\r\nManual de uso de marca.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).', 4, 70, '2015-06-22', 800.00, 7.17, 'Finalizada', 13, 8, 69, 309, '', NULL, '2015-06-17 04:02:11', '2015-08-11 01:32:46'),
(78, 'Mejora en los procesos  y gestión sanitaria de productos agroindustriales: Vinos, extracto y sirope ', 'Mejorar la calidad de productos agroindustriales, atendiendo a los requisitos y normativas establecidas para los mismos a nivel nacional e internacional. ', '- Mejorar la formulación de productos agroindustriales: vino, extracto y sirope atendiendo a los gustos y preferencias del mercado\r\n- Capacitar al personal en la correcta elaboración y manipulación de los productos siguiendo formulaciones estandarizadas y manejo de fichas técnicas\r\n- Alcanzar los requisitos de calidad e inocuidad, etiquetado y empaque, exigidos por los entes y normas correspondientes ', 'Estandarización de fórmulas y fichas técnicas de extracto, sirope y vino de flor de rosa de jamaica y vino de marañon\r\nTabla nutricional teóricas de extracto y sirope de flor de rosa de jamaica\r\nContenido de etiquetado para productos de sirope, extracto y vino de flor de rosa de jamaica, vino de marañon, atendiendo a las normativas de etiquetado nacional e internacional\r\nAnálisis de grado de alcohol de vino de marañón y jamaica\r\nPropuesta de gestión y presupuesto de registro sanitario de Sirope, vino y extracto de flor de rosa de jamaica atendiendo a los requisitos de las normas e instancias correspondientes\r\nRecomendaciones sobre envasado y tipo de empaque para extracto, sirope y vino\r\nPersonal capacitado en producción, buenas prácticas de manufactura, higiene y manipulación de los productos en mención\r\nIndicaciones sobre la determinación de vida útil de sirope, extracto de rosa de jamaica y vinos de marañon y rosa de jamaica\r\n\r\n \r\n', 5, 70, '2015-07-23', 800.00, 7.17, 'Finalizada', 28, 4, 311, 307, '', NULL, '2015-06-18 11:20:02', '2015-10-24 02:13:10'),
(79, 'DISEÑO DE UN PLAN DE COMUNICACIÓN PARA LA  MARCA LA ESPAÑOLA Y ESTRATEGIAS DE LANZAMIENTO PARA NUEVA SALA DE VENTA.', 'Diseñar y desarrollar un plan de comunicación para La Española y lograr el posicionamiento esperado de la marca y apertura de nuevo local a través de la creación y ejecución de estrategias de publicidad convencional dirigidas al segmento de mercado San Salvador.', 'Diseñar estrategias para promocionar la nueva sala de ventas de La Española en San Salvador.\r\nCrear un plan de comunicación para posicionar la marca La Española.\r\nAcompañar al empresario en la ejecución efectiva de cada estrategia a implementar.\r\nElaborar un plan de Social Media con cobertura de 12 meses de comunicación.\r\nEjecutar Plan de Social Media de los primeros meses de lanzamiento de la nueva tienda y reconocimiento de la marca.\r\nPosicionar y promocionar el servicio DELIMARKET para la nueva sala de venta.', 'Diseñar estrategias de publicidad convencional  para promocionar la nueva sala de ventas de La Española en San Salvador.\r\nCrear un plan de comunicación para posicionar la marca La Española (Cuentan con linea gráfica comercial).\r\nElaborar un plan de Social Media con cobertura de 12 meses de comunicación.\r\nEjecutar Plan de Social Media de los primeros meses de lanzamiento de la nueva tienda y reconocimiento de la marca.\r\nAcompañar y asesorar al empresario en la ejecución efectiva de cada estrategia a implementar.\r\nPosicionar y promocionar el servicio DELIMARKET para la nueva sala de venta.', 5, 70, '2015-07-21', 800.00, 15.00, 'Finalizada', 9, 5, 257, 244, '', NULL, '2015-07-01 23:42:08', '2015-09-16 19:30:46'),
(80, 'Creación de marca, viñeta y línea gráfica para bebida en polvo nutricional', 'Crear una marca y herramientas gráficas que sirvan de herramientas para las estrategias de posicionamiento de la bebida nutricional en polvo. \r\n\r\n\r\n', 'Crear una marca atractiva y elementos gráficos para bebida en polvo nutricional\r\nCreación de viñeta  para bebida en polvo nutricional según reglamento para etiquetado de alimentos pre-envasados\r\n', 'Marca y logotipo\r\nBúsqueda de marca en CNR\r\nManual de marca\r\nViñeta para tres productos en presentaciones de 1lb, 2lb y 250ml\r\nLínea gráfica (Tarjetas de presentación, hojas membretadas)\r\nBanner\r\nHojas volantes\r\nDisplay para exhibición de productos\r\nCover de Fanpage\r\nVídeo de 3 minutos ', 4, 70, '2015-07-25', 800.00, 5.17, 'Finalizada', 13, 4, 298, 287, '', NULL, '2015-07-04 03:19:26', '2015-09-09 20:12:06'),
(81, 'Mejora y creación de productos de tocador', 'Desarrollar el proceso de formulación, mejoramiento de calidad y elaboración de dos nuevos productos Rinse y gotas para el cabello, logrando fortalecer la competitividad a través del desarrollo de productos.', 'Detallar el proceso de formulación y mejorar la calidad de todos los productos Tulita, Shampoo, sábila, manzanilla, romero y sapuyulo, crema de sábila, gelatina y crema para el cabello.\r\nCapacitar sobre el proceso correcto de elaboración de los productos y las recomendaciones de uso.\r\nCrear, demostrar y enseñar el proceso de elaboración de los productos rinse y gotas par el cabello.', 'Que las empresarias obtengan dos productos nuevos rinse y gotas para el cabello\r\nEmpresarias con conocimientos claros en la elaboración de sus productos\r\nObtener productos de calidad que generen confianza al cliente\r\nEmpresarias capacitadas en la elaboración y venta de sus productos\r\nDocumento impreso con la fórmula y estandarización de los todos productos.', 5, 70, '2015-07-10', 800.00, 4.67, 'Finalizada', 28, 7, 316, 296, '', NULL, '2015-07-04 21:41:49', '2015-08-24 22:52:38'),
(82, 'Diseño de pagina web para Restaurante los Tres Cerditos', 'Diseñar una página web para el Restaurante los Tres Cerditos, ubicado en el municipio de Ilobasco del  departamento de Cabañas-.', 'Diseñar una página web para que el restaurante pueda mostrar los servicios de comida.\r\nMejorar la visibilidad de la empresa teniendo presencia en internet .\r\nContar con un sistema informático para que el empresario pueda obtener la información de encuestas de los clientes.', 'El sitio se devidirá en la parte que será vista por el cliente y la parte para el administrador en el cual el empresario podrá modificar toda la información del sitio, así como ver los informes de las evaluaciones de los clientes.\r\nPágina adaptativa para que el sitio se adapte a cualquier dispositivo que lo visite.\r\nLa página debe mostrar los servicios y platillos que tiene el restaurante.\r\nComentarios, Sección para mostrar algunas historias de los clientes.\r\nContactenos,formulario de consultas en el que el usuario pueda enviar mensajes al administrador de la página.\r\nLa pagina debe de tener interacción con redes sociales en todas sus secciones, poseer el botón de me gusta de Facebook,y compartir par que se pueda compartir el contenido de la pagina.\r\nLa página web debe quedar en internet de manera que la empresa pueda utilizarla al finalizar la asistencia técnica.\r\nManual de usuario para la administración de la página web.\r\nElaborar un informe final el cual será entregado tanto en físico como en digital a la empresa como a CDMYPE.\r\nCapacitar al menos a un integrante de la empresa en la administración y uso de la página web.\r\na pagina web debe tener los logos de apoyo del cdmype.\r\n', 4, 70, '2015-07-16', 800.00, 15.00, 'Finalizada', 1, 2, 308, 302, '', NULL, '2015-07-09 01:32:12', '2015-12-04 16:00:22'),
(83, 'AT PARA DISEÑO DE NUEVOS EMPAQUES Y MEDIOS PUBLICITARIOS  PARA PANADERIA JOSEFINA', 'Diseñar empaques para nueva línea de productos Gourmet de la panadería y diseño de material publicitario que sirva de apoyo de comercialización y fortalezca la venta de los productos, logrando captar la atención de nuevos clientes.', 'Obtener a través del diseño de empaques y diseños de material publicitario herramientas estrategias comerciales que contribuyan a lograr un mejor posicionamiento comercial de los productos Panadería y Pastelería Josefina.', 'Creación y diseño de empaques para productos:\r\nTorta de Fruta (1 unidad)/ Empaque en Bolsa.\r\n Galleta 16 Unidades/ Empaque Bolsa.\r\nSemita  (1 unidad)/ Empaque Bolsa.\r\nBollerias (Novias, torta seca y picudas)/ Empaque Bolsa.\r\nFotografías en todos los diseños de empaque.\r\nTomo de fotografías como parte de la consultoría.\r\nDiseño estándar de Flyer de los productos Panadería Josefina.\r\nDiseño de Banner para promover nuevos productos.\r\nDiseño de Afiches para promover nuevos productos.\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).', 5, 70, '2015-07-10', 800.00, 15.00, 'Finalizada', 13, 9, 318, 312, '', NULL, '2015-07-09 01:42:15', '2015-09-22 22:02:22'),
(84, 'AT PARA DISEÑO DE NUEVAS TÉCNICAS DE TEÑIDO DE AÑIL EN PRENDAS DE VESTIR Y PRODUCTOS ARTESANALES', 'Enseñar a las participantes diferentes técnicas japonesas en añil por medio de las cuales se creen y se aprendan los diseños de amarrado, cocido, doblado y empastado.', 'Que las socias manejen y practiquen las diferentes técnicas de teñido en añil  innovadoras, aprendidas en la consultoría.', 'Enseñar y practicar las diferentes técnicas de añil.\r\nTécnica del amarrado o TIE DYE.\r\nTécnica del cocido SHIBORI.\r\nTécnica del doblado o ITAJIME\r\nTécnica del Repeal o Empastado.\r\nTécnica de Batik o encerado.\r\nPreparación de la tía del añil para las prendas y productos artesanales.\r\nDiseño de  técnicas para productos artesanales.\r\nFotografías en todas las técnicas y diseños trabajados con las socias.\r\nManual de uso de cada una de las técnicas aprendidas para un mejor aprovechamiento de las técnicas.\r\nTomo de fotografías como parte de la consultoría.\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 4, 70, '2015-07-15', 800.00, 5.17, 'Finalizada', 10, 9, 319, 313, '', NULL, '2015-07-09 04:00:35', '2015-12-15 16:46:35'),
(85, 'Diseño de Imagen Comercial para Espumillas La Purísima.', 'Dotar a la empresa "Espumillas La Purísima", de una imagen comercial en relación a la visión de desarrollo de su propietaria y contribuir así al fortalecimiento de la estrategia de posicionamiento de la empresa.', 'Crear el logotipo de la empresa y crear junto a la empresaria un slogan.\r\nDiseño de marcas comerciales de las líneas de los productos de la empresa.\r\nDesarrollar material publicitario para posicionar la marca de la empresa.', 'Creación de logotipo de la empresa y creación de slogan.\r\nContribuir con la propietaria en escoger un nombre para su marca de espumillas.\r\nElaborar marca comercial para los productos que la empresa saca al mercado.\r\nDiseño de tarjeta de presentación, banner, rotulo, broshure y artículos promocionales como camiseta,\r\nllavero, calendario y otros.\r\nPapelería interna de la empresa y sello.\r\nManual de uso de marca.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario)', 4, 70, '2015-07-17', 800.00, 8.33, 'Finalizada', 13, 8, 73, 68, '', NULL, '2015-07-10 23:20:51', '2015-12-15 16:46:22');
