(86, 'Diseño de Imagen Corporativa para Clínica San José', 'Dotar a la empresa "Clínica San José", de una imagen corporativa en relación a la visión de\r\ndesarrollo de su propietario y contribuir así al fortalecimiento de la estrategia de posicionamiento de\r\nla empresa.', 'Crear el logotipo de la empresa y crear junto a la empresaria un slogan.\r\nDiseñar el concepto gráfico del establecimiento de  de la empresa.\r\nDesarrollar material publicitario para posicionar la marca de la empresa.', 'Al finalizar la asistencia técnica, donde el consultor contratado deberá hacer visitas in situ para desarrollar el\r\ntrabajo siguiente:\r\nCreación de logotipo de la empresa y creación de slogan.\r\nDiseño y recomendaciones de uso de las aplicaciones de la linea gráfica que la empresa debe utilizar en su establecimiento.\r\nDiseño de tarjeta de presentación, banner, rotulo, broshure y artículos promocionales como camiseta,\r\nllavero, calendario y otros.\r\nPapelería interna de la empresa y sello.\r\nRecomendaciones de colores a utilizar aplicados en el establecimiento.\r\nManual de uso de marca.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario)', 4, 70, '2015-07-17', 800.00, 10.00, 'Finalizada', 13, 8, 320, 314, '', NULL, '2015-07-11 01:07:31', '2015-10-03 01:45:24'),
(87, 'Técnicas de diseño y confección de prendas de vestir para Damas.', 'Fortalecer las destrezas y habilidades en la elaboración de prendas de vestir para damas.', 'Dar a conocer de forma práctica las técnicas de cómo hacer patrones según el diseño para ropa de damas. \r\nAyudar a la empresaria a implementar nuevas técnicas de corte y confección que le permitan facilitar la toma de medidas, el corte, confección, armado y pegado de las diferentes prendas de vestir para damas.\r\nConfeccionar y demostrar el proceso de la elaboración de faldas, blusas, chaquetas y pantalones de mujer\r\nRealizar de forma practica la elaboración de las diferentes prendas de vestir incluyendo uniformes escolares.', 'Colección de diseños de ropa para damas y sus respectivos patrones.\r\nColección diseño traje completo para damas que incluya falda y chaqueta,  pantalón y chaqueta,  y sus respectivos patrones.\r\nElaboración de diseño de vestidos de fiesta y sus respectivos patrones.\r\nEmpresaria con conocimientos firmes en la confección de prendas de vestir para damas.\r\nFicha técnica de cada diseño. \r\nObtener prendas de vestir de máxima calidad.', 5, 70, '2015-07-21', 800.00, 4.67, 'Finalizada', 10, 7, 139, 131, '', NULL, '2015-07-16 02:58:25', '2015-10-07 21:32:53'),
(88, 'Confección y patronaje de uniformes deportivos. ', 'Proporcionar a la integrantes de la Asociación los conocimientos y las herramientas necesarias para la confección de uniformes deportivos por tallas.', 'Entregar y enseñar el uso de patrones en tallas S,M,L,XL que permitan confeccionar uniformes deportivos para adultos y para niños.\r\nCapacitar e instruir a las participantes en nuevas técnicas de confección por tallas S,M,L,XL, armado y pegado de ropa deportiva\r\nEnseñar a las participantes como trabajar con tallas S,M,L,XL, los uniformes deportivos.\r\nCapacitar a las participantes en el uso de las maquinas de coser utilizadas para la confección de uniformes deportivos.', 'Patrones por tallas S,M,L y XL, para la elaboración de uniformes deportivos (calzoneta y camisa y pants y camisa), de fútbol y baloncesto.\r\nDiferentes técnicas que faciliten la confección y armado de los conjuntos de ropa deportiva.\r\nRecomendaciones en el uso adecuado de la maquinaria.\r\nRecomendaciones de las diferentes telas que se usan, hilos, elásticos y todo lo que tenga que ver con la\r\nconfección de dichas prendas.\r\nLista de proveedores donde se pueda adquirir la materia prima.\r\nJuegos de patrones en tallas, S,M,L Y XL, físicos y ensamblados en tamaño real para su uso, y en digital.\r\nElaborar prendas de los diferentes patrones, como prueba de funcionamiento de los mismos y satisfacción de las participantes.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para la empresaria).', 5, 70, '2015-08-14', 800.00, 4.33, 'Finalizada', 10, 7, 137, 129, '', NULL, '2015-07-16 03:44:52', '2015-10-07 20:13:14'),
(89, 'Propuesta de Financiamiento', 'Obtener crédito para la empresa Industrias Ilomodas S.A. de C.V., para invertir en el proyecto de compra de inmueble y construcción de fabrica para confecciones.', 'Presentar una solicitud de crédito formal en base a un estudio financiero de la empresa.\r\nTener las mejores condiciones de financiamiento que ayuden al desarrollo empresarial.\r\nTener capital para invertir en el proyecto.\r\n', 'Nombre de la empresa que solicita la propuesta de crédito.\r\nNombre del representante de la empresa. \r\nDirección y contactos.\r\nHistoria del origen de la empresa. \r\nEvolución de la gestión empresarial. \r\nCumplimiento de los compromisos crediticios anteriores. \r\nCapacidad de administrar la empresa. \r\nMonto solicitado del financiamiento\r\nDestino del financiamiento. \r\nPlazo recomendado del financiamiento.\r\nAnálisis de periodo de gracia 1 y 2 años\r\nAnálisis financiero: histórico y proyectado\r\nRazón de Liquidez.\r\nRazón de Rentabilidad.\r\nRazón de Apalancamiento o endeudamiento. \r\nRazón de Eficiencia o Actividad.\r\nRazón de Cobertura.\r\nAnálisis de la garantía. \r\nGarantía ofrecida por la empresa y su máxima responsabilidad crediticia.\r\nAnálisis del crédito desde el punto de vista financiero de la inversión.\r\nImpacto del crédito.\r\n', 4, 70, '2015-08-08', 800.00, 0.00, 'Finalizada', 6, 12, 295, 284, '', NULL, '2015-07-31 03:04:50', '2015-09-04 00:40:15'),
(90, 'Diseño de Logo e Imagen Comercial para Industrias JM', 'Adquirir un logo y una imagen comercial para la empresa que le identifique dentro de los mercados en los que comercializa sus productos.', 'Diseño de logo que incorpore colores y elementos acordes al producto y al mercado al que se dirige la empresa.\r\nCrear y adaptar un nombre comercial o marca que contribuyan a un mejor posicionamiento comercial de la empresa.\r\nDiseñar una propuesta de catalogo de productos que se adapte a la nueva imagen de la empresa.', 'Elaboración de logo\r\nCreación de marca e imagen comercial\r\nDiseño de catálogo de productos.\r\nDiseño de tarjetas de presentación de acorde a la nueva imagen creada.\r\nDiseño de brouchure y hojas volantes con la nueva imagen creada.\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\nTodos los artes editables en poder de empresario y CDMYPE-UNICAES.\r\n', 4, 70, '2015-08-12', 800.00, 9.17, 'Finalizada', 13, 6, 51, 47, '', NULL, '2015-08-08 21:36:12', '2015-10-03 20:04:40'),
(91, 'Diseño y elaboración de Joyería Artesanal en barro', 'Fortalecer los procesos de elaboración y creación de nuevos diseños, buscando satisfacer a más segmentos de mercado y llegar a clientes que desean productos innovadores y de mejor calidad.', 'Diseñar nuevos productos de joyería artesanal en barro con características y técnicas innovadoras.\r\nFortalecer la identidad y los aspectos característicos del taller en cuanto a sus productos y nuevos diseños\r\nMejorar el proceso de elaboración de diseños artesanales e incrementar la productividad y el beneficio económico de la empresa. \r\n', 'Diseño y creación de productos de joyería artesanal con la aplicación de nuevas técnicas en mezclas y texturas que cumplan con las exigencias del mercado actual.\r\nPrototipos de los productos diseñados.\r\nProceso de elaboración de moldes.\r\nManual con el proceso de diseño y elaboración de los productos.\r\nRecomendaciones y conclusiones generales.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresarios)\r\n', 4, 70, '2015-08-18', 800.00, 4.83, 'Finalizada', 11, 6, 19, 17, '', NULL, '2015-08-10 20:06:44', '2015-10-22 03:48:58'),
(92, 'Elaboración de plan de negocios', 'Elaboración de plan de negocio que permita a la empresaria generar una visión estratégica de su negocio y la búsqueda de oportunidades en el mercado para el crecimiento y rentabilidad económica.', 'Elaboración de plan de negocio para la identificación de clientes/as potenciales, que puedan demandar los productos. \r\nEstablecer objetivos estratégicos que orienten a la empresaria a la creación de una visión de futuro empresarial. \r\nRealizar las proyecciones financieras para determinar la rentabilidad y sostenibilidad del proyecto en un periodo de cinco años.', 'Contenido del plan de Negocio\r\nIntroducción \r\nDescripción del negocio\r\nNaturaleza de la empresa\r\nPlataforma Estratégica\r\nLema \r\nMisión\r\nVisión\r\nValores\r\nObjetivos Generales del negocio \r\nObjetivos específicos \r\nEl mercado\r\nInvestigación de Mercado\r\nMercado objetivo\r\nEstrategias de promoción de los productos\r\nProyección de Ventas para cinco años\r\nProducción\r\nNiveles de producción \r\nproyección a cinco años\r\nLa prestación del servicio\r\nDescripción del proceso de prestación de servicio \r\nOrganización \r\nFODA\r\nFinanzas \r\nInversión Inicial, terreno, construcción de local, mobiliario y equipo, otros.\r\nGastos \r\nAnálisis de costos \r\nAnexos \r\nSe debe contar con dos documentos, uno para la propietaria y otro para el CDMYPE en físico y CD', 5, 70, '2015-08-26', 800.00, 4.67, 'Finalizada', 22, 7, 124, 116, '', NULL, '2015-08-13 19:46:28', '2015-11-18 18:56:39'),
(93, 'Proceso de elaboración de alimentos en base a carnes, aves y mariscos.', 'Diversifican de alimentos en base a carnes, aves y mariscos.', 'Elaboración de menú para carnes, aves y mariscos\r\nDar a conocer el procedimiento de elaboración de los diferentes menú de carnes, aves y mariscos.\r\nVariedad de guarnición (alimentos que acompañan el plato principal).\r\nAplicar diferentes técnicas de decoración para presentar los menú.\r\nControl de calidad en la fabricación de alimentos.', 'Procesos de elaboración de menú  de aves, carnes y mariscos con su procedimiento.\r\nEmpresarias capacitadas en la elaboración de guarniciones.\r\nExplicar el proceso y procedimiento de la elaboración de los diferentes menú de comida.\r\nEstablecer el costo de cada uno de los menú.\r\nDar a conocer los Tips de cocina y términos de cocción\r\nEmpresarias capacitadas en Buenas Practicas de Manufactura.\r\nDocumento impreso que incluya el proceso de los menú y la  estandarización de los todos productos.', 5, 70, '2015-08-24', 800.00, 4.33, 'Finalizada', 20, 7, 123, 315, '', NULL, '2015-08-14 03:13:06', '2015-10-28 22:40:40'),
(94, 'Diversificación de Productos Cárnicos', 'Incrementar la oferta de embutidos por medio de la creación de fórmulas orientadas a la satisfacción del mercado.', 'Diseñar nuevas fórmulas de embutidos.\r\nCapacitar al personal de producción para la elaboración de las nuevas fórmulas.\r\nRealizar el costeo de los nuevos productos.\r\n', '•	Creación de 5 nuevas formulaciones.\r\n•	Documento que contenga la descripción de las formulaciones.\r\n•	Elaboración de los nuevos productos.\r\n•	Capacitación del personal en la elaboración y manejo de las nuevas formulaciones.\r\n•	Costeo de los nuevos productos.\r\n•	Actividad de validación de los nuevos productos en el mercado.\r\n\r\nInforme que evidencie la ejecución de las actividades relacionadas a la asistencia técnica.\r\nDos ejemplares de informe final en físico y digital (en CD) para la empresa y para CDMYPE.\r\n', 4, 70, '2015-08-21', 800.00, 6.33, 'Finalizada', 7, 3, 188, 179, '', NULL, '2015-08-17 22:12:10', '2015-11-06 21:11:16'),
(95, 'Creación de diseños de bisutería artesanal ', 'Crear diseños para diferentes líneas de bisutería con la combinación de materiales de calidad, considerando las exigencias y tendencias del mercado.', 'Aprender el manejo y preparación de materia prima de calidad para elaborar bisutería en morro, semillas naturales y madera.\r\nElaborar bisutería en nudos en los materiales y técnicas apropiadas\r\nConocer diferentes técnicas de ensamblaje para la creación de nuevas lineas de bisutería.\r\nAprender técnicas de decoración y pintura para las materias primas que se trabajen de forma combinada.\r\n \r\n \r\n', 'Diseño de pulseras para hombre y mujer en los diferentes materiales solicitados\r\nDiseño de collares, aretes, pulseras y anillos en los diferentes materiales solicitados\r\nManual de procedimiento para la implementar técnicas de bisutería \r\n\r\n\r\n', 4, 70, '2015-08-28', 800.00, 3.50, 'Finalizada', 12, 4, 321, 316, '', NULL, '2015-08-18 00:55:01', '2015-10-17 03:56:38'),
(96, 'DISEÑO DE COLECCIÓN DE PRODUCTOS ARTESANALES INNOVADORES PARA RED JUVENIL DE ARTESANOS.', 'Desarrollar productos elaborados en barro considerando las tendencias de mercado con alto potencial de demanda.', 'Diseñar productos en barro innovadores y vanguardistas \r\nAcompañar en el proceso de moldeo de líneas de productos en barro\r\nAplicar técnicas innovadoras, vanguardista de difícil imitación.\r\n', 'Diseños de Línea de superficie (3 piezas)\r\nDiseños de Línea de luminarias (3 piezas)\r\nDiseños de Línea de candelabros (3 piezas)\r\nDiseños de Línea de Vajilla (3 piezas).\r\nDiseños de hierro forjado para presentación de artesanías en arcilla y adornos en metal ( 6 piezas)\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 4, 70, '2015-09-01', 800.00, 4.33, 'Enviado', 12, 8, 67, 62, '', NULL, '2015-08-18 02:25:33', '2015-08-29 23:57:01'),
(97, 'Diseño de calzado y técnicas de elaboración de zapatos para la empresa Zapatería Flores', 'Dotar a Zapatería Flores de nuevos diseños de zapatos y técnicas de elaboración de calzado.', 'Elaborar diseños de calzado escolar para niños y niñas.\r\nElaborar diseños de calzado cerrado para mujeres.\r\nDotar a los zapateros propietarios de las técnicas necesarias para la elaboración de los calzados diseñados.', 'Elaboración de diseños de calzado escolar para varones.\r\nElaboración de diseños de calzado escolar para niñas.\r\nElaboración de diseño de zapato cerrado para mujeres y varones.\r\nEnseñar técnica de ensamble de zapatos diseñados.\r\nInstruir a los propietarios con técnicas de zapatería que puedan utilizar para mejorar la calidad del calzado.\r\nDeterminar el costo de los zapatos diseñados.\r\nDocumento final escrito impreso y en disco, con copia empresario y CDMYPE.', 5, 70, '2015-08-25', 800.00, 5.50, 'Finalizada', 21, 8, 74, 69, '', NULL, '2015-08-18 03:11:13', '2015-11-04 14:00:15'),
(98, 'Creación de imagen empresarial y  herramientas de promoción y publicidad de Cooperativa Fuente de Vida de R.L', 'Desarrollar herramientas de visualización para el posicionamiento empresarial  y lanzamiento de nueva linea de servicios de ahorro. ', 'Crear marca y línea gráfica comercia\r\nElaborar herramientas gráficas convencionales y digitales para implementación de estrategias de promoción, lanzamiento y publicidad\r\nDesarrollar propuesta de imagen empresarial interna y externa. \r\n\r\n', 'Marca\r\nManual de uso de marca\r\nPlanograma de diseño espacio interior y exterior\r\nRótulo exterior\r\nBanner \r\nBrochure empresarial y de productos\r\nHoja Volante \r\nTarjetas de presentación\r\nHojas de papel membretado\r\nSobres\r\nDiseño de valla publicitaria\r\nEdición de cuña para perifoneo\r\nEdición de spot corto\r\nCover Fanpage\r\nPlantilla editable en archivo PoerPoint para publicación de eventos\r\nToma de fotografías que puedan usarse en las herramientas publicitarias\r\n\r\n', 4, 70, '2015-09-11', 800.00, 15.00, 'Finalizada', 13, 4, 233, 223, '', NULL, '2015-08-18 23:30:52', '2015-11-19 16:38:22'),
(99, 'Mejora de la calidad y creación de productos de limpieza y de tocador ', 'Mejorar la calidad y estandarizar el proceso de formulación de los productos de limpieza y de tocador y elaborar dos nuevos\r\nproductos acondicionador y crema para el cabello,para fortalecer la competitividad a través del desarrollo de productos.', 'Obtener productos de calidad a través del proceso de formulación de los productos de las emprendedoras los naranjos.\r\nEstandarizar los procesos de los los productos de limpieza, desinfectantes en 6 aromas, jabón liquido para ropa, jabón gel, jabón antibacterial y lejía.\r\nEstandarizar los procesos de los productos de tocador, shampoo de sabila y de romero.\r\nCrear y formular el proceso de dos nuevos productos acondicionador y crema para el cabello.', 'Obtener productos de calidad que sean competitivos en el mercado.\r\nEmpresarias capacitadas en la elaboración de productos de limpieza y de tocador.\r\nQue las empresarias obtengan el conocimiento y la estandarizacion de dos nuevos productos acondicionador y crema para el cabello.\r\nCapacitar sobre el proceso correcto de elaboración de los productos y las recomendaciones de uso.\r\nEmpresarias con conocimientos claros en la elaboración de sus productos.\r\nObtener productos de calidad que generen confianza al cliente\r\nDocumento impreso con la fórmula y estandarización de todos productos del grupo de mujeres emprendedoras los naranjos.', 5, 70, '2015-09-12', 800.00, 4.67, 'Finalizada', 28, 7, 125, 117, '', NULL, '2015-08-28 22:31:20', '2015-11-17 22:21:51'),
(100, 'PLAN DE NEGOCIOS PARA FORTALECIMIENTO DE LA EMPACADORA DE CEREALES DE LA ACD', 'Diseñar plan de negocios que guíe el crecimiento empresarial del proyecto “Empacadora de cereales de la ACD”. ', 'Estudiar las generalidades del mercado para la comercialización de cereales, definir segmentos y estrategias para penetrar el mercado.\r\nDesarrollar la organización de la planta, enfatizando en el equipo de comercialización del producto.\r\nDeterminar la inversión en capital de trabajo y maquinaria para fortalecer la productividad de la planta, aumentando la producción en épocas de cultivo y minimizar los costos.\r\nRealizar las proyecciones financieras para determinar la rentabilidad y sostenibilidad del proyecto.\r\n', 'Diseño de plan de negocios que incluya como mínimo:\r\nResumen ejecutivo.\r\nEstructura organizativa\r\nEstudio de mercado.\r\nEstrategias de penetración del mercado.\r\nEstudio Técnico.\r\nEstudio de la Inversión.\r\nEstudio económico.\r\nEstudio Financiero.\r\n\r\nInforme que evidencie la ejecución de las siguientes acciones:\r\n\r\nActividades de levantamiento de información en campo y oficina de la empresa.\r\nTodas las demás actividades relacionadas con la ejecución de la consultoría.\r\n\r\n', 4, 70, '2015-09-01', 800.00, 7.17, 'Finalizada', 22, 8, 69, 309, '', NULL, '2015-08-28 23:18:54', '2015-12-11 00:07:41'),
(101, 'PLAN DE NEGOCIOS PARA FORTALECER LA PLANTA DE PROCESAMIENTO DE MIEL DE ABEJA DE APICABAÑAS', 'Facilitar la gestión de recursos financieros ante entidades bancarias y/o instituciones de apoyo a cooperativas.', 'Generar un plan de negocios que guíe la implementación del proyecto de fortalecimiento de la planta de procesamiento de miel de abeja. ', 'Diseño de plan de negocios que incluya como mínimo:\r\n•	Resumen ejecutivo.\r\n•	Estudio de mercado.\r\n•	Estrategias de penetración del mercado.\r\n•	Estudio técnico.\r\n•	Estudio de la Inversión.\r\n•	Estudio económico.\r\n•	Estudio financiero.\r\n\r\nDiseño de presentación en formato Power Point como herramienta de apoyo para reuniones con posibles cooperantes.\r\n\r\nEvidencia fotográfica y documental de reuniones y actividades relacionadas con la ejecución de la consultoría.\r\n\r\nDos ejemplares de informe final en físico y digital en formato Word (en CD) para la empresa y para CDMYPE. \r\n', 5, 70, '2015-09-04', 800.00, 13.33, 'Finalizada', 22, 3, 328, 322, '', NULL, '2015-09-01 03:14:58', '2015-10-14 20:26:09'),
(102, 'Diversificación de bocadillos para cócteles y otros eventos', 'Innovar el menú de productos alimenticios, a través de elaboración de boquitas dulces y saladas para cócteles y otros eventos.', 'Conocer procesos de elaboración para bocadillos dulces y salados para cócteles y otros eventos\r\nDesarrollar de forma práctica los diferentes bocadillos dulces y salados\r\nAprender diferentes tipos de decoración y presentación de bocadillos', 'Diez tipos de boquitas dulces (Tartaletas, galletas, mini muffins, brownies, volován, rollitos, brochetas, postres)\r\nDiez tipos de boquitas saladas (Alitas de pollo, bolitas, brochetas, croquetas, dips, mini pizza, empanadas, mini sándwich, mini crepas, volován)\r\nManual de las recetas de bocadillos dulces y saladas para cócteles y otros eventos\r\nDiplomas de participación en la formación de boquitas dulces y saladas.', 5, 70, '2015-09-17', 800.00, 5.17, 'Finalizada', 20, 7, 327, 321, '', NULL, '2015-09-07 21:37:09', '2015-11-05 01:03:38'),
(103, 'DISEÑO DE PLAN DE NEGOCIOS PARA PROYECTO ASOCIATIVO DE ARTESANOS DE ILOBASCO', 'Facilitar la gestión de recursos financieros ante entidades e instituciones de apoyo para el desarrollo de proyecto asociativo.', 'Generar un plan de negocios como guía para la implementación de proyecto de desarrollo de mercados e innovación tecnológica en la elaboración de artesanías de Ilobasco. ', 'Diseño de plan de negocios que incluya como mínimo:\r\n•	Resumen ejecutivo.\r\n•	Estudio de mercado.\r\n•	Estrategias de penetración del mercado.\r\n•	Estudio técnico.\r\n•	Estudio de la Inversión.\r\n•	Estudio económico.\r\n•	Estudio financiero.\r\n•	Conclusiones y Recomendaciones.\r\n\r\nFormulario de aplicación para gestión de fondos ante institución de apoyo.\r\n\r\nDiseño de presentación en formato Power Point como herramienta de apoyo para reuniones con posibles cooperantes.\r\n\r\nEvidencia fotográfica y documental de reuniones y actividades relacionadas con la ejecución de la consultoría.\r\n\r\nDos ejemplares de informe final en físico y digital en formato Word (en CD) para la empresa y para CDMYPE. \r\n', 2, 70, '2015-09-09', 800.00, 4.33, 'Finalizada', 22, 3, 89, 281, '', NULL, '2015-09-07 22:36:58', '2015-12-15 16:46:55'),
(104, 'DISEÑO DE IMAGEN COMERCIAL PARA ENVASADORA GEISSER', 'Incrementar la competitividad de los productos de Envasadora Geisser en el mercado de agua purificada del departamento de Cabañas.', 'Creación de imagen comercial de la empresa por medio de la renovación de los elementos gráficos necesarios para mejorar la presencia en el mercado de agua purificada del departamento de Cabañas.', 'Creación de línea gráfica para la empresa que incluya:\r\n	Diseño de logotipo que identifique a la empresa.\r\n	Re diseño de marca comercial. \r\n	Manual de uso de marca.\r\n	Diseño de etiquetas.\r\n	Diseño de herramientas publicitarias: flyer editable para promociones, banner y afiche.\r\n	Toma de fotografía para el diseño (si aplica).\r\n	Diseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado, facturas, folder empresarial y carta de presentación.\r\nImpresión de tiraje de muestra de herramientas publicitarias y papelería interna (excepto facturas).\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\nCopia de recibo de pago en CNR para evidenciar el proceso de búsqueda de marca.\r\n', 5, 70, '2015-09-11', 800.00, 8.00, 'Finalizada', 13, 3, 189, 180, '', NULL, '2015-09-07 23:04:21', '2015-11-30 23:10:22'),
(105, 'PLAN DE DISEÑO Y VALIDACIÓN DE NUEVOS PRODUCTOS PARA CERÁMCIAS JOSSELYN', 'Crear diseños innovadores que respondan a las necesidades del segmento de clientes dentro de un mercado de alto valor comercial. ', 'Mejorar la calidad de los diseños de artesanías en barro elaboradas por el taller Cerámicas Josselyn, por medio de un nuevo portafolio de nuevos productos que sean expuestos al segmento de mercado seleccionado.', 'Documento de plan de diseño de nuevos productos que contenga como mínimo:\r\n	Definición de segmento de mercado a explotar.\r\n	Portafolio con al menos tres nuevas líneas de productos.\r\n	Seis bocetos por cada línea para implementación de diseños.\r\n	Paleta de colores de acuerdo a tendencias.\r\nPropuesta de validación (prueba) de mercado en una tienda de artesanías.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\nEvidencia fotográfica y documental de actividades realizadas.\r\n', 5, 70, '2015-09-25', 800.00, 9.17, 'Finalizada', 12, 3, 192, 183, '', NULL, '2015-09-09 19:54:11', '2015-12-11 16:34:03'),
(106, 'Diseño de Imagen Corporativa para ACOPAREN', 'Dotar a la empresa "ACOPAREN de R.L.", de una imagen corporativa en relación a la visión de\r\ndesarrollo de su propietario y contribuir así al fortalecimiento de la estrategia de posicionamiento de\r\nla empresa.', 'Crear el logotipo de la empresa y crear junto a la empresaria un slogan.\r\nDiseñar el concepto gráfico del establecimiento de de la empresa.\r\nDesarrollar material publicitario para posicionar la marca de la empresa.', 'Creación de logotipo de la empresa y creación de slogan.\r\nDiseño y recomendaciones de uso de las aplicaciones de la linea gráfica que la empresa debe utilizar en su establecimiento.\r\nDiseño de tarjeta de presentación, banner, rotulo, broshure y artículos promocionales como camiseta, llavero, calendario y otros.\r\nPapelería interna de la empresa y sello.\r\nRecomendaciones de colores a utilizar aplicados en el establecimiento.\r\nManual de uso de marca.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario)', 5, 70, '2015-09-18', 800.00, 4.33, 'Finalizada', 13, 8, 67, 62, '', NULL, '2015-09-12 21:06:49', '2015-11-14 14:45:50'),
(107, 'Diseño y creación de sitio web para empresa ACOPAIME de R.L.', 'Diseñar un sitio web para la empresa ACOPAIME de R.L en la cual pueda dar a conocer los productos de la empresa.', 'Mejorar la visibilidad de la empresa mediante la utilización del sitio web para mostrar los productos de la empresa.\r\nIncrementar el alcance que tiene la empresa para poder conseguir más clientes potenciales para los productos.\r\nAumentar la visibilidad de la marca a mercados extranjeros con la utilización del sitio web', 'Diseño de sitio web responsive, adaptado a todos los dispositivos.\r\nEl sitio web debe contar con un espacio para mostrar los productos y servicios de la empresa.\r\nEl sitio web debe ser creado con un administrador de contenido (de preferencia Wordpress).\r\nEnlace a Google Analytics para que el empresario conozca las visitas del sitio web.\r\nFormulario de consultas en el que el visitante pueda enviar mensajes al administrador de la página.\r\nLa pagina debe de tener interacción con redes sociales en todas sus secciones, poseer el botón de me gusta de Facebook, y compartir para que se pueda compartir el contenido de la pagina.\r\nLa página web debe quedar en internet de manera que la empresa pueda utilizarla al finalizar la asistencia técnica.\r\nManual de usuario para la administración de la página web.\r\nElaborar un informe final el cual será entregado tanto en físico como en digital a la empresa como a CDMYPE.\r\nCapacitar al menos a un integrante de la empresa en la administración y uso de la página web.\r\na pagina web debe tener los logos de apoyo del cdmype.\r\n', 5, 70, '2015-10-06', 800.00, 3.83, 'Finalizada', 1, 2, 275, 260, '', NULL, '2015-09-14 20:50:27', '2015-11-10 13:43:02'),
(108, '"Diseño de Imagen Comercial para Clínica Vicentina de Especialidades"', 'Dotar a la empresa "Clínica Vicentina de Especialidades S.A. de C.V.", de una imagen comercial en relación a la visión de\r\ndesarrollo de su socios y contribuir así al fortalecimiento de la estrategia de posicionamiento de la empresa.', 'Crear el logotipo de la empresa y crear junto a la empresaria un slogan.\r\nDiseñar el concepto gráfico del establecimiento de de la empresa.\r\nDesarrollar material publicitario para posicionar la marca de la empresa.', 'Creación de logotipo de la empresa y creación de slogan.\r\nDiseño y recomendaciones de uso de las aplicaciones de la linea gráfica que la empresa debe utilizar en\r\nsu establecimiento.\r\nDiseño de tarjeta de presentación, banner, rotulo, broshure y artículos promocionales como camiseta,\r\nllavero, calendario y otros.\r\nPapelería interna de la empresa y sello.\r\nRecomendaciones de colores a utilizar aplicados en el establecimiento.\r\nManual de uso de marca.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario)', 5, 70, '2015-09-18', 800.00, 5.50, 'Finalizada', 13, 8, 333, 325, '', NULL, '2015-09-14 21:31:31', '2015-12-01 15:52:54'),
(110, 'Elaboración de productos lácteos y diseño de planta de producción.', 'Contribuir al desarrollo de la empresa logrando un incremento en las ventas a través de la transformación de la leche en productos lácteos.', 'Diversificar la oferta de productos lácteos de la empresa Rancho la Perla con formulas estandarizadas.\r\nContribuir con el diseño de la planta de producción y buenas practicas de manejo de la leche.\r\nDeterminar el costo de de los productos que se procesen en la planta de producción.', 'Elaboración de quesillo, queso fresco,crema pasteurizada, sorbete.\r\nDiseño de planta y flujos de producción.\r\nEquipos para la elaboración de productos.\r\nCosteo de productos elaborados.\r\nBuenas prácticas de ordeno.\r\nRecomendaciones en el manejo y en la recolección de la leche\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario)', 5, 70, '2015-09-18', 800.00, 8.00, 'Consultor Seleccionado', 28, 8, 83, 78, '', NULL, '2015-09-14 22:38:18', '2015-12-15 16:49:03'),
(111, 'Propuesta de crédito para la empresa Industrias JM.', 'Obtener crédito para la empresa Industrias JM., para obtener capital de trabajo e invertir en la fabricación  de calzados, y cumplir con las licitaciones adjudicadas en el programa de paquetes escolares.', 'Presentar una solicitud de crédito formal en base a un estudio financiero de la empresa.\r\nTener las mejores condiciones de financiamiento que ayuden al desarrollo empresarial.\r\nTener capital para invertir en el proyecto', 'Nombre de la empresa que solicita la propuesta de crédito.\r\nNombre del representante de la empresa. \r\nDirección y contactos.\r\nHistoria del origen de la empresa. \r\nEvolución de la gestión empresarial. \r\nCumplimiento de los compromisos crediticios anteriores. \r\nCapacidad de administrar la empresa. \r\nMonto solicitado del financiamiento\r\nDestino del financiamiento. \r\nLinea de financiamiento.\r\nPlazo recomendado del financiamiento.\r\nAnálisis financiero: histórico y proyectado.\r\nRazón de Liquidez.\r\nRazón de Rentabilidad.\r\nRazón de Apalancamiento o endeudamiento. \r\nRazón de Eficiencia o Actividad.\r\nRazón de Cobertura.\r\nAnálisis de la garantía. \r\nAnálisis del crédito desde el punto de vista financiero de la inversión.\r\nImpacto del crédito.', 4, 70, '2015-09-18', 800.00, 0.00, 'Finalizada', 6, 12, 51, 47, '', NULL, '2015-09-14 22:49:15', '2015-10-23 01:05:51'),
(112, 'Organización y distribución del sistema de producción de la planta de textil para determinar la\r\ncapacidad productiva y el costo de producción de Creaciones Dollyana', 'Determinar la capacidad de producción de la planta de textiles de Creaciones Dollyana, realizando\r\nuna distribución en sus lineas de producción.\r\n', 'Organizar las lineas de producción de la planta de textiles.\r\nConocer el punto de equilibrio de producción del taller para fortalecer la gestión de la producción.\r\nDefinir el sistema de costos de producción.', 'Diagnostico preliminar de sistema de producción actual.\r\nDiagnosticar los elementos principales con que cuenta la empresa actualmente: Maquinarias, personal, recursos.\r\nElaboración de propuesta de nuevo sistema de producción.\r\nEstudio y determinación de los costos de producción.\r\nElaboración de organigrama de planta de producción.\r\nElaboración de diagrama de flujo de producción.\r\nElaboración del lay-out o distribución de planta.\r\nDefinición del punto de equilibrio.\r\nDeterminación de la capacidad productiva de la planta.\r\nRecomendaciones de lineas de producción de telas de algodón en base a la demanda del mercado.\r\nCopia de informe final en físico y digital al empresario y al CDMYPE.', 6, 70, '2015-09-30', 800.00, 8.33, 'Finalizada', 10, 8, 287, 278, '', NULL, '2015-09-14 23:20:19', '2015-12-10 13:22:48'),
(113, 'Creación de nuevas lineas decorativas de artesanías\r\nen barro para taller artesanal Franklin', 'Crear nuevas lineas de productos decorativos artesanales en barro atendiendo a la demanda de clientes actuales y potenciales ', 'Realizar propuestas de diseños para la línea decorativa religiosa  y línea decorativa de figuras de animales\r\nElaborar diseños propuestos para las dos líneas de productos solicitadas\r\nModelar los productos de cada línea solicitada\r\nAsesorar en el proceso de moldeado de los diferentes productos solicitados\r\n\r\n\r\n', 'Línea decorativa de imágenes religiosas:\r\n  Imagen de Monseñor Romero en relieve 45 cm por 30 cm\r\n  Busto de Monseñor Romero 25 cm por 12 cm\r\n  Imagen de Monseñor Romero y Catedral  45 cm por 35 cm\r\n\r\nLínea decorativa figuras de animales:\r\n  Juego de búhos (tres piezas)\r\n  Búho en bulto  (60 cm por 30 cm)', 4, 70, '2015-09-30', 800.00, 9.17, 'Finalizada', 11, 4, 332, 326, '', NULL, '2015-09-15 01:15:03', '2015-12-09 22:11:57'),
(114, 'Proceso y Técnicas de Serigrafía en Productos Textiles', 'Mejorar la técnica de serigrafía y estampado en productos textiles promocionales, utilizando  máquina de serigrafía (pulpo).', 'Incrementar las competencias del personal de Publicreat en el manejo del equipo de serigrafía, procesos, materiales y tipos de estampado en productos textiles.', 'Documento de instrucción para operador de equipo de serigrafía, que contenga como mínimo:\r\n	Descripción de partes de la máquina.\r\n	Proceso de preparación de máquina.\r\n	Procesos de prueba de registros de diseño y técnicas de serigrafía.\r\n	Proceso de producción y medidas de seguridad.\r\nFacilitación de talleres de inducción para el personal designado por el empresario.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\nEvidencia fotográfica y documental de actividades realizadas.\r\n', 5, 70, '2015-09-21', 800.00, 9.17, 'Enviado', 30, 3, 247, 236, '', NULL, '2015-09-17 03:32:37', '2015-09-17 04:02:50'),
(115, 'Proceso y Técnicas de Serigrafía en Productos Textiles', 'Mejorar la técnica de serigrafía y estampado en productos textiles promocionales, utilizando  máquina de serigrafía (pulpo).', 'Incrementar las competencias del personal de Publicreat en el manejo del equipo de serigrafía, procesos, materiales y tipos de estampado en productos textiles.', 'Documento de instrucción para operador de equipo de serigrafía, que contenga como mínimo:\r\n	Descripción de partes de la máquina.\r\n	Proceso de preparación de máquina.\r\n	Procesos de prueba de registros de diseño y técnicas de serigrafía.\r\n	Proceso de producción y medidas de seguridad.\r\nFacilitación de talleres de inducción para el personal designado por el empresario.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\nEvidencia fotográfica y documental de actividades realizadas.\r\n', 5, 70, '2015-09-21', 800.00, 9.17, 'Creado', 10, 3, 247, 236, '', NULL, '2015-09-17 03:35:06', '2015-09-17 03:35:06'),
(116, 'Proceso y Técnicas de Serigrafía en Productos Textiles', 'Mejorar la técnica de serigrafía y estampado en productos textiles promocionales, utilizando  máquina de serigrafía (pulpo).', 'Incrementar las competencias del personal de Publicreat en el manejo del equipo de serigrafía, procesos, materiales y tipos de estampado en productos textiles.', 'Documento de instrucción para operador de equipo de serigrafía, que contenga como mínimo:\r\n	Descripción de partes de la máquina.\r\n	Proceso de preparación de máquina.\r\n	Procesos de prueba de registros de diseño y técnicas de serigrafía.\r\n	Proceso de producción y medidas de seguridad.\r\nFacilitación de talleres de inducción para el personal designado por el empresario.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\nEvidencia fotográfica y documental de actividades realizadas.\r\n', 5, 70, '2015-09-21', 800.00, 9.17, 'Creado', 30, 3, 247, 236, '', NULL, '2015-09-17 03:37:16', '2015-09-17 03:37:16'),
(117, 'Diseño y prototipo de nacimiento navideño en barro para Taller Escosbar', 'Crear nuevos diseños de artesanías en barro, enfocado a la línea de nacimientos navideños', 'Diseñar propuestas de nacimientos navideños según las tendencias actuales del mercado\r\nMoldear prototipo de las piezas que comprenden el misterio navideños\r\nAsesorar en el proceso de moldeado de las piezas solicitadas\r\n ', 'Nacimiento navideño en tamaño mediano que comprende las siguientes piezas:\r\nNiño Dios\r\nSan José\r\nLa Virgen María\r\nÁngel\r\nTres Reyes Magos\r\nTres Camellos\r\nBuey\r\nMula\r\n \r\n', 4, 70, '2015-09-30', 800.00, 9.17, 'Finalizada', 11, 4, 334, 327, '', NULL, '2015-09-18 21:22:08', '2015-12-11 13:04:21'),
(118, 'Diseño Innovadores de figuras humanas y animales en barro.', 'Ampliar  la oferta de figuras y diseños en barro del taller El Buen Gusto fortaleciendo la identidad y el espíritu innovador del mismo.', 'Diseñar nueva línea de figuras humanas (Monseñor Romero) y animales, logrando la tecnificación en acabados y pintura.\r\nFortalecer las características identificativas de los diseños del taller El Buen Gusto.', 'a.	Diseño de línea innovadora de figura religiosa Monseñor Romero (2 diseños)  y divino niño (1) con sus respectivas pruebas.\r\n•	Monseñor Romero cuerpo completo (bulto) de 35 a 40cm (Imagen seleccionada).\r\n•	Monseñor Romero medio cuerpo (Relieve) de 35 a 40 cm (imagen seleccionada)\r\n•	Divino Niño en barro  de 35 a 40cm \r\nb.	Diseño de línea animales Elefantes utilitarios veleros (3 piezas)\r\n•	Grande: 50 cm de ancho X 40cm de largo.\r\n•	Mediano: 40 cm de ancho X 30 cm de largo.\r\n•	Pequeño: 25 cm de ancho X 20 cm de largo.\r\nc.	Propuesta de diseño innovador para cada pieza. (coordinación empresario- consultor).\r\nd.	Diseños de moldes para cada pieza (estos en poder del empresario).\r\ne.	Documento de informe final.\r\n\r\n', 5, 70, '2015-09-16', 800.00, 9.17, 'Finalizada', 12, 5, 264, 251, '', NULL, '2015-09-22 21:57:40', '2015-11-11 14:18:01'),
(119, 'Diseño Innovador de nacimiento o Ministerio en Barro', 'Diseñar un juego de nacimientos o misterio que incorpore un toque innovador en diseño, forma, acabado y pintura.', 'Diseñar nueva línea de juego de nacimiento en barro, logrando la tecnificación en acabados y pintura.\r\n\r\nLograr el toque innovador y único en cada pieza de nacimiento.\r\n', 'a.	Diseño de línea innovadora de nacimiento a trabajar 8 piezas con sus respectivas pruebas\r\n1.	Niño Dios (35cm)\r\n2.	Virgen María (40cm)\r\nPostura: Medio Inclinada.\r\n3.	San José (45cm)\r\nPostura: Medio Inclinado.\r\n4.	3 Reyes Magos (con sus respectivos regalos) 45cm c/u\r\nPostura: Inclinados.\r\n5.	Mula (45 cm)\r\nPostura: Echada.\r\n6.	Buey (45cm)\r\nPostura: Echado.\r\nb.	Propuesta de diseño innovador para cada pieza. (Coordinación empresario- consultor).\r\nc.	Diseños de moldes para cada pieza (estos en poder del empresario).\r\nd.	Documento de informe final.\r\n', 5, 70, '2015-09-17', 800.00, 5.50, 'Finalizada', 11, 5, 335, 328, '', NULL, '2015-09-23 02:46:47', '2015-11-04 20:23:44'),
(120, 'Diseño de distribución en planta para el taller textil de SERICOSTUR', 'Incrementar la eficiencia de los procesos de producción de prendas de vestir de SERICOSTUR, de R.L.', 'Diseñar la distribución y organización de la planta de producción textil, orientada al ahorro de tiempos, al uso óptimo del espacio y los recursos disponibles.', 'Documento de diseño de distribución en planta, que incluya como mínimo:\r\n	Diagnóstico e identificación del problema.\r\n	Elaboración del diagrama general de la planta.\r\n	Diseño de áreas productivas, espacios para almacén, y mostrador de productos.\r\n	Determinación de la capacidad de producción de la planta.\r\n	Conclusiones y recomendaciones.\r\nProyección de ahorro de costos con la implementación de la propuesta.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\nEvidencia fotográfica y documental de actividades realizadas.\r\n', 5, 70, '2015-09-27', 800.00, 7.50, 'Finalizada', 10, 3, 57, 53, '', NULL, '2015-09-23 04:25:40', '2015-12-05 17:09:06'),
(121, 'Elaboración y formulación de productos carnicos para Carnicos y Embutido El Buen Sabor.', 'Diversificar la producción de embutidos y fortalecer las formulaciones y procesos de Embutidos.', 'Fortalecer y documentar las fórmulas de los productos.\r\n\r\nDiseñar los procesos básicos de producción de embutidos.\r\n\r\nCrear nuevas fórmulas adaptadas a las exigencias del mercado.\r\n', 'Desarrollo de servicios de consultoría que incluya como mínimo:\r\nElaboración de 5 productos cárnicos:\r\n1. Jamón.\r\n2. Butifarra.\r\n3. Salchichón.\r\n4. Chorizo Argentino.\r\n5. Chorizo Mexicano.\r\nRevisión de fórmulas de productos actuales y mejora de calidad de los mismos (chorizo de res y de cerdo)\r\nDocumentar las fórmulas actuales y propuestas (manual de uso de fórmulas y procedimientos).\r\nProcesos de producción diseñados/ capacitación de mejora del proceso de producción actual y nueva.\r\nNuevas fórmulas adaptadas a las exigencias del mercado. \r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 4, 70, '2015-09-26', 800.00, 4.33, 'Finalizada', 7, 5, 336, 329, '', NULL, '2015-09-24 21:46:51', '2015-10-28 20:48:40'),
(122, 'Creación de marca, viñetas y herramientas gráficas promocionales para Castor Químicos de El Salvador S.A de C.V.', 'Crear herramientas de promoción que permitan el posicionamiento de la marca Castor Químicos.', 'Crear una marca competitiva y logotipo empresarial\r\nDiseñar línea gráfica promocional para la implementación de estrategias de posicionamiento de marca\r\n\r\n\r\n\r\n\r\n', 'Se espera recibir los siguientes productos:\r\n\r\nLogotipo empresarial \r\nMarca para las tres lineas de productos (Desifectantes, silicom, shampoo)\r\nBúsqueda de marca en CNR\r\nManual de marca\r\nViñetas para cada línea de productos en sus diferentes presentaciones según las normativas respectivas en El Salvador.\r\nLinea gráfica (Tarjetas de presentación, papel membretado)\r\nHerramientas publicitarias (Brochure, banner cover de fanpage, retail para fanpage)\r\nUniformes para personal de ventas\r\nDisplay para estrategia de posicionamiento en puntos de ventas (Carwash, lugares de conveniencia)\r\n\r\n\r\n', 4, 70, '2015-11-13', 800.00, 8.00, 'Finalizada', 13, 4, 340, 332, '', NULL, '2015-10-02 22:03:37', '2015-12-17 17:04:27'),
(123, 'ASISTENCIA TÉCNICA PARA OBTENER REGISTRO SANITARIO, TABLA NUTRICIONAL PARA ATOL DE MAIZ Y VIÑETAS DE PRESENTACIÓN PARA EL CHOCOLATE.', 'Gestionar y obtener los registros sanitarios para productos Prodismax con el objetivo de contar con productos de mayor competitividad, logrando incrementar mercados formales.', 'Gestionar, presentar documentos y muestras de productos ante el Ministerio de Salud.', 'Tramite de registro sanitario para Atol de Maíz.\r\nElaboración y diseño de tabla nutricional para Atol  de Maíz.\r\nGestión y obtención de permiso de 3 presentaciones para el Atol de Maíz:\r\n1. 340 gramos.\r\n2. 908 gramos.\r\n3. 2,270 gramos.\r\nGestión y obtención de permiso para 2 presentaciones para el chocolate:\r\n1. 113.5 gramos.\r\n2. 225 gramos.\r\nPresentación de muestras de los productos al laboratorio.\r\nPresentar evidencia de presentación de documentos y muestras a Laboratorio y Ministerio de Salud.\r\nLa asistencia técnica incluye el pago y aranceles que sean necesarios en la presentación de muestras y documentos ante Laboratorios y Ministerio de Salud.\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\nNúmeros de registros en poder de empresario y CDMYPE-UNICAES.\r\n', 7, 70, '2015-10-05', 800.00, 9.17, 'Finalizada', 7, 5, 60, 56, '', NULL, '2015-10-02 22:29:36', '2015-11-19 15:36:17'),
(124, 'Diseño de pagina web para venta de artesanías por internet.', 'Diseñar una página web para la venta de artesanías para la empresa Artesal ubicada en el municipio de Ilobasco del departamento de Cabañas.', 'Diseñar una página web para la empresa.\r\nContar con un sitio en internet para la publicación de los productos de la empresa.\r\nVender artesanías a traves de internet', 'Pagina responsive que se adapte a cualquier dispositivo.\r\nProductos, mostrará el producto de la empresa. Agrupados por categorías.\r\nEl sitio debe contener espacios para mostrar promociones y productos destacados.\r\nContar con herramientas de medición de visitas (al menos Google Analytics). \r\nSección de blog, en la que el empresario podrá publicar contenidos, esta sección tendrá que ser desarrollada con un administrador de contenidod de preferencia Wordpress.\r\nComentarios, Sección para mostrar  historias de los clientes.\r\nFormulario de consultas en el que el usuario pueda enviar mensajes al administrador de la página.\r\nLa pagina debe de tener interacción con redes sociales en todas sus secciones.\r\nLa página web debe quedar en internet de manera que la empresa pueda utilizarla al finalizar la asistencia técnica.\r\nManual de usuario para la administración de la página web.\r\nElaborar un informe final el cual será entregado tanto en físico como en digital a la empresa como a CDMYPE.\r\nCapacitar al menos a un integrante de la empresa en la administración y uso de la página web.\r\na pagina web debe tener los logos de apoyo del cdmype.', 5, 70, '2015-10-07', 800.00, 6.00, 'Finalizada', 1, 2, 337, 330, '', NULL, '2015-10-03 02:12:55', '2015-12-04 15:46:03'),
(125, 'Creación de imagen comercial y linea grafica', 'Diseño de la linea gráfica e imagen comercial para el taller de costura, para incrementar la competitividad de las prendas de vestir e ingresar a nuevos mercados.', 'Creación de imagen comercial del taller por medio de la renovación de los elementos gráficos necesarios para mejorar la presencia en el mercado de las prendas de vestir.\r\nDiseñar marca y elementos gráficos para el desarrollo del producto.\r\nProponer una distribución de espacios atractiva para el taller.', 'Diseño de logotipo que identifique a la empresa.\r\nCreación y diseño de marca comercial.\r\nBúsqueda de marca en registro de CNR\r\nManual de uso de marca.\r\nRotulo externo\r\nDiseño de etiquetas.\r\nDiseño de herramientas publicitarias: flyer editable para promociones, banner y afiche.\r\nToma de fotografía para el diseño (si aplica).\r\nDiseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado, facturas,\r\nfolder empresarial y carta de presentación.\r\nImpresión de tiraje de muestra de herramientas publicitarias y papelería interna (excepto facturas).\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para\r\nCDMYPE y copia para empresario).', 5, 70, '2015-10-13', 800.00, 5.17, 'Finalizada', 13, 7, 338, 331, '', NULL, '2015-10-03 02:29:34', '2015-12-07 17:24:31');
