(126, 'Diseño de página web para Clínica San José ubicada en el municipio de Ilobasco departamento de Cabañas.', 'Diseñar un sitio web para Clínica San José en la que se puedan dar a conocer los servicios.', 'Mejorar la visibilidad de la clínica San José mediante la creación de un sitio web.\r\nAcercar los servicios de la clínica a los clientes.\r\nAumentar los clientes mediante la conversión de prospectos que llegarán por el sitio web.', 'Pagina responsive que se adapte a cualquier dispositivo.\r\nÁrea para mostrar los diferentes servicios de la empresa. Los servicios se pueden clasificar de acuerdo a los criterios del empresario.\r\nEspacio para mostrar la información de la institución. Esta información será brindada por el empresario.\r\nContar con herramientas de medición de visitas (al menos Google Analytics). \r\nComentarios, Sección para mostrar  historias de los clientes.\r\nFormulario de consultas en el que el usuario pueda enviar mensajes al administrador de la página.\r\nLa pagina debe de tener interacción con redes sociales en todas sus secciones.\r\nLa página web debe quedar en internet de manera que la empresa pueda utilizarla al finalizar la asistencia técnica.\r\nManual de usuario para la administración de la página web.\r\nElaborar un informe final el cual será entregado tanto en físico como en digital a la empresa como a CDMYPE.\r\nCapacitar al menos a un integrante de la empresa en la administración y uso de la página web.\r\na pagina web debe tener los logos de apoyo del cdmype.', 5, 70, '2015-10-07', 800.00, 10.00, 'Ofertas Recibidas', 1, 2, 320, 314, '', NULL, '2015-10-03 02:43:48', '2015-10-08 02:08:25'),
(127, 'Actualización de imagen comercial de Vinos La Llama Escondida', 'Adaptar la imagen de los productos de ACOPAMDRE con las exigencias del mercado formal de vinos y bebidas fermentadas derivadas de frutas tropicales.', 'Actualizar la imagen comercial de la marca Vinos La Llama Escondida, creando una nueva imagen de acuerdo a cada segmento de mercado que se pretende explorar.', 'Diseño de imagen de cada línea de productos:\r\n	Creación de imagen para tres productos estrella (Vino de Rosa de Jamaica, Naranja y Arroz).\r\n	Creación de imagen para segmento popular (Vino de Rosa de Jamaica, Naranja, Arroz, Uva, Mix de Frutas y Manzana)\r\n	Creación de imagen para licor de Rosa de Jamaica.\r\n	Creación de imagen para bebida artesanal (Chicha)\r\nDiseño de flyer por línea de productos.\r\nDiseño de banner y roll up.\r\nToma de fotografía para el diseño (si aplica).\r\nImpresión de tiraje de muestra de viñetas y flyers.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\n', 4, 70, '2015-10-07', 800.00, 6.33, 'Finalizada', 13, 3, 168, 159, '', NULL, '2015-10-03 03:10:44', '2015-11-14 16:00:49'),
(129, 'Estudio de mercado sobre las características de la industria y demanda de servicios de restaurante en la ciudad de Ilobasco, para Restaurante Los Tres Cerditos. ', 'Obtener información relevante  acerca las caracterísicas del mercado en la industria del sector de restaurantes de Ilobasco para la toma de decisiones de inversión y estrategia de comercialización.  ', 'Recopilar información fidedigna sobre las características de la industria de restaurantes en el municipio de Ilobasco.\r\nIdentificar los gustos y preferencias del mercado en relación a la industria de servicios de restaurantes.\r\nPresentar resultados de la información recopilada orientando a la toma de decisiones estratégicas sobre mercado e inversión.\r\n\r\n\r\n', '-Posicionamiento de restaurante Los Tres Cerditos en la industria de restaurantes de Ilobasco\r\n-Tamaño  de mercado \r\n-Análisis de gustos y preferencias de los consumidores\r\n-Análisis de segmento de mercado con mayor potencial de demanda\r\n-Información relativa a producto, precio, plaza y promoción. \r\n-Estimaciones de proyección de demanda anual. \r\n-Información fidedigna utilizando herramienta de recopilación de datos idónea y veraz.\r\n-Presentación de informe final y estudio de mercado. \r\n-Presentación expositiva de informe de resultados de investigación ante propietarios de la empresa. \r\n-Conclusiones y recomendaciones para inversión en remodelación de sucursal de Ilobasco según los resultados de mercado buscando satisfacer gustos y preferencias de la demanda. \r\n\r\n', 4, 70, '2015-10-22', 800.00, 15.83, 'Finalizada', 9, 4, 308, 302, '', NULL, '2015-10-08 07:04:45', '2015-11-30 23:10:53'),
(130, 'DISEÑO DE COLECCIÓN DE PRODUCTOS ARTESANALES INNOVADORES PARA MESA DE DESARROLLO ARTESANAL DE  ILOBASCO ', 'Desarrollar productos elaborados en barro considerando las tendencias de mercado con alto potencial de demanda.', 'Diseñar productos en barro innovadores y vanguardistas \r\nAcompañar en el proceso de moldeo de líneas de productos en barro\r\nAplicar técnicas innovadoras, vanguardista de difícil imitación\r\n', 'Diseños de Línea de superficie (3 piezas)\r\nDiseños de Línea de luminarias (3 piezas)\r\nDiseños de Línea de candelabros (3 piezas)\r\nDiseños de Línea de Vajilla (3 piezas).\r\nDiseños de línea de calado (3 piezas).\r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 5, 70, '2015-08-25', 800.00, 8.33, 'Finalizada', 11, 5, 348, 340, '', NULL, '2015-10-13 22:54:01', '2015-11-03 20:55:30'),
(131, '\r\n“DISEÑO DE PLAN ESTRATEGICO PARA  LA COOPERATIVA ARTEILOBASQUENSE”\r\n', 'Elaborar un plan estratégico empresarial a corto plazo (5 años máximos), que les sirva de guía para convertir sus proyectos en acciones. ', 'Fomentar la vinculación entre los miembros de la cooperativa, buscando el compromiso de todos.\r\nHacer participar a las personas en la valoración de las cosas que hacen mejor, ayudándoles a identificar los problemas y oportunidades.\r\nIdentificar el futuro que deben construir como cooperativa.\r\n', '#1. Presentación Corporativa.\r\n#2 Análisis de la situación.\r\nAnálisis de la situación externa.\r\nAnálisis del entorno.\r\nAnálisis del mercado.\r\nAnálisis de los clientes.\r\nAnálisis de los competidores.\r\nAnálisis de los proveedores.\r\n#3. Análisis de la situación interna.\r\n', 2, 70, '2015-08-31', 800.00, 4.33, 'Creado', 19, 5, 89, 281, '', NULL, '2015-10-14 04:15:14', '2015-10-14 04:15:14'),
(132, 'FACTIBILIDAD DE INSTALACIÓN DE UN GENERADOR DE VAPOR PARA PROCESO PRODUCTIVO, Y SUBPRODUCTOS DE LA CAÑA DE AZÚCAR', 'Evaluar el enfoque económico y técnico sobre las alternativas de generación de vapor a partir de la fuente fósil (diesel)  y una generación de vapor a partir de combustible rescatador del proceso productivo (bagazo).\r\n', 'Determinar la factibilidad económica  generación vapor vrs producción de vapor. \r\nDeterminar los costos operativos de alimentación energéticas para satisfacer de una forma eficiente el proceso de generación de vapor, tal como fuente carburante, energía eléctrica, alimentación de agua y su tratamiento.\r\nEstablecer los aspectos legales que contemplan la Ley de El Salvador.\r\n', 'Antecedentes de la empresa\r\nEvolución de la gestión empresarial. \r\nCapacidad de administrar la empresa. \r\nDeterminar la factibilidad económica  y técnica de la generación de vapor vs producción de vapor. \r\nDeterminar los costos operativos de alimentación energéticas para satisfacer de una forma eficiente el proceso de generación de vapor, tal como fuente carburante, energía eléctrica, alimentación de agua y su tratamiento, como sus costos operativo.\r\nCostos de instalación y su mantenimiento.\r\nAnálisis costo beneficio del proyecto y determinación de razones financieras para presentar el proyecto a la banca.\r\ninforme final copia digital y escrito a empresario y CDMYPE.\r\n', 5, 70, '2015-10-30', 800.00, 8.33, 'Finalizada', 22, 8, 284, 274, '', NULL, '2015-10-27 03:12:02', '2015-12-15 18:59:11'),
(134, 'PLAN DE VENTAS PARA PROYECTO DE ELABORACIÓN DE PRODUCTOS DERIVADOS DE LA MIEL DE APICABAÑAS', 'Contar con las herramientas y recursos necesarios para lograr un volumen de ventas suficiente para asegurar las sostenibilidad del proyecto de elaboración de productos derivados de la miel de APICABAÑAS.', 'Definir las acciones y determinar los recursos necesarios para poner en marcha la comercialización de productos derivados de la miel de APICABAÑAS.', 'Diseño de plan de ventas que incluya como mínimo:\r\n•	Premisas sobre proyecciones de venta.\r\n•	El Proceso de la venta.\r\n•	Canales de comercialización.\r\n•	Proyecciones de venta.\r\n•	Presupuesto de ventas.\r\n•	Perfil del personal del departamento de ventas.\r\n\r\n\r\nEvidencia fotográfica y documental de reuniones y actividades relacionadas con la ejecución de la consultoría.\r\n\r\nDos ejemplares de informe final en físico y digital en formato Word (en CD) para la empresa y para CDMYPE. \r\n', 4, 70, '2015-10-28', 800.00, 13.33, 'Finalizada', 9, 3, 328, 322, '', NULL, '2015-10-27 04:22:18', '2015-12-10 23:39:43'),
(135, 'INNOVACIÓN EN DISEÑO DE NUEVOS PRODUCTOS', 'Crear una oferta innovadora y de alta calidad para introducir productos en mercados más competitivos y de mayor valor comercial.', 'Generar un portafolio de nuevos diseños que permita al taller el lanzamiento de líneas de producto artesanales, innovadoras y de alta calidad.', 'Creación de 8 piezas nuevas para renovar las diferentes líneas de productos.\r\nModelado de piezas y elaboración de moldes.\r\nEvidencia fotográfica y documental de actividades realizadas.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\n', 3, 70, '2015-10-31', 800.00, 5.50, 'Finalizada', 11, 3, 286, 277, '', NULL, '2015-10-29 02:44:04', '2015-12-01 17:42:31'),
(136, 'INNOVACIÓN EN DISEÑO DE NUEVOS PRODUCTOS PARA ADACI, DE R.L', 'Crear una oferta innovadora y de alta calidad que ayude a ADACI a introducir sus productos en mercados más competitivos y de mayor valor comercial.', 'Generar un portafolio de nuevos diseños que permita a ADACI el lanzamiento de líneas de producto artesanales innovadoras y de alta calidad.', 'Creación de las siguientes líneas de productos:\r\n     Superficies decorativas (3 productos).\r\n     Diseños utilitarios (3 productos).\r\n     Luminarias (3 productos).\r\nModelado de piezas y elaboración de moldes\r\nEvidencia fotográfica y documental de actividades realizadas.\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\n', 3, 70, '2015-11-03', 800.00, 4.67, 'Finalizada', 12, 3, 331, 251, '', NULL, '2015-10-30 22:15:42', '2015-12-01 17:43:11'),
(137, 'DISEÑO DE SISTEMA DE IMPLEMENTACIÓN DE BUENAS PRÁCTICAS DE MANUFACTURA PARA LA PLANTA DE PROCESAMIENTO DE MIEL DE ABEJA DE APICABAÑAS', 'Avanzar en el cumplimiento de las normativas de calidad e inocuidad dentro de la planta de procesamiento de miel de abeja de APICABAÑAS.', 'Crear un sistema para la implementación de las Buenas Prácticas de Manufactura en la planta de procesamiento de miel de abeja de APICABAÑAS, de R.L.', 'Diagnóstico de cumplimiento de BPM de acuerdo a normativas para plantas de alimentos vigentes.\r\nProcedimientos Estandarizados de Operación.\r\nProcedimientos Estandarizados de Sanitización.\r\nPrograma de eliminación de desechos.\r\nPlan de control de plagas y roedores.\r\nRequisitos sanitarios y de higiene del personal.\r\nPrograma de capacitación del personal.\r\n\r\nEvidencia fotográfica y documental de reuniones y actividades relacionadas con la ejecución de la consultoría.\r\n\r\nDos ejemplares de informe final en físico y digital en formato Word (en CD) para la empresa y para CDMYPE. \r\n', 4, 70, '2015-11-03', 800.00, 13.33, 'Finalizada', 7, 3, 328, 322, '', NULL, '2015-10-31 01:07:22', '2015-12-11 12:52:53'),
(138, 'DISEÑO DE PLAN DE MARKETING DE POSICIONAMIENTO Y MARCA', 'Crear las estrategias de marketing orientadas al posicionamiento de la marca Multiautos en el segmento de salvadoreños residentes en USA.', 'Incrementar la captación de clientes y la fidelización de los clientes actuales, por medio de un reconocimiento de la marca.\r\n\r\nDefinición de acciones de marketing y comunicación, y determinación de los recursos necesarios para su implementación.\r\n', 'Diseño de plan de marketing que incluya como mínimo la siguiente estructura:\r\n     Resumen ejecutivo.\r\n     Análisis de la situación.\r\n     El escenario.\r\n     La competencia.\r\n     El cliente, la empresa.\r\n     Análisis estratégico.\r\nPlan de comunicación.\r\nAcciones de promoción.\r\nPresupuesto.\r\nConclusiones y recomendaciones.\r\n\r\nEvidencia fotográfica y documental de reuniones y actividades relacionadas con la ejecución de la consultoría.\r\n\r\nDos ejemplares de informe final en físico y digital en formato Word (en CD) para la empresa y para CDMYPE. \r\n', 3, 70, '2015-11-06', 800.00, 8.33, 'Finalizada', 9, 3, 164, 155, '', NULL, '2015-10-31 23:13:02', '2015-12-08 14:44:53'),
(139, 'Etiquetado nutricional para bebidas en polvo La Morenita', 'Mejorar la presentación del producto en relación a la información nutricional  de  las bebidas  en polvo en el etiquetado y empaque.', 'Realizar los análisis respectivos para determinar el contenido nutricional de los diferentes bebidas en polvo según la normativa RCTA.\r\nElaborar tablas nutricionales para las bebidas en polvos. \r\nAsesorar sobre la lectura de las tablas nutricionales y su importancia en la salud de los consumidores. \r\n', 'Tabla nutricional bebida en polvo de horchata de morro (Presentaciones 12 oz, 2 lb, 5 lb )\r\nTabla nutricional bebida en polvo semilla de marañon (Presentaciones 12 oz, 1lb y 2lb)\r\nTabla nutricional bebida en polvo harina de maíz (Presentaciones 12oz, 1lb)\r\nTabla nutricional Algusthe (Presentación de 12oz)\r\nEvidencia de resultados de análisis nutricionales.\r\n\r\n', 4, 70, '2015-11-10', 800.00, 6.00, 'Finalizada', 7, 4, 353, 345, '', NULL, '2015-11-05 22:28:50', '2015-12-08 22:36:13'),
(140, 'Creación de imagen comercial y línea gráfica', 'Crear y diseñar la línea gráfica e imagen comercial para el Restaurante la Casona.', 'Creación y diseño de imagen comercial para el Restaurante la Casona por medio de la renovación de los elementos gráficos necesarios para mejorar la presencia en el mercado.\r\nDiseñar marca, logo y elementos gráficos para la identificación del restaurante.\r\n', 'Diseño de logotipo que identifique a la empresa.\r\nCreación y diseño de marca comercial.\r\nBúsqueda de marca en registro de CNR\r\nManual de uso de marca.\r\nRotulo externo\r\nDiseño de herramientas publicitarias: flyer editable para promociones, banner y afiche.\r\nToma de fotografía para el diseño (si aplica).\r\n Diseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado, facturas,folder empresarial y carta de presentación.\r\n Impresión de tiraje de muestra de herramientas publicitarias y papelería interna (excepto facturas).Entrega de documento final digital en formato Microsoft Word y pdf y dos copias impresas (Copia para\r\n 	CDMYPE y copia para empresario).\r\n', 3, 70, '2015-11-20', 800.00, 8.33, 'Finalizada', 13, 7, 325, 319, '', NULL, '2015-11-23 22:21:30', '2015-12-11 12:47:27'),
(141, 'Plan de comunicación integral  para posicionamiento de marca Don Vicente.', 'Desarrollar campaña de comunicación integral para el posicionamiento de la marca Don Vicente', 'Diseñar estrategias de activación de marca BTL y ATL  para segmentos target.\r\nCrear estrategias de marketing viral. \r\nElaborar material publicitario y gráfico para el desarrollo de plan de comunicación y publicidad.\r\n\r\n', 'Plan de comunicación integral y publicidad documentado.\r\nDiseño de valla publicitaria.\r\nGestión de pautas de radio.\r\nGeneración de plan de contenido en redes sociales.\r\nCreación de post y vídeos según estrategias de contenido viral.\r\nHerramientas gráficas y digitales requeridas para implementar estrategias de activación de marca. \r\nToma de fotografías profesionales que sean necesarias para apoyo de elementos promocionales. \r\n\r\n\r\n', 2, 70, '2015-11-28', 800.00, 15.00, 'Enviado', 2, 4, 167, 158, '', NULL, '2015-11-26 05:41:49', '2015-11-27 11:41:52'),
(142, 'Técnica de Macramé para la aplicación en textiles, semillas y piedras semi preciosas.', 'Adquirir conocimientos teóricos y prácticos en la técnica de macramé para la aplicación en los productos que se comercializan.\r\n', 'Diversificar los productos de la empresa con la aplicación de la técnica para la realización de nuevos diseños.\r\nAmpliar los mercados en los que se comercializa tanto a nivel nacional como internacional.\r\n\r\n', 'Nuevos diseños con la aplicación de macramé en cada una de las líneas que se elaboran: textiles: faldas, blusas y accesorios para cabello. Semillas: ojo de venado, copinol. Semillas semi preciosas: jade.\r\nManual de procedimientos y toda la información teórica de la técnica de macramé.\r\nRecomendaciones y conclusiones\r\nEntrega de informe final digital e impreso (Copia para CDMYPE y copia para empresario).\r\n', 5, 70, '2016-06-07', 800.00, 8.00, 'Creado', 11, 6, 33, 28, '', NULL, '2016-06-02 22:15:42', '2016-06-02 22:18:46'),
(143, 'Diseño de herramientas publicitarias', 'Diseñar herramientas publicitarias necesarias para atraer nuevos clientes y darse a conocer en los mercados potenciales identificados.', 'Adquirir una imagen comercial acorde al mercado de atención de la empresa\r\nContar con las herramientas necesarias para realizar ventas con clientes formales\r\nDar a conocer los productos de la empresa a través de herramientas más adecuadas para la comercialización', 'Diseño de catálogo de productos.\r\nDiseño de tarjetas de presentación.\r\nDiseño de Banner.\r\nDiseño de brouchure y hojas volantes.\r\nDiseño de viñeta para productos\r\nDiseño de hoja membretada\r\nDiseño de interiores para la sala de venta y taller de producción. \r\nRecomendaciones y conclusiones.\r\nEntrega de documento final digital e impreso (Copia para CDMYPE y copia para empresario).\r\nTodos los artes editables en poder de empresario y CDMYPE-UNICAES.\r\nNota: La empresa cuenta con logo y marca que se encuentra en proceso de registro, por lo que las herramientas publicitarias deben de ser adaptadas a este diseño.', 5, 70, '2016-06-09', 800.00, 8.33, 'Enviado', 13, 6, 362, 353, '', NULL, '2016-06-03 20:57:07', '2016-06-06 23:20:19'),
(144, 'asdfasdf', 'asdfasdfasdf', 'asdfasdfasdf', 'asdfasdf', 4, 70, '2016-06-07', 800.00, 5.50, 'Enviado', 34, 2, 27, 23, '', NULL, '2016-06-08 02:23:04', '2016-06-08 02:55:23'),
(145, 'DISEÑO DE HERRAMIENTAS Y MATERIAL DE PROMOCIÓN PARA AGROPARTNER', 'Crear las herramientas y elementos mercadológicos para promover la oferta de la empresa en los segmentos seleccionados.', 'Diseñar una línea gráfica congruente con los objetivos y segmentos de mercado en los cuáles se pretende posicionar la empresa.', 'Creación de línea gráfica para la empresa que incluya:\r\n	Revisión y refrescamiento de logotipo.\r\n	Diseño de marca por línea de productos. \r\n	Manual de uso de marca.\r\n	Diseño de catálogo para uso digital y con formato para imprenta.\r\n	Diseño de etiquetas.\r\n	Diseño de herramientas publicitarias: flyer editable para promociones, banner y afiche.\r\n	Toma de fotografía para el diseño (si aplica).\r\n	Diseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado, facturas, folder empresarial y carta de presentación.\r\nImpresión de tiraje de muestra de herramientas publicitarias y papelería interna (excepto facturas).\r\nEntrega de documento final digital en formato Microsoft Word y dos copias impresas (Copia para CDMYPE y copia para empresario).\r\nCopia de recibo de pago en CNR para evidenciar el proceso de búsqueda de marca.\r\n', 5, 70, '2016-06-16', 800.00, 8.00, 'Creado', 13, 3, 363, 354, '', NULL, '2016-06-09 22:41:19', '2016-06-11 18:54:12'),
(146, 'Creación de Imagen Comercial y Línea Gráfica', 'Diseño y creación de la línea gráfica e imagen comercial para la Asociación Comunal de Mujeres para el Desarrollo de Victoria.', 'Creación de imagen comercial para la Asociación.\r\nRefrescamiento de Logotipo.\r\nDiseñar marca y elementos gráficos para el desarrollo de los productos.\r\n', 'Refrescamiento de logotipo para la asociación.\r\nCreación y diseño de marca comercial.\r\nManual de uso de marca.\r\nRótulo externo.\r\nDiseño de etiquetas y viñeta en tela.\r\nDiseño de herramientas publicitarias: flyer editable para promociones, banner y afiches.\r\nToma de fotografía para el diseño (si aplica)\r\nDiseño de papelería interna de la empresa: tarjetas de presentación, sobres, papel membretado facturas y crédito fiscal.\r\nFolder empresarial y carta de presentación.\r\nImpresión de tiraje de muestra de herramientas publicitarias y papeleria interna (excepto facturas)\r\nEntrega de documento final con su respectivo CD, físico y digital (Uno para CDMYPE y otro para la Asociación)', 5, 70, '2016-06-16', 800.00, 7.50, 'Creado', 13, 7, 137, 129, '', NULL, '2016-06-10 22:49:50', '2016-06-10 22:49:50');
