INSERT INTO `capterminos` (`id`, `encabezado`, `tema`, `categoria`, `descripcion`, `obj_general`, `obj_especifico`, `productos`, `lugar`, `fecha`, `fecha_lim`, `hora_ini`, `hora_fin`, `nota`, `estado`, `especialidad_id`, `usuario_id`, `informe`, `deleted_at`, `created_at`, `updated_at`) VALUES
(15, '.', 'La Buena Gestión de Recursos Financieros en el Sector Cooperativo', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación denominada “La Buena Gestión de Recursos Financieros en el Sector Cooperativo”, está dirigida a asociados de diferentes Cooperativas, de los departamentos de Cabañas, Cuscatlán y San Vicente.\r\n', 'Capacitar a los miembros de las Cooperativas participantes en la buena gestión de sus recursos financieros.', 'Identificar las fuentes de recursos financieros para Cooperativas.\r\nProveer métodos idóneos, para el debido manejo de los recursos financieros de la Cooperativa.\r\nConocer cómo funcionan los flujos financieros en las Cooperativas.	', 'Participantes con claridad acerca de las fuentes de recursos existentes.\r\nDiseño de un plan de gestión de recursos.\r\nDiseño de herramientas de control financiero.\r\nDiseño de un flujo financiero sencillo.', 'UNICAES, AULA A31', '2014-09-11', '2014-08-29', '08:00:00', '16:00:00', '', 'Finalizada', 6, 9, '', NULL, '2014-09-03 01:46:16', '2015-07-25 22:29:46'),
(16, '.', 'Estrategias de Comercialización', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', ' está dirigida a mujeres emprendedoras y empresarias de subsistencia cuenta propia de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de las participantes es muy diversa; y consiste en movilizar las redes de contacto empresariales y redes de apoyo entre las mujeres para buscar estrategias dirigidas a la comercialización de productos hacia los mercados, en coordinación con las Instituciones de apoyo a la mujer, municipalidades y/o agentes de los gobiernos locales y las organizaciones que trabajan en el tema de desarrollo empresarial para incrementar la capacidad de promover el emprendedurismo de las mujeres de forma individual y grupal. El promedio del nivel educativo de las participantes de la zona es bajo.', 'Que las empresarias conozcan las herramientas básicas de cómo vender y distribuir sus productos, y que éste se adecue al segmento de mercado al cual va dirigido el producto.  ', 'Lograr que las empresarias conozcan las características que debe tener su producto para satisfacer las necesidades de los clientes.\r\nQue las empresarias comprendan la importancia de comercializar su producto, y saber cómo lograrlo (saber vender).\r\nQue las empresarias conozcan el segmento de mercado para  la distribución correcta de sus productos. \r\nIdentificar la diferencia entre Comercialización a partir de las necesidades del cliente y distribución del producto del proceso de producción. ', 'Empresarias con las características necesarias para convertirse en una buena vendedora de su producto, e  identificar los clientes claves para lograr una venta exitosa.\r\n\r\nEmpresarias con habilidades y estrategias básicas de comercialización logrando  establecer una relación de cliente-empresaria, y poder así incrementar sus clientes actuales y potenciales obteniendo los mejores beneficios para la empresa.\r\n\r\nTips básicos para las empresarias sobre cómo negociar una venta, identificar el segmento de mercado, donde me conviene y debo distribuir mi producto, con el objetivo final de ponerlos en práctica dentro del negocio de cada una de las asistentes. \r\n\r\nQue al final de la sesión las empresarias identifiquen lo importante de comercializar sus productos y  conozcan la mejor forma de lograrlo obteniendo a la vez un mayor nivel de ingresos generando así un  impacto económico en cada uno de los negocios de las empresarias del departamento de Cabañas, Cuscatlán y San Vicente.  ', 'UNICAES, Cabañas', '2014-09-24', '2014-09-16', '08:00:00', '16:00:00', '', 'Finalizada', 9, 7, '', NULL, '2014-09-12 02:17:38', '2014-09-24 23:28:15'),
(17, 'ATENCIÓN Y SERVICIO AL CLIENTE', 'ATENCIÓN Y SERVICIO AL CLIENTE', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación “ATENCIÓN Y SERVICIO AL CLIENTE”, está dirigida a representantes de ventas, propietarios de negocios de subsistencia y propietarios de MYPES de los departamentos de Cabaña, Cuscatlán y San Vicente. La procedencia de los participantes es muy diversa; entre los sectores representados se tienen Cooperativas y empresas del sector agroalimentario, panaderías, empresas de envasado de agua, dulces artesanales, artesanías, etc. El promedio de nivel educativo formal en el empresario de la zona es bajo.', 'Contribuir al desarrollo de las habilidades de atención y servicio al cliente de tal forma que  los servicios que se presten cumplan con las necesidades y expectativas de calidad de los clientes.\r\n', 'Conocer la importancia de la atención y servicio al cliente y las herramientas básicas para el desarrollo de un excelente servicio.\r\n\r\nDar a conocer los elementos teóricos que guíen y ayuden a mejorar la calidad en el desarrollo de las funciones al momento del servicio.  \r\nIdentificar para cada tipo de clientes el respectivo tratamiento de atención\r\nIntroducir a la elaboración de un manual de atención y servicio que permita poner en práctica los conocimientos recibidos.', 'Empleados que identifiquen fácilmente el tipo de cliente y sus necesidades\r\nEmpleados con habilidades y técnicas de atención y servicio al cliente\r\nCartilla guía de manual de atención y servicio al cliente que pueda ser completado por los empleados\r\nOtros productos solicitados:\r\nDiploma de participación.\r\nAlimentación y refrigerios.\r\nMaterial Didáctico para el desarrollo de actividades durante el evento.', 'UNICAES, AULA A31', '2014-11-06', '2014-11-03', '08:00:00', '16:00:00', '', 'Finalizada', 9, 9, '', NULL, '2014-10-05 00:23:07', '2014-11-08 23:16:54'),
(18, '.', 'Imagen personal y Comunicación', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'está dirigida a mujeres emprendedoras y empresarias de subsistencia cuenta propia de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de las participantes es muy diversa; la imagen personal es nuestra carta de presentación frente al mundo. Ella se construye no sólo a través de nuestra vestimenta sino a través de una gran diversidad de variables. Si aprendemos a manejar los distintos elementos que conforman nuestra imagen tendremos más oportunidades de causar una buena impresión en nuestro interlocutor. Para tener una buena imagen a cualquier edad, es fundamental en principio tener una buena actitud. Ésta nace desde nuestro interior y se irradia al exterior, sin eso no podremos rejuvenecer. La clave, entonces, es aceptarnos, querernos y respetarnos. Luego de haber entendido que esto es fundamental, hay que saber elegir y utilizar prendas modernas y de géneros nobles de calidad que sean de colores que iluminen el rostro. El promedio del nivel educativo de las participantes de la zona es bajo.', 'Encontrar el estilo personal y conocer los diferentes factores que beneficien y ayuden a la imagen personal y comunicación de las participantes.\r\n', 'Desarrollar los diferentes componentes como: la vestimenta, la proxemia, la propia conducta, el cabello el maquillaje etc.\r\nExplicar a las participantes las formas de comunicación o tipos de lenguaje de manera que no arruine nuestra imagen.\r\nIndicar a las empresarias la importancia de pronunciar correctamente las palabras, tono de voz y hablar de forma pausada.', 'Empresarias con una imagen personal definida.\r\nEmprendedoras y empresarias con conocimientos de su propia conducta.\r\nParticipantes capaces de cuidar y seleccionar su vestimenta y no dar una imagen errónea.  \r\nLograr que las participantes obtengan una buena actitud y comunicación.', 'UNICAES, Cabañas', '2014-10-22', '2014-10-14', '08:00:00', '16:00:00', '', 'Enviado', 19, 7, '', NULL, '2014-10-06 21:35:20', '2014-10-11 22:00:24'),
(19, 'Capacitación sobre Educación Finanicera', 'Recomendaciones al solicitar un crédito y obligaciones del deudor, codeudor y fiador.', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación, está dirigida a representantes, propietarios de negocios de subsistencia y propietarios de MYPES de la zona de los departamento de Cabañas, Cuscatlán y San Vicente. La procedencia de los participantes es muy diversa; entre los sectores representados se tienen Cooperativas y empresas del sector agroalimentario, dulces artesanales, artesanías, etc. El promedio de nivel educativo formal en el empresario de la zona es bajo.', 'Capacitar a los empresarios para que conozcan como solicitar y administrar un crédito y las tarjetas de crédito.', 'Definir recomendaciones claves que ayuden al empresario en el proceso de  solicitud de un financiamiento de KT, KF, KM y consolidación de deuda.\r\nConocer como administrar las tarjetas de crédito.', 'Que los empresarios adquieran recomendaciones que les ayuden en el proceso de solicitud de un financiamiento.\r\nQue los empresarios conozcan las firente obligaciones que debe cumplir como deudor, codeudor y fiador.\r\nEntrega de informe final de la capacitación.\r\nDiploma para cada partiicpante.', 'UNICAES, Ilobasco', '2015-11-19', '2015-11-13', '08:00:00', '16:00:00', '', 'Finalizada', 25, 9, '', NULL, '2014-10-18 21:40:23', '2015-11-07 15:22:29'),
(20, 'Servicio y Atención al Cliente', 'Servicio y Atención al Cliente', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Está dirigida a empresarios miembros del Comité de Competitividad Municipal de la ciudad de Sensuntepeque, quienes están interesados en capacitarse y capacitar a su personal en las técnicas para brindar un excelente servicio a sus clientes, de tal manera que éstos se sientan bien atendidos y se vayan fidelizando con los negocios locales.', 'Contribuir a que el participante desarrolle habilidades de atención y servicio al cliente.', 'Conocer la importancia de la atención y servicio al cliente y las herramientas básicas para el desarrollo de un excelente servicio.\r\nDar a conocer los elementos teóricos que guíen y ayuden a mejorar la calidad en el desarrollo de las funciones al momento del servicio.  \r\nIdentificar para cada tipo de clientes el respectivo tratamiento de atención\r\nIntroducir a la elaboración de un manual de atención y servicio que permita poner en práctica los conocimientos recibidos. ', 'Participantes que identifiquen fácilmente el tipo de cliente y sus necesidades.\r\nParticipantes con habilidades y técnicas de atención y servicio al cliente.\r\nGuía de manual de atención y servicio al cliente que pueda ser completado por los empleados.', 'Sensuntepeque, Local Jovenesen.', '2014-11-12', '2014-11-07', '13:00:00', '17:00:00', 'La capacitación se realizará en dos jornadas de 4 horas.', 'Finalizada', 9, 9, '', NULL, '2014-11-04 01:39:21', '2014-11-12 01:39:21'),
(21, '.', 'Descubrimiento de habilidades y liderazgo emocional', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'está dirigida a mujeres emprendedoras y empresarias de subsistencia cuenta propia de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de las participantes es muy diversa; y consiste en establecer relaciones con su entorno, en el que se encuentran por supuesto otras personas, esta situación exige que seamos capaces de poder interactuar eficazmente en el contexto social que nos toque vivir. No siempre es posible desenvolvernos adecuadamente, no porque no estemos aptas para hacerlo, sino porque no hemos adquirido las habilidades para la vida necesarias. Decimos entonces que todos podemos aprender estas habilidades.\r\n\r\nLas habilidades para la vida se refieren, a las aptitudes necesarias para comportarse de manera adecuada y enfrentar con éxito las exigencias y desafíos de la vida diaria. Comprende tres categorías de habilidades: sociales, cognitivas y para el control de las emociones.   En coordinación con las Instituciones de apoyo a la mujer, municipalidades y/o agentes de los gobiernos locales y las organizaciones que trabajan en el tema de desarrollo empresarial para incrementar la capacidad de promover el emprendedurismo de las mujeres de forma individual y grupal. El promedio del nivel educativo de las participantes de la zona es bajo.\r\n', 'Articular y estimular el entusiasmo por las perspectivas y los objetivos compartidos, además de tomar decisiones independientemente de cualquier suposición, transmitir  energía emocional positiva y organizar, coordinar y movilizar los esfuerzos de un grupo de personas.', 'Desarrollar comportamientos saludables en las esferas físicas, psicológicas y sociales en la que las empresarias logre tener la posibilidad de identificar y lograr aspiraciones, satisfacer necesidades y hacer frente a su entorno.\r\nDescubrir las habilidades para la vida, las aptitudes necesarias para comportarse de manera adecuada y enfrentar con éxito las exigencias y desafíos de la vida diaria. \r\nDescubrir las habilidades respecto de sí mismo, y habilidades respecto de los demás, habilidades emocionales respecto de sí mismo.\r\n', 'Empresarias con capacidad de enfrentar, anticiparse a los riesgos y dominarlos.\r\nParticipantes capaces de aceptar la responsabilidad personal en le manejo de las propias elecciones.\r\nQue las participantes tomen conciencia de querer mejorar y por que deben hacerlo.\r\nempresarias con conocimientos de habilidades para el buen desarrollo profesional y persnal.', 'UNICAES, Cabañas', '2014-11-20', '2014-11-18', '08:00:00', '16:00:00', '', 'Finalizada', 19, 7, '', NULL, '2014-11-11 23:02:21', '2014-11-20 20:53:27'),
(22, 'Capacitación', 'Análisis de estados financieros', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación, está dirigida a representantes, propietarios de negocios de subsistencia y propietarios de MYPES de la zona de los departamento de Cabañas, Cuscatlán y San Vicente. La procedencia de los participantes es muy diversa; entre los sectores representados se tienen Cooperativas y empresas del sector agroalimentario, dulces artesanales, artesanías, etc. El promedio de nivel educativo formal en el empresario de la zona es bajo.', 'Interpretar, analizar de manera correcta los estados financieros de las empresa, desarrollar conocimientos y habilidades que les permita hacer un buen análisis para la toma de decisiones.', ' prácticar los conocimientos adquiridos en la capacitación, y puedan hacer una buena interpretación para la toma de decisiones.\r\nImplementar herramientas que permitan a los empresarios desarrollar una buena administración de sus empresas.', 'Análisis del balance general\r\nEstado de resultado\r\nRazones financieras e interpretación\r\nflujos de caja \r\nCambios en patrimonio \r\nPresupuestos\r\n', 'UNICAES, CDMYPE ILOBASCO', '2014-11-18', '2014-11-14', '08:00:00', '16:00:00', 'Enviar ofertas hasta las 2 pm', 'Finalizada', 25, 12, '', NULL, '2014-11-12 23:15:49', '2014-11-15 21:32:31'),
(23, '.', 'Estrategias de Marketing para temporada Navideña', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Ésta capacitación está dirigida a empresarios miembros del Comité de Competitividad Municipal de la ciudad de Sensuntepeque, quienes están interesados en capacitarse y capacitar a su personal, de tal manera que éstos se sientan bien atendidos y se vayan fidelizando con los negocios locales.', 'Dar a conocer estrategias de marketing de temporada navideña para que los empresarios puedan aumentar sus ventas.', 'Adquirir conocimientos sobre técnicas y herramientas de marketing que pueden ser utilizados para la temporada navideña.\r\nComprender las ventajas que ofrece el marketing para el crecimiento de la empresa.\r\nConocer las ventajas de la aplicación de estrategias de marketing dependiendo la temporada', 'Ideas creativas para ser aplicadas en el marketing de temporada navideña.\r\nEmpresarios con estrategias para el marketing de la empresa para la temporada navideña.\r\nEmpresarios con herramientas para aplicar y dar seguimiento a las estrategias de marketing.\r\nConocimiento sobre el ROI (retorno sobre la inversión) que tiene el marketing.\r\n', 'Sensuntepeque, Local Jovenesen.', '2014-11-26', '2014-11-21', '01:00:00', '05:00:00', '26 y 27 de Noviembre la capacitación será desarrollada en doble jornada de 4 horas cada una ', 'Enviado', 9, 9, '', NULL, '2014-11-19 02:53:06', '2014-11-20 03:16:41'),
(24, 'Manejo y gestión de recursos financieros para las cooperativas.', 'Manejo y gestión de recursos financieros para las cooperativas', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Integrantes de las cooperativas agrícolas de los departamentos de Cabañas y Cuscatlan.', 'Capacitar a los miembros de las cooperativas participantes en el manejo y gestión de recursos financieros.', 'Implementar estrategias para ahorrar \r\nConocer la importancia del manejo financiero de la cooperativa\r\nConocer fuentes de financiamiento para la cooperativa', 'El ahorro\r\nConcepto e importancia del ahorro \r\nEstrategia de ahorro\r\nElaboración de plan de ahorro\r\nLas cuentas de ahorro y sus tipos de interes\r\nManejo financiero de la cooperativa\r\ningreso\r\negreso \r\ncontroles financieros\r\nelementos generales de contabilidad \r\nRegistro contables básicos\r\nRegistro de ingresos y egresos \r\nLibro diario\r\nLibro mayor\r\nLibro de inventarios y balances\r\nLibros auxiliares\r\nLa cooperativa y el nivel de asociatividad\r\nAsociados\r\nRégimen Administrativo\r\nRégimen económico\r\nDisposiciones generales \r\nFuncionamiento cooperativo\r\nPrincipios\r\nNormas\r\nSon fines de la asociación cooperativa\r\nRestricciones \r\nClases de cooperativas\r\nDe la constitución, inscripción y autorización oficial para operar', 'UNICAES, CDMYPE ILOBASCO', '2014-11-28', '2014-11-25', '08:00:00', '16:00:00', '', 'Finalizada', 6, 12, '', NULL, '2014-11-21 02:57:50', '2014-11-28 22:45:33'),
(25, 'Capacitación', 'Presupuesto Familiar y Planificación en mi empresa', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'Presupuesto familiar y planificación en mi empresa es dirigida para Empresarios de los departamentos de Cabañas, Cuscatlan y San Vicente ', 'Que los empresarios tengan un mayor control de su situación financiera familiar y que analicen la importancia de la planificación en la empresa.', 'Tener herramientas que ayuden a elaborar un presupuesto familiar y la planificación en mi empresa.\r\nConocer la importancia de tener un presupuesto familiar para ver que gastos parean priorizar, reducir o eliminar.\r\n\r\nTener un mayor control de los gastos una estimación de los ingresos de la empresa, nivel de ahorro y nivel de endeudamiento.\r\n', '¿Qué es un presupuesto familiar?\r\n¿Qué incluye un presupuesto familiar? Ingresos fijos, ingresos variables, gastos fijos y gastos variables.\r\n¿Cuáles son los objetivos de elaborar un presupuesto familiar?\r\n¿Cómo elaborar el presupuesto?\r\nEjemplos de elaboración de presupuesto.\r\nConsejos para una economía familiar sana.\r\n¿Qué es la planeación?\r\nLa importancia de la planificación en mi empresa\r\n¿Por qué planificar?\r\nEl presupuesto, una herramienta de la planificación.\r\nIngresos de mi empresa fijos y variables y gastos de mi empresa fijos y variables\r\nEjemplo de planificación en mi empresa\r\n¿Qué hacer cuando el presupuesto de mi negocio es negativo?\r\nRecomendaciones para fortalecer el presupuesto de su negocio\r\nRecomendaciones para reducir el presupuesto de su negocio\r\nConclusiones.', 'UNICAES, CDMYPE ILOBASCO', '2014-12-10', '2014-12-05', '08:00:00', '16:00:00', 'Se recibirán ofertas hasta las 2', 'Finalizada', 6, 12, '', NULL, '2014-12-02 22:58:21', '2014-12-10 04:37:18'),
(26, 'Buenas Prácticas de Manufactura en la Manipulación de Alimentos.', 'Buenas Prácticas de Manufactura en la Manipulación de Alimentos.', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación “ Buenas Prácticas de Manufactura en la Manipulación de Alimentos”, está dirigida a representantes del área de producción, propietarios de negocios de subsistencia y propietarios de MYPES de los departamentos de Cabaña, Cuscatlán y San Vicente. La procedencia de los participantes es muy diversa; entre los sectores representados se tienen Cooperativas y empresas del sector agroalimentario, panaderías, empresas de envasado de agua, dulces artesanales, artesanías, etc. El promedio de nivel educativo formal en el empresario de la zona es bajo.', 'Proporcionar los conocimientos y herramientas necesarias de Las Buenas Prácticas de Manufactura en toda la cadena de producción desde la obtención de la materia prima hasta transporte de producto terminado para asegurar la inocuidad de estos.\r\n', 'Conocer la importancia de la aplicación de las BPM.\r\nEstablecer el procedimiento esencial de las buenas prácticas manufactura en elaboración de alimentos destinados para el\r\nconsumo humano. \r\nDar a conocer los hábitos de higiene que el personal debe cumplir para  proteger a los alimentos contra una contaminación  proveniente de equipos, herramientas y utensilios.\r\n\r\n\r\n\r\n\r\n', 'Que los empresarios conozcan la importancia de las BPM en la Industria de Alimento.\r\nQue los empresarios establezcan procedimientos adecuados de BPM para su empresa.\r\nQue los empresarios comprendan las BPM, a través de demostraciones prácticas, videos entre otros instrumentos didácticos a utilizar para una mejor comprensión.', 'Unicaes- A32', '2014-12-11', '2014-12-05', '08:00:00', '16:00:00', '', 'Finalizada', 7, 9, '', NULL, '2014-12-03 21:50:30', '2014-12-11 23:09:57'),
(27, '“TÉCNICAS DE MERCHANDISING”', '“TÉCNICAS DE MERCHANDISING”', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación “TÉCNICAS DE MERCHANDISING”, está dirigida a representantes de ventas, propietarios de negocios de subsistencia y propietarios de MYPES de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de los participantes es muy diversa; entre los sectores representados se tienen Cooperativas y empresas del sector agroalimentario, panaderías, empresas de envasado de agua, dulces artesanales, artesanías, etc. El promedio de nivel educativo formal en el empresario de la zona es bajo.\r\n\r\n', 'Contribuir a que el empresario desarrolle las técnicas de merchandising y el conocimiento que se requiere para aplicar en los puntos de venta y mejorar la demanda de los productos o servicios de la empresa. ', 'Que el empresario pueda desarrollar las habilidades y herramientas de mercadeo requeridas para resaltar las características y el potencial de su producto.\r\nDar a conocer los elementos teóricos, practicos y las diferentes estrategias que debe tener el empresario para presentar su establecimiento de manera más atractiva frente a la competencia.  Determinar la importancia que tiene el establecer técnicas de merchandising adecuadas para el punto de venta y poder mejorar así la rentabilidad del negocio.\r\nQue el empresario pueda aplicar dentro de sus negocios técnicas de exhibición y técnicas de promoción para su producto o servicio.', 'Empresarios con el conocimiento necesario para la aplicación de técnicas de merchandising para su empresa.\r\nEmpresarios con las habilidades y estrategias básicas para mejorar la comercialización de su producto o su servicio.\r\nCartilla guía de manual para elaborar las diferentes técnicas de merchandising, que incluya las estrategias y los conceptos básicos a conocer por el empresario.\r\nEntrega a CDMYPE de  informe final de las actividades realizadas en la capacitación.', 'Ilobasco', '2014-12-12', '2014-12-05', '08:00:00', '16:00:00', '', 'Finalizada', 9, 9, '', NULL, '2014-12-03 22:43:58', '2014-12-12 23:05:17'),
(28, 'Estrategias de Merchandising para potenciar la venta', 'Estrategias de Merchandising para potenciar la venta', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente', 'La capacitación “Estrategias de Merchandising para potenciar la venta” está dirigida a empresarios miembros del Comité de Competitividad Municipal de la ciudad de Sensuntepeque, quienes están siendo atendidos por CDMYPE por medio de un proceso de formación iniciado en noviembre del año anterior. Dicho comité se ha organizado para seguir un proceso de mejora orientado a fortalecer las capacidades del personal e incrementar la formación como empresarios. Entre los negocios invitados a participar en la formación están:\r\nCasas comerciales.\r\nFarmacias.\r\nTiendas de suvenires y artesanías.\r\nTiendas de variedades.\r\nPanaderías, entre otros.\r\n', 'Proporcionar los conocimientos y las herramientas necesarias para la aplicación del Merchandising como estrategia para potenciar las ventas en los establecimientos comerciales de Sensuntepeque.', 'Desarrollar los contenidos básicos del Merchandising aplicado a pequeños negocios y promover actividades orientadas a afianzar los conocimientos sobre estrategias aplicables y efectivas para potenciar las ventas en los establecimientos comerciales.', 'Conceptos generales y principales funciones del Merchandising.\r\nTipos de Merchandising.\r\nGestión del surtido.\r\nLa arquitectura del establecimiento.\r\nGestión estratégica del punto de venta.\r\nInforme Final.', 'Local JOVENESEN ubicado en: 1ª. Av. sur y 10ª. calle poniente No. 47, Colonia Buenos Aires, Sensuntepeque, Cabañas.', '2015-04-24', '2015-04-13', '17:00:00', '17:00:00', 'La capacitación se realizará en dos jornadas los días 17 y 24 de abril en horario de 1 a 5 pm.', 'Finalizada', 9, 9, '', NULL, '2015-04-10 20:21:29', '2015-11-04 02:39:32'),
(29, 'Términos de Referencia ', 'Tendencias del Mercado en Diseños de Artesanías de Barro.', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación esta dirigida a grupo de Artesanos miembros de la Mesa Artesanal de Ilobasco. \r\nLos productos que elaboran actualmente son: utilitarios, bisutería en barro, decorativos, figuras humanas, religiosos, entre otros. \r\n\r\nEl mercado que atienden es el mercado local, buscando acceder a mercados con alto potencial de desarrollo nivel nacional. ', 'Fortalecer los conocimientos de los participantes en la tendencia de los diseños artesanales para segmento de turista nacional, internacional, Instituciones, Empresas y Restaurantes.', 'Identificar gustos y preferencias de segmentos de mercado objetivo.\r\nConocer tendencias en diseño, colores, tamaños, técnicas, materiales y precio.\r\nIdentificar los clientes potenciales que demanda estos productos y diseños.', 'Determinar las lineas de diseño artesanal a producirse según la demanda identificada.\r\nDefinir colores, tamaños, formas, materiales y técnicas aplicadas a los diseños demandados.\r\nSugerencias de precios de productos diseñados según demanda de mercado.\r\nPropone una lista de posibles clientes con mayor potencial de venta a las tendencias identificadas.', 'CDMYPE-Ilobasco', '2015-05-20', '2015-05-15', '13:00:00', '17:00:00', 'La capacitación se realizará en dos jornadas los días 20 y 27 de mayo en horario de 1 a 5 pm.', 'Finalizada', 9, 4, '', NULL, '2015-04-13 21:50:50', '2015-05-20 03:19:01'),
(30, '.', 'La sonrisa de afuera y la sonrisa de adentro', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Está dirigida a mujeres emprendedoras y empresarias de subsistencia cuenta propia de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de las participantes es muy diversa, la capacitación esta orientada a conocer que cuando hablamos de sonreír estamos hablando de un proceso verdaderamente muy complejo a nivel psicológico con implicaciones muy grandes, tanto hacia tu propia mente y cuerpo como hacia las mentes de los que te rodean. Una sonrisa es algo verdaderamente trascendente. De hecho es una de las expresiones más exclusivas de la muy avanzada evolución de nuestros cerebros humanos. El promedio del nivel educativo de las participantes de la zona es bajo.', 'Explicar a las participantes sobre los dos tipos de sonrisas, la sonrisa de afuera y la sonrisa desde adentro, y sus cualidades que se relacionan entres si. ', 'Dar a conocer a las participantes la relación que existe entre la sonrisa y las emociones.\r\nRelacionar los tipos de sonrisas con el autoestima.\r\nDemostrar que el habito de la sonrisa ayuda al desarrollo personal.', 'Que las Empresarias y emprendedoras conozcan que la sonrisa es tan importante en la interacción con miembros de la misma especie.\r\nQue las participantes conozcan que la sonrisa es una expresión que comunica el estado de animo de las personas.\r\nParticipantes con conocimientos de las consecuencias importantes de los dos tipos de sonrisas.\r\nEmpresarias y emprendedoras motivadas para desempeñar su vida empresarial y familiar con motivación y autoestima.\r\nQue al final de la capacitación las participantes identifiquen que una sonrisa cambia la percepción de ver la vida de los demás y de ellas mismas.', 'CDMYPE UNICAES Ilobasco', '2015-05-14', '2015-05-08', '08:00:00', '16:00:00', '', 'Finalizada', 31, 7, '', NULL, '2015-04-22 03:59:05', '2015-05-14 03:55:23'),
(31, '.', 'La mujer emprendedora y el liderazgo', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Está dirigida a mujeres emprendedoras y empresarias de subsistencia cuenta propia de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de las participantes es muy diversa, la capacitación esta orientada a conocer cuáles son esos factores que están incidiendo para que la mujer no logre llegar a donde han logrado llegar los grandes hombres líderes.  Hoy se habla de que las mujeres tienen la ventaja en la mayoría de las dimensiones de liderazgo con respecto a los hombres y se suponía que la década pasada iba a traer la igualdad en los géneros en cuanto a liderazgo, sin embargo aunque es cierto que se ha ganado terreno, las mujeres continúan en la mayoría de los casos detrás de los hombres en lo que se refiere a liderazgo en las empresas. ', 'Descubrir cuáles son esos factores que están incidiendo para que la mujer no logre llegar a donde han logrado llegar los hombres líderes.', 'Examinar las características de las mujeres lideres.\r\nDemostrar que la mujer es mucho más participativa en sus relaciones con los demás, se dice que la mujer es colaboradora, conciliadora y emocional y que el hombre es racional y autoritario en el manejo de sus relaciones.\r\nEntender que tanto hombres como mujeres tienen diferentes fortalezas de liderazgo y que el gran salto debe darse en que la mujer se apropie de su estilo con seguridad, combinando su parte emocional.', 'Explicar a las participantes las características de las mujeres lideres, visión, asumir riesgos y saber comunicar.\r\nFortalecer a las mujeres y valiéndose de herramientas que le permitan entender mejor el entorno.\r\nEstablecer una dirección estratégica y teniendo una apertura total hacia la nueva forma de hacer la cosas. \r\nEnseñar que la mujer emprendedora es tan líder como ella misma decida serlo.', 'CDMYPE UNICAES Ilobasco', '2015-06-25', '2015-06-18', '08:00:00', '16:00:00', '', 'Finalizada', 31, 7, '', NULL, '2015-06-06 04:29:25', '2015-06-22 22:00:34'),
(32, 'Trabajo en Equipo', 'Trabajo en Equipo', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Está dirigida a personal de diferentes áreas de las empresas participantes, propietarios de negocios de subsistencia y propietarios de MYPES de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de los participantes es muy diversa; entre los sectores representados se tienen Cooperativas y empresas del sector agroalimentario, panaderías, empresas de envasado de agua, dulces artesanales, artesanías y restaurantes etc. Los participantes tienen un nivel educativo entre bajo y medio.', 'Transmitir y reforzar en los participantes conceptos y herramientas que les permitan adquirir y mejorar su habilidades para trabajar en equipo.', 'Que los participantes reflexionen sobre los factores que inciden en la aplicación el trabajo en equipo en su empresa.\r\nFortalecer en los participantes actitudes, comportamientos de cooperación y ayuda mutua para lograr objetivos compartidos en el ámbito empresarial.\r\nComprender la importancia del trabajo en equipo y los roles que cada miembro debe de cumplir para mejorar el rendimiento el clima y la satisfacción de la empresa.', 'Mejorar la sinergia e integración en el equipo de trabajo.\r\nEmpresarios y empleados motivados hacia el logro de objetivo en común.\r\nLograr el interés del empresario en poner en práctica lo aprendido del tema.\r\nMaterial de apoyo \r\nDiploma de participación.', 'UNICAES, Ilobasco, Edificio A, Aula 24', '2015-06-23', '2015-06-18', '08:00:00', '16:00:00', 'Hacer llegar las ofertas a más tardar a las 3 pm.', 'Finalizada', 5, 9, '', NULL, '2015-06-16 02:53:43', '2015-06-22 20:23:56'),
(33, 'TÉRMINOS DE REFERENCIA ', 'CONTROL INTERNO DE LAS TRANSACCIONES  Y PROCESO CONTABLE PARA TOMA DE DECISIONES FINANCIERAS', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Está dirigida a empresas con figuras de persona natural y asociaciones cooperativas del departamento de San Vicente, quienes lideran diferentes proyectos productivos en los rubros de cultivos de hortalizas en invernadero, elaboración de vinos, artesanías, serigrafía y confección de prendas. Actualmente todos son contribuyentes al IVA, sin embargo  tienen dificultades en el adecuado registro y control de sus operaciones en los libros contables exigidos, lo cual perjudica la toma de decisiones financieras, ya que los estados financieros, como elementos de análisis, no reflejan información fidedigna, volviéndose en muchos casos un obstáculo en la administración de la empresa y en la toma de decisiones de inversión. \r\n', 'Guiar a los empresarios contribuyentes en la implementación del proceso contable para garantizar control interno y tomar decisiones financieras basada en información fidedigna', 'Orientar sobre las obligaciones tributarias que deben cumplir las personas naturales y jurídicas al ser contribuyentes al IVA \r\nConducir al adecuado registro y clasificación de las transacciones usando los libros correspondientes para llevar un orden y control interno de las operaciones\r\nExplicar sobre la importancia de los indicadores  resultantes de la información registrada en los libros contables para la toma de decisiones financieras y cumplimiento de requisitos exigidos por las instituciones dedicadas a la concesión de fondos económicos reembolsables y no reembolsables\r\n', 'Empresarios responsables en el control interno de sus empresas\r\nRegistro adecuado de las transacciones en los libros correspondientes exigidos por la Ley del IVA\r\nEmpresarios conscientes de la importancia de la información contable para la toma de decisiones financieras y la búsqueda de fondos a través de la IFI.', 'UES San Vicente', '2015-07-08', '2015-06-30', '08:00:00', '16:00:00', '', 'Finalizada', 24, 4, '', NULL, '2015-06-24 23:30:41', '2015-07-04 22:01:07'),
(35, 'TÉRMINOS DE REFERENCIA', 'Gestión de BPM en el  área de alimentos y bebidas en restaurantes', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'esta dirigida al personal del área de alimentos y bebidas de restaurantes y establecimientos similares.            En busca de mantener un área de trabajo organizada que cumpla con estándares de calidad e inocuidad, los empresarios y empleados de este rubro buscan mejorar el desempeño de una de las áreas importantes del sector restauración. Participará, personal del área de cocina de restaurantes de Cuscatlán, Cabañas y San Vicente. ', 'Mejorar la calidad del servicio de alimentos y bebidas de establecimientos gastronómicos  implementando  normas de higiene y manipulación de los alimentos. ', 'Capacitar al personal de la micros y pequeñas empresas en Buenas Prácticas de Manufactura.\r\nDesarrollar actitudes de conducta personal que beneficien su función de la  higiene personal, manipulación de alimentos.\r\nProponer herramientas básicas que les permitan llevar un control de la implementación de las BPM y manipulación de Alimentos.\r\n', 'Participantes con conocimientos sobre la correcta manipulación de los alimentos para evitar contaminación.\r\nProcedimientos de  tratamiento para la conservación de los alimentos (aves, carnes, mariscos): mecánicos, físicos y químicos.\r\n\r\nConocimiento sobre: almacenar, preparar, servir y transportar los alimentos en la forma adecuada.\r\n\r\nAplicación de medidas sanitarias vigentes. \r\n\r\nPersonal capacitado para mejorar la organización de la cocina\r\nParticipantes que cuenten con un modelo que les permita crear sus propios procedimientos en la de manipulación de alimentos.', 'CDMYPE', '2015-09-03', '2015-08-29', '08:00:00', '16:00:00', '', 'Finalizada', 7, 4, '', NULL, '2015-07-18 01:01:17', '2015-09-04 02:12:14'),
(36, '.', 'Trabajo en equipo enfocado a mujeres', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Está dirigida a mujeres emprendedoras y empresarias de subsistencia cuenta propia de los\r\ndepartamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de las participantes es muy diversa,  y busca identificar los aspectos y formas de trabajar con mujeres, identificar las actitudes, habilidades y toma de decisión grupal cuando se trata de resolver el clima organización de los grupos de mujeres. El promedio del nivel educativo de las participantes de la zona es bajo.', 'Explicar a las participantes conceptos y herramientas que les permitan adquirir y mejorar sus habilidades para trabajar en equipo, especialmente con mujeres.', 'Que las participantes conozcan y pongan en practica los factores que inciden en la aplicación el trabajo en equipo con las mujeres.\r\nFortalecer en las participantes actitudes, comportamientos de cooperación y ayuda mutua para lograr objetivos compartidos en el ámbito empresarial.\r\nComprender la importancia del trabajo en equipo y los roles que cada persona debe de cumplir para mejorar el rendimiento el clima organizacional y la satisfacción del negocio.', 'Mejorar la sinergia e integración en el equipo de trabajo con mujeres.\r\nDar a conocer a las participantes las ventajas y desventajas del trabajo en equipo.\r\nLograr que las empresarias conozcan las características y técnicas del trabajo en equipo.\r\nQue las mujeres comprendan la importancia del trabajo en equipo. \r\nEmpresarias motivadas a buscar e identificar las formas de trabajar entre mujeres, hacia el logro de un objetivo común.\r\nLograr el interés de las empresarias en poner en práctica lo aprendido del tema.\r\nMaterial de apoyo.\r\nDiploma de participación.', 'Ilobasco, Cabañas', '2015-08-18', '2015-07-31', '08:00:00', '16:00:00', '', 'Finalizada', 5, 7, '', NULL, '2015-07-25 04:19:59', '2015-08-18 19:08:24'),
(37, 'Manejo responsable del crédito y la importancia del ahorro', 'Manejo responsable del crédito y la importancia del ahorro', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'Dirigida a empresarias de la cooperativa ACOPAIME DE R.L.y cooperativa ACOPASENFRAS DE R.L.', 'Capacitar a los miembros de las cooperativas participantes en el manejo responsable de créditos y herramientas de ahorro. ', 'Conocer la importancia del recod créditos responsable\r\nConocer fuentes de financiamientos\r\nImplementar estrategias para ahorrar\r\n', 'Análisis para solicitar un crédito\r\nPlazos de crédito (KT, KF, KM)\r\nAnálisis de  tasa de interés  nominal\r\nAnálisis de  tasa de interés efectiva\r\nComisiones \r\nSeguros\r\nRecargos moratorios\r\nPlan de pago\r\nRecord crediticio\r\nObligaciones del codeudor \r\nRol de la garantía \r\nTabla de amortización\r\nEjemplos de créditos y sus componentes\r\nTécnicas de ahorro\r\n', 'unicaes ilobasco', '2015-09-08', '2015-09-04', '08:00:00', '16:00:00', '', 'Finalizada', 6, 12, '', NULL, '2015-08-18 01:45:36', '2015-09-09 02:22:07'),
(38, 'Capacitación  Calidad en el Servicio al Cliente, ', 'Capacitación Calidad en el Servicio al Cliente. ', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'Ferretería El 7, es pionera en el servicio de construcción en Ilobasco, cuenta con más de 30 años de experiencia en ferreterías, actualmente cuentan con 6 salas de venta de ferreterías, incluyendo una en Sensuntepeque.\r\nSus propietarios están consientes de la necesidad de capacitar a su personal en la mejora de la calidad de los servicios que brindan a sus clientes, conscientes del cambio que genera constantemente el mercado que atiende.\r\n\r\nPartiendo de esta necesidad, han solicitado al CDMYPE el apoyo en capacitar a su personal en el tema de Servicio al Cliente.', 'Ofrecer a los empleados de Ferretería el 7 un soporte  de calidad sobre los aspectos relacionados con la atención al cliente, para que lo incorporen en forma eficiente al momento de interactuar con sus clientes.', 'Conocer lo que los clientes necesitan para sentirse satisfechos.\r\nIdentificar los tipos de clientes, para saber cómo tratarlos, en el momento oportuno. \r\nDar a conocer a los empleados los pasos para una excelente atención y servicio a partir de casos prácticos.\r\nDeterminar qué medidas tomar cuando existen reclamos de los clientes\r\n', 'Empleados que identifiquen fácilmente el tipo de cliente y sus necesidades.\r\nEmpleados brindando servicio al cliente unificada en todas las tiendas.\r\nEmpleados desempeñando un mejor desempeño en su servicio y atención a los clientes.\r\nEmpleados y jefes aprovechando al máximo el tiempo y el recurso como parte de su servicio al cliente.\r\nJefes de tienda orientados a brindar y resolver problemas con calidad en el servicio al cliente.\r\n\r\n', 'Empresa Ferreteria El 7', '2015-09-02', '2015-09-12', '08:00:00', '16:00:00', '', 'Creado', 9, 5, '', NULL, '2015-09-02 22:54:22', '2015-09-02 22:54:22'),
(39, 'Capacitación Calidad en el Servicio al Cliente', 'Capacitación Calidad en el Servicio al Cliente', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'La capacitación “Calidad en el Servicio al Cliente ” está dirigida a los empleados de la Ferretería El 7, la ferretería es pionera en el servicio de construcción en Ilobasco, cuenta con más de 30 años de experiencia en ferreterías, actualmente cuentan con 6 salas de venta, incluyendo una en Sensuntepeque. \r\n\r\nSus propietarios están conscientes de la necesidad de capacitar a su personal en la mejora de la calidad de los servicios que brindan a sus clientes, conocedores del cambio que genera constantemente el mercado que atienden.\r\n\r\nPartiendo de esta necesidad, han solicitado al CDMYPE el apoyo en capacitar a su personal en el tema de Servicio al Cliente.', 'Ofrecer a los empleados de Ferretería el 7 un soporte de calidad sobre los aspectos relacionados con la atención al cliente, para que lo incorporen en forma eficiente al momento de interactuar con sus clientes. ', 'Conocer lo que los clientes necesitan para sentirse satisfechos.\r\nIdentificar los tipos de clientes, para saber cómo tratarlos, en el momento oportuno.\r\nDar a conocer a los empleados los pasos para una excelente atención y servicio a partir de casos prácticos.\r\nDeterminar qué medidas tomar cuando existen reclamos de los clientes.', 'Empleados que identifiquen fácilmente el tipo de cliente y sus necesidades. Empleados brindando servicio al cliente unificada en todas las tiendas.\r\nEmpleados desempeñando un mejor trabajo en su servicio y atención a los clientes.\r\nEmpleados y jefes aprovechando al máximo el tiempo y el recurso como parte de su servicio al cliente. Jefes de tienda orientados a brindar y resolver problemas con calidad en el servicio al cliente.\r\n\r\nOtros productos solicitados:\r\nDiploma de participación. Almuerzo y 2 refrigerios.\r\nMaterial Didáctico para el desarrollo de actividades durante el evento.', 'Instalaciones de Ferretería el 7, Ilobasco, Cabañas.', '2015-09-18', '2015-09-09', '08:00:00', '16:00:00', '', 'Finalizada', 9, 9, '', NULL, '2015-09-06 02:35:36', '2015-09-17 03:28:13'),
(40, '.', 'Etiqueta en la mesa y presentación personal', 'Emprendedoras y empresarias de los Departamentos de Cabañas, Cuscatlán y San Vicente.', 'Está dirigida a mujeres dedicadas a diferentes actividades empresariales, durante la jornada se pretende dar a conocer el conjunto de normas de educación a la hora de comer en grupo en donde incluye el correcto manejo de los utensilios, cubertería y la cristalería.\r\nEl objetivo de la etiqueta es la forma de comportarse en la mesa en resumen ser prácticos. Otro aspecto de interés para las participantes es la presentación personal ya que la manera en que las personas visten y la forma en que actúa determina lo que la gente piensa de nosotras. La óptima presentación personal es indispensable porque gracias a ella cada persona se proyecta, construye el clima de las relaciones interpersonales, impresiona favorablemente y caracteriza su manera de ser, su rol laboral y profesional. \r\n', 'Explicar el conjunto de reglas, normas y costumbres que nos permite desenvolvernos adecuadamente en los diferentes ambientes y alcanzar las habilidades de etiqueta y así poder maximizar su imagen profesional y personal.', 'Presentar los temas de una manera teórico-práctico, permitiendo que conozcan las herramientas más relevantes en materia de etiqueta en la mesa a través de la capacitación.\r\nDefinir qué es lo que quieren proyectar y así poder tener claro los propósitos personales en relación al tema.\r\nProporcionar los valores sociales relacionados con la presentación personal, los buenos hábitos de arreglo personal para mejorar su apariencia y autoestima.', 'Participantes con conocimientos claros de las reglas, normas y costumbres  de la etiqueta en la mesa, a fin de que puedan desenvolverse adecuadamente en los diferentes ambientes.\r\nQue las empresarias conozcan  la importancia de los aspectos fundamentales del ser humano, cuerpo, mente, efectividad, espiritualidad y comportamiento, ya que somos personas integrales y nuestro comportamiento y nuestra presentación proyectan el estado de ánimo.\r\nConcientizar a las participantes que el cuidado de nuestra presentación personal es un reflejo del respeto que sentimos por nosotras mismas y, en consecuencia, por los demás.', 'UNICAES CDMYPE Ilobasco', '2015-10-14', '2015-10-06', '08:00:00', '16:00:00', '', 'Finalizada', 31, 7, '', NULL, '2015-09-25 00:12:38', '2015-11-04 01:46:24'),
(41, 'Manejo responsable del crédito y la importancia del ahorro', 'Manejo responsable del crédito y la importancia del ahorro', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.', 'Empresarios del departamento de Cabañas, Municipio de Sensuntepeque.', 'Que los empresarios tengan un mayor control de su situación financiera familiar y que analicen la importancia de la planificación en la empresa.', 'Tener herramientas que ayuden a elaborar un presupuesto familiar y la planificación en mi empresa.\r\nConocer la importancia de tener un presupuesto familiar para ver que gastos parean priorizar, reducir o eliminar.\r\n\r\nTener un mayor control de los gastos una estimación de los ingresos de la empresa, nivel de ahorro y nivel de endeudamiento.', '¿Qué es un presupuesto familiar?\r\n¿Qué incluye un presupuesto familiar? Ingresos fijos, ingresos variables, gastos fijos y gastos variables.\r\n¿Cuáles son los objetivos de elaborar un presupuesto familiar?\r\n¿Cómo elaborar el presupuesto?\r\nEjemplos de elaboración de presupuesto.\r\nConsejos para una economía familiar sana.\r\n¿Qué es la planeación?\r\nLa importancia de la planificación en mi empresa\r\n¿Por qué planificar?\r\nEl presupuesto, una herramienta de la planificación.\r\nIngresos de mi empresa fijos y variables y gastos de mi empresa fijos y variables\r\nEjemplo de planificación en mi empresa\r\n¿Qué hacer cuando el presupuesto de mi negocio es negativo?\r\nRecomendaciones para fortalecer el presupuesto de su negocio\r\nRecomendaciones para reducir el presupuesto de su negocio\r\nConclusiones.', 'Sensuntepeque, Instalaciones de JoveneSen', '2015-10-28', '2015-10-25', '08:00:00', '16:00:00', 'Enviar oferta antes de la 1 de la tarde.', 'Finalizada', 25, 9, '', NULL, '2015-10-22 04:41:39', '2015-11-03 21:34:48'),
(42, '', 'fsdfa', 'ajskfdas dfas d', 'fasdf', 'sasdf', 'q2rqwe', 'sagfasdfasdf', 'svsdfgs', '2015-11-03', '2015-11-13', '08:00:00', '16:00:00', '', 'Enviado', 1, 2, '', NULL, '2015-11-04 02:13:58', '2015-11-04 20:03:52');
INSERT INTO `capterminos` (`id`, `encabezado`, `tema`, `categoria`, `descripcion`, `obj_general`, `obj_especifico`, `productos`, `lugar`, `fecha`, `fecha_lim`, `hora_ini`, `hora_fin`, `nota`, `estado`, `especialidad_id`, `usuario_id`, `informe`, `deleted_at`, `created_at`, `updated_at`) VALUES
(43, '', 'Manejo de Conflicto en la empresa, la familia y la vida personal', '.', 'Está dirigida a mujeres dedicadas a diferentes actividades empresariales, durante la jornada de capacitación surge la respuesta de las demandas de las empresarias por desarrollar en sus colaboradores las competencias para el manejo de conflictos eficientes y asertivamente. La resolución funcional de conflictos es una de las destrezas más utilizadas en la mantención de un buen clima laboral y en las relaciones interpersonales. se pretende dar a entender la teoría del conflicto para ello es necesario tomar como centro de estudio al ser humano, quienes intrínsecamente tenemos conflictos  que por lo general trascienden al entorno social y laboral y que se ven reflejados en la sociedad. El conflicto es una fuerza negativa, es una expresión natural y diferente de una sociedad en su lucha por la justicia y su propia autodeterminación, el conflicto no es más que un aspecto intrínseco inevitable del cambio social, porque es una expresión heterogénea de intereses, valores, necesidades y creencias que dan lugar a nuevas ideas producidas por la presión de ese cambio social y laboral. ', 'Identificar y manejar las distintas relaciones interpersonales y grupales de conflicto en el ambiente laboral, familiar y personal.', 'Aplicar técnicas de resolución de conflictos.\r\nEmplear estrategias de gestión de clima laboral formales e informales, que incorporen la resolución de conflictos.\r\nAlcanzar resultados satisfactorios para las partes involucradas en el conflicto.\r\nIdentificar causas de síntomas en los conflictos.', 'Que las participantes identifiquen las características de los conflictos.\r\nQue las empresarias conozcan los tipos de conflictos en la vida laboral, familiar y personal.\r\nQue las empresarias sean capaz de mediar en una resolución de conflictos.\r\nParticipantes con conocimientos en técnicas para resolver conflictos laborales.\r\nLograr que las empresarias apliquen las técnicas de estimulación de conflictos.', 'UNICAES CDMYPE Ilobasco', '2015-11-17', '2015-11-09', '08:00:00', '16:00:00', '', 'Finalizada', 31, 7, '', NULL, '2015-11-04 04:00:48', '2015-11-10 15:51:51'),
(44, '', 'Tips y recomendaciones al solicitar un crédito y Aprender cómo administrar tus tarjetas de crédito.', 'Empresarios de los departamentos  los departamentos de Cabañas y Cuscatlan.', 'La capacitación, está dirigida a empresarios la zona de los departamento de Cabañas y Cuscatlán . La procedencia de los participantes es muy diversa; entre los sectores representados se tienen empresas del sector agroalimentario, dulces artesanales, artesanías, etc.', 'Capacitar a los empresarios para que conozcan como solicitar y administrar un crédito y las tarjetas de crédito.', 'Definir recomendaciones claves que ayuden al empresario en el proceso de  solicitud de un financiamiento de KT, KF, KM y consolidación de deuda.\r\nConocer como administrar las tarjetas de crédito.', 'Qué es un crédito?\r\nRecomendaciones al solicitar un crédito para KT, KF, KM y consolidación. (plazos, formas de pago y periodo de gracia).\r\nTasa de interés nominal, tasa de interés efectiva y comisiones.\r\nQue los empresarios aprendan como administrar las tarjetas de crédito.\r\nQue es una tarjeta de crédito?\r\nRecomendaciones para seleccionar una tarjeta de crédito.\r\nVentajas de las tarjetas de crédito.\r\nDesventajas de las tarjetas de crédito.\r\nConsejo para un sano manejo de la tarjeta de crédito.\r\nConsejos de seguridad con tu tarjeta de crédito.\r\nEntrega de informe final de la capacitación.\r\nDiploma para cada participante.', 'UNICAES, Ilobasco', '2015-11-25', '2015-11-16', '08:00:00', '16:00:00', 'Las ofertas serán recibidas hasta 11am.', 'Finalizada', 6, 9, '', NULL, '2015-11-07 15:25:03', '2015-11-28 16:49:29'),
(45, '', '¿Como determinar el tamaño de mi empresa?', 'Empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente', ' está dirigida a empresarios de los departamentos de Cabañas, Cuscatlán y San Vicente.\r\n', 'Capacitar y conocer herramientas claves para determinar el tamaño de mi empresa,como hacer un flujo de efectivo y solicitar un financiamiento.', 'Identificar los recursos de la empresa.\r\nConocer la capacidad efectiva de pago.\r\nSolicitar financiamiento de acuerdo a la capacidad de endeudamiento y pago. pago.\r\nConocer los flujos de efectivo.', '¿Como determinar el tamaño de mi empresa?\r\n¿Porque necesito saber el tamaño de mi empresa?\r\n¿como hacer un flujo de efectivo?\r\n¿como analizar el flujo de efectivo?\r\nDeterminar para mi un salario razonable acorde al tamaño de tu empresa. \r\n¿Como solicitar un financiamiento?', 'UNICAES, Ilobasco', '2015-12-11', '2015-12-07', '08:00:00', '16:00:00', '', 'Finalizada', 6, 9, '', NULL, '2015-12-03 19:54:42', '2015-12-11 12:40:08'),
(46, '', 'Manejo Integrado de Plagas en la Apicultura Provocadas por el Cambio Climático', 'Empresarios del Departamento de Cabañas.', 'El CDMYPE a través de sus servicios de capacitación, está realizando el proceso de     contratación para el tema “Manejo Integrado de Plagas en la Apicultura Provocadas por el Cambio Climático” para la Coopertiva Apicabañas de R.L. es una asociación cooperativa que aglomera a veintiséis apicultores del departamento de Cabañas. En los últimos dos años, la cooperativa ha recibido el apoyo de programas como el Prodemor Central, Fondo de Desarrollo Territorial de FONDEPRO, entre otros. Con dichos apoyos se ha podido construir un centro de acopio, y se está en proceso de equipar un área para el desarrollo de productos derivados de la miel.\r\nEl mercado de Apicabañas es mayoritariamente de exportación, ya que ésta es parte de la Cadena de la Miel que le permite llegar a mercados internacionales, principalmente el europeo.', 'Incrementar los conocimientos de los Apicultores del Departamento de Cabañas, sobre el manejo integrado de plagas que han surgido o se han agravado debido al cambio climático.', 'Identificar las claves para realizar un diagnóstico de afectación de plagas.\r\nOrientar sobre la elaboración de un plan de manejo integrado de plagas.\r\nFortalecer los conocimientos sobre las mejores prácticas y medidas preventivas en el manejo de plagas.', 'Ocho horas de capacitación.\r\nEntrega de material de apoyo a cada participante.\r\nRefrigerio para cada participante.\r\nDiploma de participación a los asistentes en la capacitación.\r\nEntregar informe de la capacitación.', 'UNICAES-Ilobasco', '2016-06-11', '2016-06-04', '08:00:00', '16:00:00', '', 'Finalizada', 28, 1, '', NULL, '2016-06-01 23:17:47', '2016-06-13 19:47:26');
