INSERT INTO `empresas` (`id`, `categoria`, `nombre`, `descripcion`, `municipio_id`, `direccion`, `nit`, `registro_iva`, `constitucion`, `clasificacion`, `sector_economico`, `actividad`, `deleted_at`, `created_at`, `updated_at`) VALUES
(4, 'Empresa', 'KIBUTZ CAFETERÍA', 'Empresa creada como iniciativa de ex estudiantes de la Escuela de Alimentos para comercializar embutidos y otros alimentos en Cojutepeque y zonas aledañas.', 56, 'Av. Santa Ana, Plaza Centro, 2do. Nivel.', '0710-040190-103-5', '', 'Persona Juridica', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Servicios de alimentación a domicilio y en local; elaboración de embutidos.', NULL, '2014-08-29 05:02:16', '2014-09-05 01:38:06'),
(5, 'Empresa', 'Guazapa Tours, de R.L.', 'Guazapa Tours, de R.L. es una cooperativa compuesta por personas de la Comunidad Sitio El Zapotal en el municipio de Suchitoto, Cuscatlán. La actividad principal de la cooperativa es ofrecer servicios de guías turísticos hacia el Cerro Guazapa por una ruta que han trabajado durante los últimos años. Los turistas son en su mayoría extranjeros que visitan Suchitoto, miembros de delegaciones de voluntarios que trabajan en la zona, estudiantes interesados en la historia reciente del país, entre otros.', 69, 'Carretera Suchitoto a Aguilares Km. 7, Comunidad Sitio El Zapotal.', '0715-100212-101-1', '', 'Persona Juridica', 'Emprendedor', 'Turismo', 'Servicios turísticos: tours guiados al cerro Guazapa.', NULL, '2014-08-29 21:08:32', '2014-09-20 23:16:40'),
(9, 'Empresa', 'Panadería Rikopán', 'Rikopán es una panadería ubicada en la ciudad de Sensuntepeque que está en el mercado desde hace nueve años. Actualmente cuenta con diecisiete empleados entre operarios y  personal de ventas, ya que la administración está a cargo del empresario. La panadería posee tres paneles repartidores con los que cubre diferentes rutas en la ciudad de Sensuntepeque y municipios aledaños, además de dos salas de ventas donde se vende el pan al menudeo. El proyecto del empresario es expandirse a otros municipios e incluir la oferta de desayunos en las salas de venta, para lo cual, según sus estimaciones cuenta con capacidad instalada suficiente para incrementar su producción y poder cubrir otros mercados.\r\n\r\nLa empresa ha mostrado un continuo crecimiento desde hace tres años. Ello le ha traído el reto de planificar su desarrollo y consolidar así su proceso de crecimiento.', 19, '3a. Calle Oriente, Barrio Los Remedios # 5.', '0906-160473-102-1', '148953-8', 'Persona Juridica', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Panadería', NULL, '2014-09-02 23:11:29', '2015-06-15 20:42:45'),
(10, 'Individual', 'Maria Hayde Hernández Delgado', '', 17, 'Cantón San Jose', '0708-051160-101-0', '', 'Informal Natural', 'Emprendedor', 'Agroindustrias Alimentaria', 'Agricultura', NULL, '2014-09-03 03:07:43', '2014-09-05 01:38:26'),
(12, 'Empresa', 'Arte en cuero', 'Arte en cuero es una empresa que se dedica a la elaboración de calzado en el municipio de Cojutepeque. \r\nDesde el año 2011 se formalizó como empresa y actualmente le vende al gobierno con el programa de paquetes escolares.', 56, 'Final colonia martinez, calle la ronda #B San José #20', '0702-200365-102-8', '211726-6', 'Persona Juridica', 'Micro-empresa', 'Calzado', 'Fabricación de calzado.', NULL, '2014-09-03 20:27:21', '2014-09-05 01:26:32'),
(13, 'Cooperativa', 'ACAACI de R.L', 'Cooperativa dedicada a la elaboración y comercialización de artesanías desde 1991 en el municipio de Ilobasco', 16, 'Av. Carlos Bonilla N° 34, Barrio El Calvario', '0903-271191-101-6', '737550', 'Persona Juridica', 'Micro-empresa', 'Artesanias', 'Artesanías', NULL, '2014-09-04 22:42:58', '2014-09-05 01:30:06'),
(14, 'Empresa', 'TECNOCOMPU', 'TECNOCOMPU es una empresa que se dedicada a la venta de accesorios y dispositivos electrónicos, además de la prestación de servicios profesionales a través de clases de computación y préstamo de equipo de cómputo, ubicada en 1era Calle Ote. Frente a parque central 2° Nivel en Sensuntepeque del departamento de Cabañas.\r\nEl propietario de esta empresa que está presente en el mercado desde hace más de dos años, ha considerado cambiar por completo el concepto de su empresa pensando en hacer una empresa más exclusiva en su imagen y diseños de sus líneas de productos. Para lo cual vamos a iniciar cambiando por completo la imagen corporativa y la presentación de la sala de ventas.', 19, '1° Calle Ote Frente a parque Central 2° nivel', '0906-080784-103-9', '213949-0', 'Persona Juridica', 'Micro-empresa', 'Tecnología de Información y Comunicación', 'Venta de Accesorios de Computadoras y Celulares', NULL, '2014-09-04 22:55:34', '2014-09-24 20:57:43'),
(15, 'Empresa', 'Distribuidora San Luis', 'Distribuidora San Luis es una empresa que desde el año 2006 se dedica a la elaboración de productos de limpieza de todo tipo y que distribuyen en el municipio de Cojutepeque y sus alrededores.\r\nCon el propósito de ampliar su mercado y comercializar sus productos dentro de otras zonas surge la necesidad de crear una imagen presentable y acorde al segmento de clientes que se atiende y al mismo tiempo tener herramientas publicitarias acorde al tipo de empresa y con las que puedan dar a conocer la variedad de productos que fabrica.\r\nDentro de los productos que se elaboran se encuentran: desinfectante, lejía, jabón líquido para manos, detergente en polvo, desengrasante, jabón para lavandería, suavizante de telas, limpiavidrios, silicones y shampoo para carro.', 56, '1ra calle oriente y avenida los héroes', '0614-070159-103-6', '184207-9', 'Persona Natural', 'Micro-empresa', 'Química Farmaceutica', 'Productos de limpieza', NULL, '2014-09-04 22:56:47', '2014-10-31 23:02:47'),
(16, 'Empresa', 'Brisas del Volcán de R.L', 'Cooperativa dedicada a la producción de hortalizas especificamente el tomate y chile dulce desde el año 2012 se constituyó formalmente y se encuentra ubicada en el municipio de Tecoluca', 208, 'Col. San Francisco Parque Ecoturístico Tehuacán', '1011-270412-101-7', '226022-0', 'Persona Juridica', 'Emprendedor', 'Agroindustrias Alimentaria', 'Agroindustria. Producción de hortalizas', NULL, '2014-09-04 22:59:51', '2014-09-05 01:34:28'),
(17, 'Cooperativa', 'Asociación Cooperativa de Producción Agropecuaria Huiscoyol/ ACPAHUIS DE RL', 'La cooperativa se dedica a las actividades de cultivo y venta de Hortalizas y frutas.', 19, 'La Trinidad Caserío Huiscoyol', '0906-230712-101-6', '', 'Persona Juridica', 'Grupo Asociativo Empresas', 'Agroindustrias Alimentaria', 'Agroindustria Alimentaria', NULL, '2014-09-04 23:01:48', '2014-09-05 01:31:15'),
(18, 'Empresa', 'Producción de miel de avejas', 'La empresa se dedica a la producción de miel', 208, 'Los achotes caserío san andrés', '', '', 'Informal Natural', 'Emprendedor', 'Agroindustrias Alimentaria', 'Agroindustria', NULL, '2014-09-04 23:03:11', '2014-09-05 01:39:34'),
(19, 'Grupo', 'Cuatro Elementos.', 'Cuatro elementos nació en el año 2012 como una iniciativa de jóvenes emprendedoras, la cual se dedica a la elaboración y comercialización de productos artesanales con diseños exclusivos. La empresa se encuentra ubicada en Ilobasco, Cabañas y está conformada por dos mujeres con la iniciativa de ofrecer al mercado local productos diferentes e innovadores.  \r\n\r\nEn función de diversificar sus productos y competir en el mercado de las artesanías dentro del municipio, se pretende elaborar y diseñar joyería artesanal en barro y ofrecer al público, diseños diferentes partiendo de las matrices respectivas y que les permita llegar al mercado nacional e internacional.\r\n', 16, 'Av. Carlos Bonilla B° El Calvario, Pasaje La Fuente #1.', '', '', 'Informal Natural', 'Emprendedor', 'Artesanias', 'Artesanías en barro.', NULL, '2014-09-04 23:13:11', '2015-08-08 23:04:03'),
