(33, 'Empresa', 'Taller Ketsalí', 'KETSALÍ Joyería Artesanal es una micro empresa propiedad de Don Boris Agid Abrego, la cual ofrece joyería elaborada en base a morro con diseños innovadores y atractivos para clientes exclusivos a nivel nacional y a nivel internacional.\r\nLa empresa está ubicada en Guacotecti, Cabañas, la cual inició labores en el año 2008, comenzando con una idea y un prototipo del producto, que durante estos años se ha está mejorando y desarrollando hasta obtener diseños diferentes y productos innovadores.', 15, 'Lotificación Brisas de San Fidel. Canton bañadero', '0906-251059-002-5', '86880-9', 'Persona Natural', 'Micro-empresa', 'Artesanias', 'Artesanías de morro', NULL, '2014-09-05 02:06:03', '2015-05-29 22:52:16'),
