(38, 'Empresa', 'Confecciones las 3 Rosas', 'Confecciones las Tres Rosas es una empresa que hace más de un año ha emprendido la idea de negocio en base a los conocimientos de las dos empresarias que lo dirigen y al deseo de ofrecer productos diferentes dentro del municipio de Suchitoto y sus alrededores.\r\n\r\nActualmente, dentro de los productos que ofrecen se encuentran: vestuario artístico, prendas casuales, accesorios, bordados a mano y artículos para el hogar.\r\nCon la necesidad de contar con un plan de negocios que le permita obtener una visión clara de seguimiento de las actividades a desarrollar se plantea la elaboración del servicio de asistencia técnica para cumplir con los objetivos propuestos.\r\n', 69, 'Barrio Concepción #36', '', '', 'Persona Natural', 'Subsistencia', 'Textiles y Confección', 'Confecciones y teñido con añil.', NULL, '2014-09-05 02:24:42', '2014-11-01 02:20:58'),
