(51, 'Empresa', 'Industrias JM/ José Manuel González González', 'Empresa dedicada a la confección de calzado para niños mujeres y caballeros, desde hace 15 años, que ha logrado posicionarse dentro del mercado de Cojutepeque y municipios aledaños, ofreciendo calzado de calidad y a un precio accesible, Actualmente el propietario Don Manuel González desea introducirse a mercados más formales, por lo que contar con una marca e imagen comercial es indispensable para que sus productos puedan cumplir con las exigencias de los clientes.', 56, 'Colonia Divina Providencia, pasaje Las Amapolas #162, Cojutepeque, Cuscatlán', '0708-270472-101-5', '211594-3', 'Persona Natural', 'Micro-empresa', 'Calzado', 'Elaboración de calzado', NULL, '2014-09-05 03:54:33', '2015-08-08 21:44:42'),
