(57, 'Empresa', 'SERICOSTUR de R.L', 'SERICOSTUR es una asociación constituida por un grupo de costureras del municipio de El Rosario, departamento de Cuscatlán. El grupo se formó para atender la demanda generada por el programa de Uniformes Escolares impulsado por el gobierno. Inicialmente se agruparon a más de 20 costureras del municipio, quienes apoyadas por la Alcaldía se instalaron en la Casa de la Cultura e iniciaron la producción de uniformes para las escuelas del pueblo. El grupo luego se fue consolidando hasta conformar una asociación cooperativa inscrita en el INSAFOCOOP. Actualmente cuenta con 16 socias, las cuales se turnan para trabajar en el taller recientemente instalado en un espacio brindado por la Alcaldía Municipal. PRODEMOR apoyó con la compra de máquinas y materia prima para fortalecer a la cooperativa; por lo que actualmente es necesario organizar el proceso productivo para hacerlas más eficientes.', 58, 'Bo El Centro. Contiguo a Alcaldía Municipal.', '0704-151111-101-7', '219644-5', 'Persona Juridica', 'Micro-empresa', 'Textiles y Confección', 'Fabricación de prendas de vestir.', NULL, '2014-09-05 04:16:12', '2015-09-23 04:22:20'),
