(60, 'Empresa', 'PRODISMAX', 'PRODISMAX, es una empresa que se dedica a la producción de bebidas Horchata, Atol de Maíz, Cebada y chocolate, esta empresa esta ubica en la ciudad de San Vicente, el empresario tienen una visión empresarial muy amplia para la empresa.\r\n\r\nActualmente estos productos están bien posicionados en el mercado local y se está buscando posicionarlos en el mercado nacional para lo cual el empresario desea fortalecer sus producto manteniendo el registro sanitario activo en cada uno de ellos, lo que le permite generar más confianza y credibilidad en los productos que comercializa.\r\n', 203, 'canton las animas, caserío los lopez', '1008-181168-101-4', '179970-8', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Venta de bebidas', NULL, '2014-09-05 04:30:44', '2015-10-02 22:32:32'),
(61, 'Empresa', 'Casa de la Abuela', 'CASA DE LA ABUELA, inicia sus operaciones un domingo de ramos de la semana santa del año 2008, nace con la idea de abrir una ventana a los artesanos que no tienen donde exponer sus piezas y/o productos a la venta para turistas nacionales e internacionales, conforme el tiempo ha pasado, Casa de la Abuela se ha vuelto una concepto que acoge servicio de café y servicios turísticos, la tienda de artesanías denominada GiffShop, es una de las tiendas más grandes en Suchitoto, buscando fortalecer el buen servicio en la tienda, es necesario trabajar una asistencia técnica que fortalezca la distribución de mobiliario y productos que se tienen en Casa de la Abuela.\r\n', 69, '1a Ave. Norte y 2a Calle Oriente Barrio el centro', '0614-160976-104-5', '222453-1', 'Persona Natural', 'Micro-empresa', 'Artesanias', 'Turismo\r\nAgroindustria\r\nVenta de artesanias', NULL, '2014-09-05 04:37:39', '2014-10-02 03:40:24'),
