(64, 'Empresa', 'Negocios Dalvin', 'La propietaria de este negocio es una Mujer empresaria, que ha tenido experiencia en el área comercial, ella trae una trayectoria comercial que viene desde sus padres, ha logrado contactos comerciales estratégicos con el país de EEUU, esta experiencia le permitió decidir establecer una tienda con un concepto diferente en ROPA Americana para todos los gustos y preferencias, en esta tienda cuenta con Ropa de Primera Calidad, zapatos, Carteras, accesorios, ropa para niño entre otros productos de utilidad en el hogar.\r\n\r\nEntre los proyecto a futuro de la empresaria, es lograr que su tienda se convierta en un almacén reconocido donde se pueda vender productos de marcas famosos a precios accesibles del mercado, este crecimiento le permite visualizarse a futuro con diversas tiendas ubicadas en la zona.', 19, '2da Ave. sur, Bo. Santa Barbara #77', '0902-180574-101-5', '225883-1', 'Persona Natural', 'Micro-empresa', 'Otros', 'Comercio, venta de prendas de vestir', NULL, '2014-09-05 04:59:08', '2014-10-03 04:04:16'),
