(67, 'Empresa', 'Red Juvenil Artesanal', 'La RED Juvenil Empresarial nace por iniciativa de jóvenes graduados de la casa MOJE en la fabricación de artesanías en barro, textiles y metales. Conformando una cooperativa (ACOPAREN) en el año 2013 para buscar los apoyos de programas como los que ofrece PRODEMOR, a la fecha se trabaja con diferentes clientes de la zona y del interior del país con artesanía exclusiva, ademas es una empresa que siempre esta buscando la innovación y calidad de sus productos.\r\nEsta ubicada en Final 4ta av. norte, barrio Sn Miguel #5 Parcela buenos aires, Ilobasco Cabañas.', 16, 'Bo Los desamparados, Moje casa Art.', '0903-121013-102-2', '', 'Persona Juridica', 'Subsistencia', 'Artesanias', 'Artesanías en arcilla.', NULL, '2014-09-05 20:46:53', '2015-09-14 22:14:11'),
(68, 'Empresa', 'El Artesano', 'Taller de Cerámica El Artesano, es un taller de artesanías en barro ubicado en la ciudad de Ilobasco, Departamento de Cabañas, actualmente tiene 8 años de funcionamiento a partir del año 2005, la idea del taller surge a través del deseo de mejorar el nivel de vida de sus propietarios, generar empleos en la zona y sobre todo continuar desarrollando orgullosamente la representación de nuestra gente salvadoreña.\r\n El Taller se caracteriza por sus diseños originales en cuanto a máscaras de antepasados y piezas de decoración, además algunos diseños de adorno para pared, siendo estas sus especialidades las cuales han permitido lograr colocarse en el mercado nacional.\r\nLa demanda y el gusto por este tipo de artesanía es lo que ha permitido al taller requerir la ampliación de diseños y tecnificar el arte que hasta este momento llevan practicando.\r\n', 16, 'Cantón llanitos caserío centro.', '', '', 'Persona Natural', 'Subsistencia', 'Artesanias', 'Artesanías en barro.', NULL, '2014-09-05 20:51:28', '2014-12-12 21:33:11'),
