(73, 'Individual', 'Cristhians Lourdes Mejía Sanches.', 'Lourdes Mejía se dedica a la elaboración de espumillas de turrón en diferentes presentaciones conforme al mercado que se esta atendiendo; una microempresa que nace en Cojutepeque y que su principal mercado lo tiene en San Salvador y que esta siendo liderada por su propietaria. Actualmente se está trabajando con la mirada puesta en la expansión de la empresa y la distinción de sus productos. ', 56, 'Col. Fatima Av. Los Dinámicos casa # 10', '', '', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Espumillas y Comida.', NULL, '2014-09-05 21:25:14', '2015-07-10 22:34:20'),
