(79, 'Empresa', 'Santa Barbara Joyeros', 'Santa Barbara Joyeros es una empresa familiar fundada por Walte Joya en los años 80, dedicada a la fabricación de piezas de joyeria en oro y plata asi como tambien a la compra y venta de estos materiales preciosos. Hoy en dia se quiere competir con otras empresas emergentes de la industria y por lo tanto se hace necesario hacer un cambio significativo en la imagen de esta para generar una nueva propuesta en el servicio que se presta. La empresa esta ubicada en Av. Cabañas #13 Bo. Santa Barbara Sensuntepeque Cabañas.', 19, 'Bo Santa Barbara Av Cabañas #13', '0906-281259-002-2', '75943-0', 'Persona Natural', 'Micro-empresa', 'Otros', 'Joyería en oro y plata', NULL, '2014-09-05 21:55:54', '2014-09-20 23:23:42'),
