(83, 'Empresa', 'Rancho la Perla', 'Rancho La Perla esta ubicado en Cantón Rojas, Caserío La Perla en el municipio de Sensuntepeque departamento de Cabañas, es una micro-empresa que se dedica a la producción de leche y cria de ganado para la venta, de carne.\r\nLa empresa esta preparando un proyecto de cria de pelibuey para la producción de carne para la producción de embutidos, ademas de establecer en el futuro una planta de producción carnica en la empresa.', 19, 'Cantón rojas, caserío la perla.', '0902-050455-001-5', '', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Ganadería, leche y abejas.', NULL, '2014-09-05 22:23:32', '2014-11-13 02:04:00'),
