(88, 'Empresa', 'Clínica Daniel', 'Clinica Daniel es una microempresa que nacio hace dos años en la ciudad de Sensuntepeque, dedicandose a la elaboración de protesis y plantillas ortopédicas para corregir malformaciones en los huesos. Esta ubicada en 4° Calle Ote. #46 bo. Santa Barbara, Col. California.', 19, '4ta Calle Ote #46 Bo Santa Barbara Col. California', '', '', 'Persona Natural', 'Subsistencia', 'Otros', 'Clínica  de asistencia médica', NULL, '2014-09-06 01:14:17', '2014-10-17 03:09:43'),
(89, 'Empresa', 'ARTILOBASQUENSE de R.L.', 'ARTILOBASQUENSE, DE R.L es una asociación cooperativa de artesanos de Ilobasco, dedicada a la producción y comercialización de productos artesanales exclusivos hechos en barro. Los productos principales de la cooperativa son: miniatura hecha barro, línea de bisutería hecha en barro, piezas decorativas elaboradas con diversas técnicas, entre otros.\r\n\r\nARTILOBASQUENSE DE R.L. está liderando además, a un grupo asociativo de artesanos de Ilobasco que se ha conformado con el objetivo de apoyar y fomentar el desarrollo del sector. El grupo está conformado por tres cooperativas ADACI, DE R.L; ACOPAREN, DE R.L. y ARTEILOBASQUENSE. Su tarea primordial es estar a la vanguardia en los diseños de artesanías y ofrecer productos innovadores y de calidad a sus clientes tanto a nivel local como internacional. Es por ello, que se ven en la necesidad de contar con un plan de negocio que les permita proyectar su visión empresarial y buscar apoyo con instituciones donantes para ser más competitivos en el mercado.', 16, 'Av Carlos Bonilla #17 Centro Cerámico de Ilobasco', '0903-031013-909-7', '231215-2', 'Persona Juridica', 'Subsistencia', 'Artesanias', 'Productos artesanales.', NULL, '2014-09-06 01:16:20', '2015-09-12 19:59:14'),
