(91, 'Empresa', 'UNIKE ARTESANIAS', 'UNIKE Artesanias es una empresa dedicada a la producción de artesanías en barro, ubicada en Bo. La Cruz a 2 cuadras del Hospital Nacional de Ilobasco en el departamento de cabañas.\r\nLa propietaria de esta empresa que está presente en el mercado desde hace diez años, ha considerado cambiar por completo el concepto de su empresa pensando en hacer una empresa más exclusiva en su imagen y diseños de sus líneas de productos. Para lo cual vamos a iniciar cambiando por completo la imagen corporativa de esta y sus productos.\r\n', 16, 'Bo La Cruz 2 cuadras del hospital nacional de Ilobasco #24', '', '', 'Persona Natural', 'Subsistencia', 'Artesanias', 'Artesanías en arcilla', NULL, '2014-09-06 01:36:32', '2015-08-25 02:16:52'),
