(100, 'Cooperativa', 'BIOLACT de R.L.', 'La idea nación en el año 2000 como alternativa para los pequeños y pequeñas productores y productoras de ganado del Bajo lempa de Tecoluca, de alguna manera organizados y atendidos por la Fundación CORDES. En el 2004, se constituyó como Asociación Cooperativa de producción agroindustrial, Aprovisionamiento y Comercialización de Productos Lácteos de Ganaderos del Bajo Lempa BIOLACT de R.L., con 42 socios de los cuales solo 5 eran mujeres. Inicialmente se dedicó a la Producción de quesos gourmet de corte europeo. \r\nA partir de enero 2013 Se inició el proceso de coordinación con Ciudad Mujer Usulután en donde se identificaron las cooperativas ganaderas que serían parte del programa presidencial vaso de leche para beneficiar y contribuir a la autonomía económica de las mujeres socias de las cooperativas ganaderas de Usulután y para el caso Tecoluca.\r\nBIOLACT de R.L fue seleccionada para el procesamiento, es decir para la pasteurización de la leche,  por la experiencia, infraestructura y equipo con el que ya contaba. La empresa está ubicada en Cantón San Ramón Grital Tecoluca San Vicente, en las instalaciones del Complejo de la Solidaridad de CORDES.\r\n', 208, 'Cantón San Ramón Grital.', '1011-250604-101-6', '163001-5', 'Persona Juridica', 'Subsistencia', 'Agroindustrias Alimentaria', 'Leche y queso fresco.', NULL, '2014-09-06 02:56:10', '2014-09-25 23:48:02'),
(101, 'Individual', 'Carlos Lovato Mejía', 'El Sr. Carlos Lovato es un agricultor que se dedica al cultivo de frutales en la zona de la cuenca del Lago de Ilopango. Entre los cultivos más importantes están el Mango Panadés, Aguacate Beneke, Plátano, Mandarina, Naranja, Cacao, Limón, entre otros.', 56, 'La Palma, Caserío Los Marroquines', '0702-041148-101-4', '', 'Persona Natural', 'Subsistencia', 'Otros', 'Cultivo de frutales', NULL, '2014-09-08 20:29:29', '2014-09-08 20:29:29'),
