(114, 'Cooperativa', 'ACOPAYAMA de R.L', 'Acopayama de RL, es una cooperativa que pertenece a la zona de El Carmen Cuscatlán, esta constituida por 24 socios pertenecientes a la misma comunidad, el objetivo principal de la cooperativa es contribuir a sus socios en la mejora de la calidad de sus vidas, permitiendo que ellos cuenten con un trabajo fijo y formal cerca de sus casas y sus familias. Actualmente ellos se dedican a la confección y diseño de prendas de vestir para caballeros, damas y niños, contando con un taller completo y equipado para desarrollar sus actividades, ellos están actualmente incursionando en nuevos mercados y en obtener nuevos clientes, por lo que es considerado necesario fortalecer sus habilidades y contar con nuevos diseños en la parte de confección y patronaje, logrando contar con nuevas técnicas y diseños que les facilite el acceso a estos mercados y clientes.', 57, 'Cantón Candelaria.', '0703-080312-102-1', '220400-0', 'Persona Natural', 'Micro-empresa', 'Textiles y Confección', 'Textiles y artesanias', NULL, '2014-09-08 21:53:28', '2014-10-07 04:32:35'),
