(123, 'Grupo', 'Asociación de Mujeres La Nueva Esperanza de Ilobasco.', 'María Yanira Torres de Reyes, es la representante de la Asociación Comunal de Mujeres la Nueva Esperanza J/ de Ilobasco,   integrada por 10 mujeres activas que voluntariamente estan colaborando para lograr que la asociación sea exitosa.\r\nLa idea para este año es lograr capacitarse y organizarse para atender eventos de todo tipo entre los que estan: bodas, quince años, cumpleaños y capacitaciones, el servicio quiere ofrecerse de forma completa es decir desde el local, cristalería, decoración y el servicio de alimentación. Las señoras tienen experiencia en servicio de eventos para grupos de 50 personas y desean capacitarse para atender eventos con grupos grandes de personas, por lo que necesitan obtener el conocimiento en la elaboración de menú en cantidades grandes, por lo solicitan al CDMYPE una asistencia técnica que les permita ofrecer un buen servicio. paralelamente se estan capacitando en servicios de mesas y decoración de eventos por parte de la Universidad.', 16, 'Barrio El Calvario Av. Carlos Bonilla #6', '0903-291112-101-0', '', 'Persona Juridica', 'Subsistencia', 'Textiles y Confección', 'Corte y Confección, Ciber, Clases de computación.', NULL, '2014-09-09 22:24:04', '2015-08-18 21:45:46'),
(124, 'Empresa', 'María de Jesús Menjivar de Montalvo', 'María de Jesús Menjivar de Montalvo, es una empresaria de subsistencia/cuenta propia dedicada a la elaboración y venta de esencia verde, esencia coronada y un producto denominado por la empresaria como tratamiento compuesto, todos los productos son preparados a base de plantas medicinales naturales.\r\nActualmente está comercializando el producto en ferias desarrolladas en el agro mercado  de Suchitoto y  en comunidades aledañas al lugar de residencia de la empresaria. Doña Jesús cuenta con imagen comercial para sus productos, lo que le permite incrementar sus ventas y que los clientes identifiquen su marca. Una de las necesidades que la empresaria presenta  es la falta de capital de trabajo, para solventar esta necesidad esta en proceso de apoyo con otras instituciones, el requisito para ser beneficiada es obtener un plan de negocio que le permita visualizar sus estrategias de mercado y la proyección de las ventas. para ello la empresaria solicita al CDMYPE una asistencia técnica para la elaboración de plan del negocios.', 69, 'Platanares, caserío puerta Don Antonio', '', '', 'Persona Natural', 'Subsistencia', 'Química Farmaceutica', 'Esencia', NULL, '2014-09-09 22:30:07', '2015-08-13 20:21:46');
