(125, 'Grupo', 'María Albertina Arias de Flores', 'Doña Albetina representa al grupo de   emprendedoras los naranjos, conformado por diez mujeres activas dedicadas a la elaboración y venta de productos de limpieza y productos de tocador, los cuales venden en su comunidad y otros lugares como ferias en Sensuntepeque e  Ilobasco, sus principales productos son desinfectantes de 6 diferentes aromas, jabón liquido para ropa, jabón de tocador y lejía, ademas de shampoo de sabila y de romero. Esta actividad la realizan desde enero de 2013 cuando fueron capacitadas por otras instituciones en la elaboración de estos productos;  la capacitación fue corta y han logrado con la experiencia mejorar los productos pero desean capacitarse por medio de una asistencia técnica que les permita obtener productos de calidad para los clientes.\r\nAdemas desean conocer el proceso de dos productos nuevos, acondicionador y crema para el cabello ya que sus clientes actuales se los solicitan, para ello solicitan el apoyo del CMDYPE con una Asistencia Técnica, que les ayude a mejorar la calidad y crear dos nuevos productos, con el fin de generar confianza en los clientes y vender mas.', 16, 'Llanitos Caserio Quesera Arriba', '', '', 'Persona Natural', 'Subsistencia', 'Química Farmaceutica', 'Taller de Costura', NULL, '2014-09-09 22:35:48', '2015-08-28 23:00:35'),
