(129, 'Grupo', 'Grupo de Mujeres Emprendedoras', 'Doña Cándida Echeverria Martinez, es la líder de un grupo de 18 mujeres que decidieron iniciar su negocio en febrero de 2013 con la elaboración y venta de productos de limpieza, la producción la realizan en la casa de habitación de una de las empresarias, la venta del producto la hacen en el cantón el cerron y sus alrededores, las empresarias venden sus productos en la zona donde habitan, ademas en ferias que son invitadas por diferentes Instituciones y el CDMYPE, una de las limitantes que muestran es la necesidad de identificar el producto o mejorar su presentación ya que actualmente lo venden sin viñeta y en algunas ocasiones elaboran viñetas en un ciber, por esa razón solicitan el apoyo del Centro con una asistencia técnica en imagen comercial.', 17, 'Cantón San Sebastian, Caserío El Cerron ', '', '', 'Persona Natural', 'Subsistencia', 'Química Farmaceutica', 'Productos de limpieza', NULL, '2014-09-09 23:06:42', '2014-10-30 23:58:38'),
