(137, 'Empresa', 'ASCMUDES', 'La Asociación Comunitaria de Mujeres para el Desarrollo de Victoria, representada legalmente por doña María Bonilla Vda de Barrera, fue legalmente constituida en junio del año 2011, cuenta con 70 mujeres asociadas, de las cuales tiene un promedio de 15 mujeres activas, que se dedican a la confección de prendas de vestir, arreglos de prendas varias y su principal actividad la elaboración de Uniformes escolares, actualmente atienden 9 Centros escolares de la Zona de Victoria entre ellos el Instituto de ese municipio. Para aprovechar el numero de escuelas que atienden con uniformes escolares estan buscando capacitarse sobre la confección de uniformes deportivos, para ello solicitan al CDMYPE una asistencia técnica que les permita conocer sobre la elaboración de estas prendas, ya que cuentan con la maquinaria que se requiere para la confección de uniformes deportivos, logrando ampliar la atención a los estudiantes brindándoles nuevos servicios. ', 21, 'Calle principal Barrio San Antonio #34', '0908-280611-101-4', '217213-8', 'Persona Juridica', 'Subsistencia', 'Textiles y Confección', 'Venta de artesanías y prendas de vestir.', NULL, '2014-09-10 01:46:06', '2015-07-31 21:37:16'),
