(139, 'Individual', 'Adriana Dinora Rivas', 'Adriana es una empresaria que desde hace hace quince años se dedica a la confección de prendas de vestir incluyendo uniformes escolares, dada la necesidad de brindar un servicio de calidad a sus clientes, desea fortalecer sus conocimientos en la confección de ropa de vestir para damas, por esa razón solicita el apoyo de los servicios que ofrece el CDMYPE con el fin de adquirir y mejorar nuevos conocimientos en confección de diferentes prendas de vestir especialmente para damas.', 16, 'Llanitos Caserío Quesera Abajo', '0903-260573-102-5', '', 'Persona Natural', 'Subsistencia', 'Textiles y Confección', 'Costuras', NULL, '2014-09-10 02:04:11', '2015-07-16 03:12:52'),
