(155, 'Individual', 'Wendy Elisset Garcia Vasquez', 'Wendy es una empresaria residente en Barrio Concepción calle al Cementerio, municipio de Santa Clara departamento de San Vicente, desde el año 2009 se dedica a su negocio la elaboración y venta de arreglos florales Artificiales generalmente con tendencia a la celebración del día los difuntos, la empresaria desea diversificar sus productos para poder ofrecerlos en diferentes ocasiones festivas del año, con el objetivo de obtener ingresos para su familia y brindarle a los clientes un servicio completo, por esa razón  solicitan el apoyo de los servicios que ofrece el CDMYPE con el fin de adquirir y mejorar sus conocimientos en nuevos diseños de arreglos florales naturales y artificiales.', 205, 'Ba Concepción Calle al Cementerio', '', '', 'Persona Natural', 'Subsistencia', 'Artesanias', 'Arreglos florales artificiales', NULL, '2014-09-10 04:06:32', '2014-09-17 03:43:47'),
(156, 'Individual', 'Ana Cecibel Borjas Rosa', 'Cecibel es una empresaria de subsistencia/cuenta propia se dedica a la elaboración y venta de artículos varios bordados a mano en croché y listón. Entre los que podemos mencionar, bolsos, prendas de vestir, cosmetiqueras, muñecas, carteras y muchos más.\r\n\r\nDesde hace aproximadamente cinco años desarrolla esta actividad y ha participado en ferias que se desarrollan en Suchitoto además ha tenido la oportunidad de vender sus productos a turistas nacionales y extranjeros que visitan Suchitoto-\r\n', 69, 'Comunidad Milinoo Carretera a Suchitoto km 54', '', '', 'Persona Natural', 'Subsistencia', 'Artesanias', 'Bolsos, toallas, cosmetiqueros, meñecas, tarjetas etc', NULL, '2014-09-10 04:11:13', '2015-05-11 22:14:04'),
