(158, 'Empresa', 'UDP Mujeres Productoras de San Pedro Perulapan', ' Las integrantes de la UDP MUJERES PRODUCTORAS DE SAN PEDRO PERULAPAN, desde el año 2011 producen vinos artesanales de frutas: como Jamaica, esencia de frutas, uva, arroz y mandarina. En total son 5 productos que la asociación está tratando de impulsar y con ellos penetrar un mercado cada vez más amplio. De momento, las ventas de la asociación se limitan al departamento de Cuscatlán, en las comunidades y diferentes instituciones que compran sus productos. Una de las limitantes más importantes para ampliar el mercado es el no cumplimiento de las regulaciones legales y sanitarias. La asociación produce los vinos en recipientes plásticos(garrafones de agua) porque no cuentan con una planta de producción que contenga tanques de acero inoxidable de mucha más capacidad, en el avance de apoyo obtenido con CDMYPE se recomendó usar barriles de madera que ya mandaron a elaborar, la necesidad inmediata que presentan es diversificar sus productos y los sabores de vinos, para ello solicitan el apoyo del Centro una asistencia técnica.', 64, 'Calle a Tecoloco km 23 Cantón El Espino San Pedro Perulapan Cuscatlan', '0613-171213-101-1', '229523-0', 'Persona Juridica', 'Subsistencia', 'Agroindustrias Alimentaria', 'Vinos Artesanales frutales.', NULL, '2014-09-10 04:33:05', '2014-10-15 02:20:09'),
