(163, 'Individual', 'Ana María Rodriguez Cordova', 'Ana María es una empresaria residente en Oratorio Caserío El Transito, municipio de Ilobasco, departamento de Cabañas, la empresaria desea perfeccionar los conocimientos en la elaboración de miniaturas en barro especialmente tapaderas, el objetivo es diversificar sus productos agregando nuevos diseños a sus clientes, por esa razón  solicitan el apoyo de los servicios que ofrece el CDMYPE con el fin de adquirir y mejorar la calidad de sus productos.\r\n', 16, 'Oratorio, Caserío El Transito', '', '', 'Persona Natural', 'Subsistencia', 'Artesanias', 'Artesanías en barro', NULL, '2014-09-10 04:56:46', '2014-09-17 02:48:57'),
(164, 'Empresa', 'Multiactivos, S.A. de C.V.', 'Multiactivos, S.A. de C.V. es una empresa fundada en el año 2012, que se dedica a la renta de autos en todo El Salvador. La empresa cuenta desde sus inicios con su marca Multiautos en trámite de registro en el CNR. Con dicha marca se ha venido trabajando y ampliando el mercado en todo el país. Un segmento que se pretende explotar con más fuerza es el de salvadoreños en el exterior, sobre todo los residentes en los Estados Unidos.\r\n\r\nLa empresa cuenta con su sede en la ciudad de Cojutepque y entre sus servicios se incluye la entrega de vehículos en el aeropuerto y en cualquier ciudad del país que el cliente requiera. La presencia en la web, la realiza por medio de una página de fans en Facebook y sitio web, con las siguientes direcciones:\r\n\r\nFacebook:\r\nhttps://www.facebook.com/Renta-de-autos-El-Salvador-141526202687799/?fref=photo\r\n\r\nSitio web: http://www.multiautos.com.sv/\r\n', 16, 'Barrio El Calvario, Calle Bernardo Perdomo', '0614-180912-101-6', '219760-0', 'Persona Juridica', 'Pequeña Empresa', 'Turismo', 'Alquiler de Autos.', NULL, '2014-09-10 22:02:18', '2015-11-14 15:00:33'),
(165, 'Cooperativa', 'Asoc. de productores agrop. de San Pedro Perulapan de R.L', 'La asociación de productores agropecuarios de San Pedro Perulapán de R.L. está ubicada en Colonia San Miguel, Cantón el Rodeo, Municipio de San Pedro Perulapán, Departamento de Cuscatlan;  desde el 2015 está cooperativa de productores se han dedicado a la producción y comercialización de Papaya, Plátano y Maracuyá en el mercado local.', 64, 'Colonia San Miguel, Cantón El Rodeo.', '0710-240905-101-7', '206225-0', 'Persona Juridica', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Papaya , Plátano y Maracuyá.', NULL, '2014-09-11 01:43:37', '2014-09-11 03:31:08'),
(166, 'Cooperativa', 'Sociedad Cooperativa de Cafetaleros de Cuscatlan de R.L', 'Sociedad Cooperativa de Cafetaleros de Cuscatlán de R.L, nació el 14 de febrero de 1984; tiene actualmente 30 años de funcionar en el mercado cuscatleco, contando con la cantidad 120 socios activos dentro de la Cooperativa, entre sus actividades principales es recibir café de calidad de sus socios para posteriormente comercializarlo, cuenta con un área de producción en la cual producen café molido de calidad que es comercializad en la zona con empresas privadas y entes de gobierno, otras de sus actividades fuertes es el otorgamiento de créditos a sus socios y el servicio de ahorro', 56, '8a Calle Ote. #5 San Juan Fte Al Rastro Municipal', '0614-140284-006-0', '36101-1', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Café tostado', NULL, '2014-09-11 01:50:46', '2014-09-12 03:58:01'),
(167, 'Cooperativa', 'ACAASS de R.L.', 'El Centro de Desarrollo para la Micro y Pequeña Empresa CDMYPE-Ilobasco, se encuentra en el proceso de contratación de servicios de consultoría de la asistencia técnica denominada  "Plan de comunicación integral para posicionamiento de marca Don Vicente" para Cooperativa ACAASS de R.L dedicada al empacado de frijol de seda rojo y ocre. \r\nEn el presente año la Cooperativa logro introducir el producto a la cadena de supermercados Wal-mart, sin embargo hay poca rotación de estantería debido a que no se han realizado esfuerzos para posicionar la marca, es por ello que se deben realizar acciones agresivas para posicionarse en segmento de supermercados y a nivel local. La Cooperativa se encuentra ubicada en el municipio de San Sebastián, departamento de San Vicente y el Centro de Acopio de Granos Básicos en esta ubicada en km\r\n44/5 carretera panamericana, Cantón Iscanales Santo Domingo, departamento de San Vicente. ', 204, 'Calle Andres Molins y 1° avenida norte B° Guadalupe.', '1009-300374-001-8', '37847-0', 'Persona Juridica', 'Pequeña Empresa', 'Agroindustrias Alimentaria', 'Ahorro y crédito, Supermercado, centro de acopio de granos básicos y agroservicio.', NULL, '2014-09-12 00:34:40', '2015-11-26 05:56:33'),
(168, 'Cooperativa', 'ACOPAMDRE de R.L', 'La Asociación Cooperativa de Producción Agropecuaria y de Servicios Múltiples “Mujeres Dinámicas Rompiendo Esquemas” ACOPAMDRE, de R.L. es una asociación de mujeres residentes en el Cantón El Espino, municipio de San Pedro Perulapán, que desde el año 2010 se dedican a la elaboración de vinos derivados principalmente de Rosa de Jamaica, Arroz y Naranja. En temporadas altas, también incluyen otros sabores como Uva, Manzana y Mix de Frutas.\r\n\r\nEl  objetivo de la Asociación es contribuir a que las mujeres de la zona rural  tengan la capacidad de generar sus propios ingresos económicos, que les permita mejorar sus condiciones de vida, por medio del desarrollo de proyectos productivos.\r\n\r\nLa línea gráfica actual no se modifica desde hace cuatro años; ahora se ha explorado nuevos segmentos de mercado y se ha ampliado la oferta con nuevos productos, por lo que se ha decidido adaptar la presentación de los productos, haciéndolos más competitivos contra los productos similares que hay en el mercado.\r\n', 64, 'Carretera Panamericana Km 23, Cantón El Espinal.', '0710-081010-101-6', '2019603-9', 'Persona Juridica', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Vinos de rosa de jamaica, naranja y arroz', NULL, '2014-09-12 02:36:26', '2015-10-03 03:07:32'),
