(181, 'Cooperativa', 'Asoc. Coop. Juventud Rural del Bajo Lempa, de R.L', 'Juventud Rural, de R.L. es una asociación cooperativa, constituida en el año 2004 como una opción para emplear a los jóvenes de la zona del Bajo Lempa, al sur del departamento de San Vicente. La cooperativa maneja dos proyectos: la planta de elaboración de jugos de marañón y la planta de producción de filtros para agua. Actualmente, la cooperativa está realizando gestiones para financiar su crecimiento, por lo que ha considerado de importancia realizar un plan que le defina de forma clara el camino a seguir y los recursos necesarios para lograr dicho crecimiento.', 208, 'Polígono Solidadirad Cordes, Cantón San Ramón Grifal', '1011-120704-101-1', '205451-4', 'Persona Juridica', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Filtro de agua y jugo de marañon.', NULL, '2014-09-12 04:41:56', '2015-05-09 04:12:32'),
