(188, 'Empresa', 'Embutidos El Caulote', 'La Iniciativa Económica de Mujeres “Embutidos El Caulote” nace por la necesidad de fortalecer la incidencia de la mujer en la economía familiar. \r\n\r\nActualmente está conformada por un grupo de mujeres organizadas para poder cubrir las actividades que el desarrollo de su proyecto exige. Los cargos actuales son: Presidenta, quien funge como representante, Encargada de Producción, a cargo de las labores de elaboración de embutidos; y Encargada de Ventas, responsable de las labores comerciales. \r\n\r\nEl compromiso de las mujeres miembros de la iniciativa es un valor que se vive a diario, sobre todo ante la necesidad de crecer y generar su propio empleo y llevar un aporte económico a sus familias.\r\n\r\nLa visión de la iniciativa es convertirse en el corto plazo en una empresa sólida con potencial de crecimiento rápido, por medio de la satisfacción de la demanda y exigencia de los clientes con productos de alta calidad.', 69, 'Carretera a Suchitoto, Ex Escuela Taller de Oficios Tradicionales.', '', '', 'Persona Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Embutidos', NULL, '2014-09-13 02:18:05', '2015-08-17 22:24:04'),
(189, 'Empresa', 'Envasadora Geisser', 'Envasadora Geisser es una empresa administrada por el Sr. Ricardo Amaya desde el año 2009. Desde ese año los productos que la empresa ofrece al mercado de Sentuntepeque y municipios aledaños son: agua en garrafón, agua en bolsa y jugos; este último, es un producto que la empresa únicamente distribuye.\r\n\r\nLa envasadora cuenta con una marca (Geisser) y una imagen comercial que no modifica desde que el empresario adquirió el negocio. Actualmente, la competencia es más fuerte y la imagen de sus productos es más atractiva para los segmentos de mercado; por ello, la necesidad de actualizar su marca es de vital importancia para poder competir con las envasadoras que operan en la zona.', 19, 'Calle a Santa Lucia, Barrio Los Remedios', '0906-230563-001-0', '192529-3', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Envasado de agua purificada.', NULL, '2014-09-13 02:27:38', '2015-09-07 22:58:37'),
