(192, 'Empresa', 'Ceramicas Josselyn', 'Cerámicas Josselyn es un taller de artesanía dedicada a la elaboración de figuras utilitarias y decorativas en barro. El taller está ubicado en la ciudad de Ilobasco, y actualmente cuenta con tres empleados de forma temporal. Una característica sobresaliente de Cerámicas Josselyn es su constante búsqueda y preocupación por sacar al mercado diseños originales e innovadores. En los últimos años, el empresario ha identificado oportunidades para ampliar la gama de productos y explotar el mercado regional. \r\n\r\nActualmente Cerámicas Josselyn es parte del proyecto ARTEC.A. que impulsa Almacenes SIMAN con el apoyo de USAID. \r\n', 16, 'Barrio El Calvario, Av. Carlos Bonilla #75-B', '0903-090261-001-2', '17767-2', 'Persona Natural', 'Micro-empresa', 'Artesanias', 'Artesanías en barro.', NULL, '2014-09-13 02:46:15', '2015-10-03 20:32:07'),
