(212, 'Empresa', 'Mi sorbetio', 'Empresa natural de subsistencia dedicada a la elaboración de sorbetes artesanales elaborados con frutas naturales, cuenta con aproximadamente cinco años de existencia. Se cuenta con un empleado contratado de forma eventual,  los productos se comercializan de forma directa, sin embargo como parte de la estrategia de posicionamiento comercial se requiere una imagen empresarial que sea competitiva para acceder a nuevos mercados. La empresa se encuentra en Barrio San Juan, 29 Calle Oriente, casa nº 2  el municipio de Cojutepeque departamento de Cuscatlán. ', 56, 'Bo San Juan 2a Calle Oriente Casa #12', '', '', 'Persona Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Sorbete artesanal', NULL, '2014-09-17 01:20:46', '2014-09-22 21:51:26'),
