(218, 'Empresa', 'Cojute´s Travel', 'Cojute´s Travel es una agencia de viaje que durante más de 20 años ha  ofrecido servicios de boletos aéreos y paquetes turísticos a diferentes destinos del mundo a un segmento de mercado local. Sin embargo es necesario fortalecer las acciones publicitarias y de promoción para reforzar la imagen empresarial, fidelizar  clientes actuales y además llegar a otros segmentos de mercado; para lo cual se requiere llevar acabo estrategias de comunicación efectivas que puedan posicionar a la agencia en los diferentes mercados objetivos.  La agencia esta ubicada en Calle José Matías Delgado N° 17, municipio de Cojutepeque, departamento de Cuscatlán. ', 56, 'Calle José Matias Delgado N° 17', '', '', 'Persona Natural', 'Subsistencia', 'Turismo', 'Boletos Aéreos', NULL, '2014-09-17 02:32:02', '2015-04-23 02:31:17'),
