(220, 'Cooperativa', 'ACOMAP de R.L.', 'ACOMAP de R.L es una asociación de ahorro y crédito conformada por mujeres, con una segmentación de mercado femenino. Las líneas de crédito otorgadas son créditos agrícolas, empresariales y personales. La Cooperativa se constituyó en el año 2010 , cuenta con aproximado de 100 socias activas. Como parte de las estrategias de crecimiento, contarán con unas instalaciones mas accesible a los clientes, permitiendo un mejor servicio. Así mismo se llevará acabo un plan de posicionamiento empresarial, para lo cual se requiere herramientas afines. ', 69, 'Segunda Calle poniente, Barrio San José y 4ª A.V Norte, municipio de Suchitoto, en el departamento de Cuscatlán. ', '0715-090910-101-5', '211466-2', 'Persona Juridica', 'Micro-empresa', 'Otros', 'Cooperativa de ahorro y crédito', NULL, '2014-09-17 03:11:27', '2015-05-20 03:28:40'),
