(222, 'Empresa', 'Pajaro Flor', 'Pájaro Flor es una microempresa conformada por nueve mujeres, se dedican a la elaboración de prendas de vestir y accesorios teñidos en añil. Ha tenido participación en el mercado nacional y de manera indirecta en mercado internacional con la distribución de sus productos a través de almacenes de prestigio. Actualmente se busca desarrollar el mercado, para lo cual se requiere herramientas que contribuyan a la promoción de los productos y al posicionamiento de la empresa. El taller y sala de ventas Pajaro Flor se encuentra en 2a CAlle Pte. y 4 A.V Norte #8. Barrio San José, muncipio de Suchitoto, departamento de Cuscatlán.  ', 69, '2a Calle Pte y 4 Av. Norte B° San Jose #8', '', '', 'Persona Natural', 'Micro-empresa', 'Textiles y Confección', 'Servicios de costura y teñidos en añil', NULL, '2014-09-17 03:28:56', '2015-05-07 21:37:21'),
