(233, 'Cooperativa', 'Cooperativa Fuente de Vida de R.L', 'El CDMYPE Ilobasco desde hace tres años ha desarrollado diferentes acciones enfocadas al crecimiento empresarial de la Cooperativa Fuente de Vida de R.L representada por la Gerente General Ana Arely Jovel de Rivas. La Cooperativa inició sus actividades de servicios de crédito en el municipio de Sensuntepeque y sus alrededores en el año 2005. Actualmente cuenta con seis empleados y  una cartera de asociados/as de 478 entre hombres  y mujeres. Se ha trabajado en el desarrollo de servicios de la línea de ahorros, ya que solamente se contaba con la línea de créditos. Sin embargo no se cuenta con las herramientas adecuadas para llevar acabo la promoción y publicidad para el lanzamiento del nuevo servicio, además la empresa no cuenta con una imagen empresarial congruente. \r\nLa Cooperativa esta ubicada en 1a A.V norte Barrio San Antonio, municipio de Sensuntepeque, Cabañas. ', 19, '1° Av. Norte Bo San Antonio', '0906-040405-101-1', '178657-6', 'Persona Juridica', 'Subsistencia', 'Otros', 'Servicios financieros', NULL, '2014-09-17 21:03:29', '2015-09-01 03:43:06'),
