(237, 'Empresa', 'Distribuidora y Envasadora La Milagrosa', 'Empresa dedicada al envasado de agua en tres presentaciones, bolsa de 500ml, botella de 500ml y garrafones de 18.9lt. La empresa cuenta con siete empleados, dos de los cuales son vendedores. La capacidad instalada no está siendo utilizada al 100%, las presentaciones más vendibles es bolsa y garrafón, las cuales son distribuidos en su mayoría con clientes de los municipios de Ilobasco y sus alrededores. El producto tiene aproximadamente un año y medio de haber entrado al mercado y hace tres meses se abrió una sala de ventas en el centro de Ilobasco. La planta de producción se encuentra en Calle Principal Cantón Los Hoyos, Caserío Menjívar, Municipio de Ilobasco, departamento de Cabañas. ', 16, 'Calle Principal, Cantón Hoyos, Caserío Menjivar', '', '', 'Persona Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Agua Envasada', NULL, '2014-09-17 21:45:10', '2014-11-19 20:32:07'),
