(247, 'Empresa', 'Publicreat', 'Publicreat es una empresa dedicada a brindar soluciones en el campo textil y promocional e identificación institucional a las diferentes empresas, centros escolares, iglesias, organizaciones, entre otros, que operan en el departamento de Cabañas.\r\n\r\nLa empresa cuenta también con una tienda en la ciudad de Ilobasco donde se distribuyen sus productos, que se resumen en las siguientes líneas: Uniformes deportivos, uniformes institucionales y empresariales, artículos promocionales, entre otros.\r\n\r\nLa empresa trabaja con su marca Publicreat, y recientemente ha adquirido un pulpo para ofrecer en su portafolio de productos y servicios, la serigrafía textil. \r\n', 16, '1° Av. Norte #13, Barrio San Sabastián.', '', '', 'Persona Natural', 'Micro-empresa', 'Textiles y Confección', 'Camisas y uniformes deportivos.', NULL, '2014-09-17 23:09:41', '2015-09-17 03:27:54'),
