(257, 'Empresa', 'Embutidos la Española', 'Embutidos La Española, es una empresa 100% salvadoreña, dedicada a la elaboración de  una gran variedad de embutidos como butifarras, chorizos, salchichón tradicional, salchichón alcaparra, y sus productos bases y éxitos como Salchichón Jalapeño y Chorizo de res, elaborados con la mejor calidad y sabor, característico de su pueblo.\r\n\r\nEmbutidos La Española, está creciendo en cuanto a la variedad de sus productos, actualmente están produciendo una serie de productos como: La Costilla de Cerdo ahumado, pierna de cerdo ahumado y tocino ahumado, productos exquisito elaborado con los mejores ingredientes y bajo los mejores estándares de calidad e higiene \r\n\r\nEmbutidos La Española, está atendiendo mercados altamente exigentes como supermercados y establecimientos de comida rápida muy reconocidos; la empresaria ha hecho posible gracias a sus esfuerzos la apertura de una nueva sucursal ubicada en San Salvador en un prestigioso Centro Comercial de la capital, por lo que se considera importante contar con el diseño de estrategias de posicionamiento para la sala de venta Embutidos La Española, que permita lograr cumplir con los objetivos establecidos.\r\n', 56, 'Calle José Matias Delgado #13', '0702-110562-001-6', '178760-8', 'Persona Natural', 'Pequeña Empresa', 'Agroindustrias Alimentaria', 'Butifarras, chorizos etc.', NULL, '2014-09-18 22:00:16', '2015-07-08 02:42:05'),
