(264, 'Empresa', 'Taller de Artesanías Buen Gusto', 'Taller de Cerámica El Buen Gusto, es un taller de artesanías en barro ubicado en la ciudad de Ilobasco, Departamento de Cabañas, actualmente tiene 5 años de funcionamiento a partir del año 2008, la idea del taller surge a través del deseo de mejorar el nivel de vida de sus propietarios, generar empleos en la zona y sobre todo continuar desarrollando orgullosamente la representación de nuestra gente salvadoreña.\r\n\r\n El Taller se caracteriza por sus diseños originales en cuanto a figuras humanas y de animales, además algunos diseños de adorno para pared, siendo estas sus especialidades las cuales han permitido lograr colocarse en el mercado nacional.\r\n\r\nLa demanda y el gusto por este tipo de artesanía es lo que ha permitido al taller requerir la ampliación de diseños y tecnificar el arte que hasta este momento llevan practicando.\r\n', 16, 'Av. Carlos Bonilla, Bo El Calvario, Casa #23.', '', '', 'Persona Natural', 'Micro-empresa', 'Artesanias', 'Artesanías decorativas.', NULL, '2014-09-18 23:03:18', '2014-10-07 04:29:46'),
(265, 'Empresa', 'Artesanías Ciudad Vieja', 'El empresario es un artesano de la Ciudad de Suchitoto, se dedica a la elaboración de artesanías en Ninfa, entre sus especialidades están:\r\nBolsas,carteras,calzado, adornos para el hogar,bisutería, productos utilitarios, entre otros.\r\n\r\nEl Artesano, es un empresario visionario que desea promover sus artesanías a nivel local, nacional y regional, por lo que busca a través de esta AT contar con herramientas de apoyo a su gestión de comercialización y posicionamiento de marca con el diseño e implementarlos para promover sus productos.\r\n', 69, 'Bo La Cruz, Av José María Peña Fernandez, Casa #19', '', '', 'Persona Natural', 'Subsistencia', 'Artesanias', 'Bisutería, artesanías, mantas y reciclaje', NULL, '2014-09-18 23:14:28', '2015-05-30 22:44:39'),
