(275, 'Cooperativa', 'ACOPAIME de R.L', 'Doña Herminia Rivera es la representante Legal de la Asociación cooperativa de producción Agropecuaria e industrial "mujeres exitosas" de responsabilidad limitada, que se abrevia "ACOPAIME DE R.L." ubicada en el municipio de San Rafael Cedros, departamento de Cuscatlan, las socias de la cooperativa se dedican a la elaboración de chorizos de diferentes sabores, butifarras, longanizas y otros. La cooperativa fue legalmente establecida el 04 de marzo del 2014, a la fecha producen 4 veces por mes generando ventas de $ 150.00 dolares por producción. Las señoras se ven en la necesidad de incrementar la visibilidad de sus productos con el fin de incrementar las ventas, por esa razón solicitan el apoyo del CDMYPE con una asistencia técnica, en imagen diseño de página web.', 65, 'El Espinal.', '0511-130314-101-9', '', 'Persona Juridica', 'Subsistencia', 'Agroindustrias Alimentaria', 'Chorizos, Longaniza y butifarra.', NULL, '2014-09-19 22:33:04', '2015-09-14 21:53:01'),
(276, 'Individual', 'Ana Julia Echeverria Castillo', 'Doña Ana Julia Echeverria es la representante de un grupo de mujeres de Sensuntepeque; el grupo busca fortalecer sus negocios de comida a la vista y apoyar iniciativas en el mismo rubro.  Partiendo de las necesidades del mercado es indispensable competir con  menús de platillos con ingredientes naturales y saludables. Se pretende dirigir los productos, el grupo de mujeres considera que el contar con una oportunidad de este tipo permitirá generar flujos de ingresos que les permita manejar efectivamente sus créditos y acceder a los mismos, ya que actualmente están siendo apoyadas por Cooperativa Fuente de Vidas. La Iniciativa se encuentra en Bº El Calvario  5ª A.V Sur  Nº 34-B municipio de Sensuntepeque, departamento de Cabañas. ', 19, 'bo El Calvario 5° Av Sur #34-B', '', '', 'Persona Natural', 'Subsistencia', 'Agroindustrias Alimentaria', '.', NULL, '2014-09-19 22:41:54', '2014-09-30 21:54:31'),
(277, 'Individual', 'María Florencia Gonzales de Gonzales', 'María Florencia es lider de un grupo de diez mujeres dedicadas a la deshidratación de frutas, ubicadas en Cantón San Antonio, municipio de El Carmen, departamento de Cuscatlan, actualmente cuentan con equipo necesario para la deshidrataación de la fruta.\r\nEl grupo de mujeres desarrolla esta actividad desde febrero de este año, de acuerdo a lo expresado por la representante del grupo, se ven en la necesidad de perfeccionar el proceso y la técnica de deshidratacion de frutas ya que han recibido algunas capacitaciones pero no han sido suficientes, por esa razon solicitan el apoyo del CDMYPE para que se brinde una asistencia tecnica en proceso de elaboracion de fruta deshidratada.', 57, 'Cantón San Antonio.', '', '', 'Persona Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Frutas Deshidratadas.', NULL, '2014-09-19 22:58:15', '2014-10-03 03:48:13'),
(278, 'Cooperativa', 'ADESCOSANJ', 'ADESCOSANJ se dedican a la producción de concentrado y venta de productos veterinarios, otro de sus proyectos es desarrollar un área de negocio dedicada a la elaboración de calzado, en donde participan un aproximado de catorce jóvenes emprendedores. La asociación emplea a dos personas a tiempo completo y cuenta con una oficina en Caserío Caragual, cantón San Pedro, municipio de Victoria, departamento de Cabañas. ', 21, 'Caserío El Caragual, San Pedro', '0903-090905-101-7', '220338-2', 'Persona Juridica', 'Subsistencia', 'Otros', 'Elaboración de concentrado\r\nProductos Veterinarios\r\nProyecto de elaboración de calzado', NULL, '2014-09-25 20:37:58', '2014-10-02 01:22:24'),
(279, 'Individual', 'Santos Angel Orantes Umaña', 'Empresa agrícola dedicada al cultivo de jocote de corona y a la elaboración de derivados del mismo. Actualmente, está en proceso de conformación de una cooperativa que de un mayor impulso a los productores, por medio de la diversificación de productos.', 207, 'Cantón San Antonio Caminos', '1010-020383-104-5', '', 'Informal Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Cultivo de jocote de corona.\r\nElaboración de vino de jocote.', NULL, '2014-10-02 03:35:29', '2014-10-28 02:09:58'),
(280, 'Individual', 'María Mirna Amaya de Rivas', 'Microempresa de subsistencia que desde el año 2013 inició con la prestación de servicios de decoración floral y manualidades para diferentes eventos. Se identifica un alto potencial de demanda debido a que es un servicio que no está siendo atendido a nivel local ni en los municipios cercanos. La empresaria busca acceder y posicionarse en nuevos mercados, sin embargo quiere perfeccionar sus técnicas para ser más competitiva y ofrecer servicios novedosos en decoración para diferentes eventos.  En la empresa familiar trabajan dos personas y está localizada en Colonia La Fuente, calle al cementerio, en el municipio de Guacotecti, departamento de Cabañas', 15, 'Colonia La Fuente, calle al Cementerio No 20', '0902-240887-101-4', '', 'Informal Natural', 'Subsistencia', 'Otros', 'Pupusería\r\nArreglos florales', NULL, '2014-10-02 03:53:50', '2014-11-04 00:08:42'),
(281, 'Individual', 'María Mirna Amaya de Rivas', 'Microempresa de subsistencia que desde el año 2013 inició con la prestación de servicios de decoración floral y manualidades para diferentes eventos. Se identifica un alto potencial de demanda debido a que es un servicio que no está siendo atendido a nivel local ni en los municipios cercanos. La empresaria busca acceder y posicionarse en nuevos mercados, sin embargo quiere perfeccionar sus técnicas para ser más competitiva y ofrecer servicios novedosos en decoración para diferentes eventos.  En la empresa familiar trabajan dos personas y está localizada en Colonia La Fuente, calle al cementerio, en el municipio de Guacotecti, departamento de Cabañas.', 15, 'Colonia La Fuente. Calle al Cementerio Nº 20', '0902-240887-101-4', '', 'Informal Natural', 'Subsistencia', 'Otros', 'Arreglos florales', NULL, '2014-10-07 20:31:27', '2014-10-07 20:31:27'),
(282, 'Empresa', 'Cándida Echeverria Martinez', 'Grupo de 5 mujeres que decidieron iniciar su negocio en febrero de 2013 con la proucción y venta de productos de limpieza y encurtidos, la producción la realizan en la casa de habitacion de una de las empresarias, la venta del producto la hacen en el canton el cerron y sus alrededores, las empresarias han sido capacitadas por personal asignado por prodemor Central en la parte tecnica. Se espera capacitar a las empresarias en temas empresariales por parte del CDMYPE.', 17, 'Cantón San Sebatian, Municipio Jutiapa, departamento de Cabañas', '0904-200960-101-2', '', 'Informal Natural', 'Subsistencia', 'Química Farmaceutica', 'Producción y venta de productos de limpieza ', NULL, '2014-10-10 02:23:25', '2014-10-30 23:55:31'),
(283, 'Empresa', 'Carlos Rene Vaquerano Marin', 'La empresa Arena Puente de Oro, esta ubicada en 2° cuadra al norte, caserío la Pirracha, Tecoluca, San Vicente. Operando desde el año 2,000, teniendo como principal producto la vetan de Arena y Material selecto para la construcción.', 208, '2° cuadra al norte del ferrocarril, caserío la Pirracha.', '1010-010655-002-4', '54271-7', 'Persona Natural', 'Micro-empresa', 'Comercio', 'venta de arena y material selecto.', NULL, '2014-10-11 20:49:07', '2014-10-11 20:49:07'),
(284, 'Empresa', 'Rancho Tepeyac', 'El Rancho Tepeyac, esta ubicado en el Km 53 carretera Ilobasco, Cantón Agua Zarca, dedicado a la producción de hortalizas desde hace 4 años y desde el 2000 en el área agrícola, con cereales y con la caña de azúcar. La empresa está representada por Fran Díaz quien lidera el grupo familiar con asesoría de su padre Porfirio Díaz, actualmente la empresa quiere expandir los horizontes y pasar de ser productores a transformar sus productos agricolas con la puesta en marcha de una planta de producción para transformar la caña de azucar en subproductos.', 16, 'km 53 carretera a Ilobasco Cantón Agua Zarca.', '0614-171282-102-1', '205385-4', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'cultivo de hortaliza, frutas y caña.', NULL, '2014-10-15 02:56:27', '2015-10-27 03:18:06'),
(285, 'Cooperativa', 'Asociación cooperativa de productos agropecuarios El Pacayal de R.L.', 'Asociación cooperativa El Pacayal esta operando desde el 13/07/2009 en Suchitoto, entre los productos que ofrecen están la Jaleas y mermeladas, licores y vino, Tour rurales y alimentación.', 69, 'Cantón El Zapote, caserío El Rosario.', '0715-130709-101-5', '228592-5', 'Persona Juridica', 'Micro-empresa', 'Turismo', 'Turismo, alimentación, licores y vinos y jaleas.', NULL, '2014-10-16 04:50:44', '2014-10-16 04:50:44'),
(286, 'Empresa', 'ROBERTO ANILO VALLADARES ORELLANA ', 'El Taller de Cerámica Valladares es un pequeño negocio liderado por su propietario Roberto Anilo Valladares, ubicado en el Barrio El Calvario del municipio de Ilobasco.\r\n\r\nEn la actualidad, el taller está enfrentando el reto de diversificar sus diseños, ya que la competencia cada vez es más fuerte y las exigencias de los clientes hacen que innovar sea cada vez más necesario, sobre todo en épocas de temporada como la navideña.\r\n', 16, 'Barrio El Calvario, Entrada a Ilobasco, Calle Principal.', '0903-281281-104-7', '', 'Persona Natural', 'Subsistencia', 'Artesanias', 'Producción y comercialización de artesanías.', NULL, '2014-10-30 21:01:35', '2015-10-29 02:39:14'),
(287, 'Empresa', 'Taller Dollyana', 'Creaciones Dollyana, es una empresa familiar liderada por su propietaria Teresa Lainez con la ayuda de los demas miembros del grupo familiar, esta ubicada en Bo. El Calvario, Caller Bernardo Perdomo #16, Ilobasco Cabañas, dedicada a la elaboración de uniformes escolares, uniformes de personal de enfermería y de oficina, así como ropa a la medida y prendas exclusivas bordadas en tela de algodón.', 16, 'Bo. El Calvario, Caller Bernardo Perdomo #16', '0906-290856-001-6', '212060-4', 'Persona Natural', 'Micro-empresa', 'Textiles y Confección', 'Elaboración de uniformes escolares.\r\nElaboración de prendas de vestir en diferentes diseños.', NULL, '2014-10-31 01:34:39', '2015-09-14 23:25:50'),
(288, 'Empresa', 'Mélida Fuentes de la O', 'Distribuidora San Luis es una empresa que desde el año 2006 se dedica a la elaboración de productos de limpieza de todo tipo y que distribuyen en el municipio de Cojutepeque y sus alrededores.\r\nCon el propósito de ampliar su mercado y comercializar sus productos dentro de otras zonas surge la necesidad de crear una imagen presentable y acorde al segmento de clientes que se atiende y al mismo tiempo tener herramientas publicitarias acorde al tipo de empresa y con las que puedan dar a conocer la variedad de productos que fabrica.\r\nDentro de los productos que se elaboran se encuentran: desinfectante, lejía, jabón líquido para manos, detergente en polvo, desengrasante, jabón para lavandería, suavizante de telas, limpiavidrios, silicones y shampoo para carro.\r\n', 56, '1° Calle Ote. y Av. Los Héroes', '0614-070159-103-6', '184207-9', 'Persona Natural', 'Micro-empresa', 'Química Farmaceutica', 'Elaboración de productos de limpieza', NULL, '2014-10-31 22:59:06', '2014-10-31 22:59:06'),
