(295, 'Empresa', 'Industrias Ilomodas S.A de C.V', 'Ilomodas es una empresa que nació hace cuatro años con el objetivo de sus socios de participar en el programa de los paquetes escolares, en la confección de uniformes del programa del Ministerio de Educación, ademas de eso se ha ido implementando nuevas lineas de producción textil. La empresa esta ubicada en Av. Carlos Bonilla, Bo. El Calvario, contiguo a aseguradora MAFRE, Ilobasco Cabañas.', 16, 'Ave. Carlos Bonilla Bo El Calvario', '0903-190111-101-0', '208981-0', 'Persona Juridica', 'Pequeña Empresa', 'Textiles y Confección', 'Uniformes escolares\r\nRopa y Uniformes', NULL, '2014-11-11 20:29:59', '2014-11-12 20:34:58'),
