(297, 'Empresa', 'Finca La Paz', 'Finca la Paz es una empresa dedicada a ofrecer servicios de tour guiados dentro de su finca donde ofrece tambien servicios de restaurante, esta ubicada en Carretera Panamericana, bajo la direccion de su propietario José Guzman.', 56, 'Km. 32 Carretera Panamericana', '0210-310354-003-0', '', 'Persona Natural', 'Micro-empresa', 'Turismo', 'Servicio de Restaruarnte, Turismo rural.', NULL, '2014-11-26 21:42:17', '2014-11-26 21:42:17'),
(298, 'Empresa', 'Oscar Noel Castro Aguilar', 'Oscar Noel Castro Aguilar, empresario que desde hace dos años elabora bebida en polvo con semillas naturales con propiedades nutritivas.  Actualmente cuenta con dos lineas de productos: Bebida elaborada con frutos secos para mantener peso y para quemar grasa; y bebida el polvo con alto contenido en proteínas.  El producto es vendido a nivel local, los principales clientes: Usuarios de gimnasios y personas que desean llevar una dieta balanceada y saludable.  Luego de la formulación y los respectivos análisis para el desarrollo del producto es indispensable mejor la presentación del mismo, ya  que actualmente no se cuenta con una marca ni envase adecuado para la comercialización en mercados formales. La empresa se encuentra ubicada en 8° A. V Norte Barrio San Miguel, municipio de Ilobasco, departamento de Cabañas. ', 16, '8° A.V Norte Barrio San Miguel #5', '0903-120994-102-9', '', 'Informal Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Proteína vegetal\r\n', NULL, '2015-01-17 03:12:09', '2015-07-15 22:27:15'),
(299, 'Empresa', 'María Isabel Quintanilla de Flores', 'Empresa dedicada a la elaboración de pan dulce artesanal desde 1964. Además cuenta con servicios de recepción y comida a la vista. La empresa cuenta con cinco empleados y las instalaciones estan ubicadas en 10a Calle Poniente #5 Barrio San Francisco, municipio de San Vicente, Departamento de San Vicente. ', 207, '10a Calle Poniente #5 Barrio San Francisco', '1010-070649-001-4', '', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Panadería, servicios de recpeción y comida a la vista\r\n', NULL, '2015-01-21 04:14:38', '2015-01-21 04:14:38'),
(300, 'Individual', 'María Isabel Quintanilla de Flores', 'Empresa dedicada a la elaboración de pan dulce artesanal desde 1964. Además cuenta con servicios de recepción y comida a la vista. La empresa cuenta con cinco empleados y las instalaciones estan ubicadas en 10a Calle Poniente #5 Barrio San Francisco, municipio de San Vicente, Departamento de San Vicente. ', 207, '10a Calle Poniente #5 Barrio San Francisco', '1010-070649-001-4', '', 'Persona Natural', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Panadería, servicios de recpeción y comida a la vista\r\n', NULL, '2015-01-21 04:15:43', '2015-01-21 04:15:43'),
(301, 'Emprendedor', 'Cooperativa Tierra de Encanto ', 'Asociación Cooperativa Tierra de Encanto, busca llevar acabo proyecto de desarrollo de turismo rural, con la construcción de restaurante y salón de usos múltiples, así como con la realización de diferentes actividades afines. \r\nEl proyecto esta ubicado en Caserío La Laguna, Cantón Agua Helada, municipio de Santa Clara. San Vicente. ', 205, 'Caserío La Laguna,Cantón Agua Helada', '1004-010714-101-4', '238288-7', 'Persona Juridica', 'Emprendedor', 'Turismo', 'Proyecto turístico de restaurante', NULL, '2015-03-10 03:59:51', '2015-03-10 03:59:51'),
(302, 'Grupo', 'Fiderbinda Orellana Guevara', 'Empresa conformada por un grupo de  mujeres, dedicada a la elaboración de prendas de vestir y utilitarias teñidas en añil.  \r\nSus productos son promovidos en sala de venta de Suchitoto, a través de ordenes de pedido de instituciones nacionales y extranjera, así como en  salas de venta de almacenes de prestigio del país. \r\nEl taller y sala de venta se encuentra en 2a Calle Poniente y 4a A.V Norte #8 Barrio San José, municipio de Suchitoto, departamento de Cuscatlán. ', 69, '2a Calle Poniente y 4a A.V Norte #8 Barrio San José', '0518-200672-101-9', '', 'Informal Natural', 'Micro-empresa', 'Textiles y Confección', 'Elaboración de prendas de vestir y utilitarias teñidas en añil\r\n', NULL, '2015-04-21 20:50:05', '2015-04-21 20:50:05'),
(303, 'Individual', 'María Paulina Fuentes Lopez', 'Empresaria dedicada a la elaboración de dulces de ferias, a base de azúcar.', 15, 'Agua Zarca, Caserío el Dormilon', '', '', 'Informal Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Elaboración de dulces de feria a base de azucar', NULL, '2015-04-30 22:54:54', '2015-04-30 22:54:54'),
(304, 'Individual', 'Teresa Mayela Pocasangre de Rivas', 'Mayela es una empresaria que desde hace nueve años se dedica a la confección de prendas de vestir incluyendo uniformes escolares, la empresaria manifiesta la necesidad de conocer sobre la elaboración de prendas deportivas, por esa razón solicita el apoyo de los servicios que ofrece el CDMYPE con el fin de adquirir y mejorar nuevos conocimientos generales y necesarios para confeccionar este tipo de prendas.', 16, 'Final 2da. Calle Oriente Psj. Rivas, Bo Los Desamparados # s/n Ilobasco, Cabañas', '0904-151069-101-7', '234526-2', 'Persona Natural', 'Subsistencia', 'Textiles y Confección', 'Confección de prendas de vestir', NULL, '2015-05-12 22:12:45', '2015-05-13 02:16:07'),
(305, 'Individual', 'Teresa Mayela Pocasangre de Rivas', 'La empresaria se dedica desde hace nueve años a la elaboración y confección  de prendas de vestir, incluyendo uniformes escolares.', 16, 'final 2da Calle Oriente Pasaje, Rivas, Bo Los Desamparados, # s/n Ilobasco, Cabañas\r\n\r\n', '0904-151069-101-7', '234526-2', 'Persona Natural', 'Subsistencia', 'Textiles y Confección', 'Elaboración de prendas de vestir', NULL, '2015-05-13 01:46:16', '2015-05-13 01:46:16'),
(306, 'Individual', 'Gerber Francisco Romero', 'Empresa dedicada a la comercialización y elaboración de artesanias en barro y que maneja diferentes técnicas para ofrecer productos innovadores al publico objetivo', 16, 'AV. CARLOS BONILLA # 80 BIS BARRIO EL CALVARIO', '0903-260151-003-8', '00127991-1', 'Informal Natural', 'Subsistencia', 'Artesanias', 'Venta de artesanías de barro', NULL, '2015-05-14 23:36:59', '2015-05-14 23:36:59'),
(307, 'Individual', 'Antonio Mauricio Flores', 'Empresario dedicada a la publicación de libros, los cuales son un análisis de las diferentes culturas, costumbres y estilo de vidas de los diferentes departamentos del país. ', 20, 'Barrio El Centro 29 A.V Norte', '0907-300967-101-3', '223327-8', 'Persona Natural', 'Subsistencia', 'Otros', 'Redacción de libros ', NULL, '2015-05-18 20:17:15', '2015-05-18 20:17:15'),
(308, 'Empresa', 'Restaurante Tres Cerditos', 'El CDMYPE a través de los servicios de asistencia técnica se encuentra en el proceso de contratación de la consultoría  "Estudio de mercado sobre las características de la industria y demanda de servicios de restaurante en la ciudad de Ilobasco, para Restaurante Los Tres Cerditos".  La empresa Los Tres Cerditos, representada por Luis Enrique Jovel,  cuenta con cinco sucursales dentro del país de El Salvador y en el corto plazo  busca invertir en la ampliación y remodelación de la sucursal de Ilobasco; no sin antes contar con información de mercado que ayude a la toma de decisiones y construcción de estrategias de mercado orientada a los gustos y preferencias de los consumidores.  La empresa  esta  ubicada en Barrio El Centro,  municipio de Ilobasco. \r\n', 16, '4a A.V Norte Calle Enrique Hoyos. Barrio El Centro', '0903-140693-101-9', '93361-9', 'Persona Natural', 'Pequeña Empresa', 'Turismo', 'Restuarante', NULL, '2015-05-18 20:28:13', '2015-10-08 10:42:24'),
(309, 'Individual', 'Yessica Patricia Rivas', 'Empresa artesanal, propiedad de Yessica Patricia Rivas, dedicada a la elaboración y comercialización de productos en barro. El taller cuenta con mas de 20 años de trayectoria y 12 empleados. Cuenta con experiencia en exportación y se están realizando gestiones para participar en feria New World Craft a realizarse en Guatemala, para lo cual se requiere crear nuevos productos artesanales que puedan competir en el mercado europeo y centroamericano. La empresa se encuentra en Calle principal, salida hacia caserío Menjívar, municipio de Ilobasco, departamento de Cabañas. ', 16, 'Calle Principal, salida hacia casería Menjívar #69', '0903-121084-104-6', '', 'Informal Natural', 'Micro-empresa', 'Artesanias', 'Artesanías en barro', NULL, '2015-05-19 19:58:48', '2015-09-12 04:12:34'),
(310, 'Cooperativa', 'ADEJAC, DE RL', 'ADEJAC, es una empresa jovén en la que sus socios cultivan y producen miel pura, la cual es distribuida en la zona y lugares aledaños actualmente.', 18, 'San Francisco, Caserio La Palmita, San Isidro Cabañas.', '0905-270214-101-2', '234600-5', 'Persona Juridica', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Producción y cultivo de Miel pura', NULL, '2015-05-20 23:36:45', '2015-05-20 23:37:28'),
(311, 'Empresa', 'Hacienda Los Nacimientos', 'Rhina Yolanda de Rehman empresaria dedicada a la elaboración de productos agro-industriales y prestación de servicios de recorridos agro-ecoturísticos. Dentro de las estrategias de crecimiento empresarial busca posicionar sus productos de vinos de marañón, extracto y sirope de flor de rosa de jamaica, en el mercado nacional e internacional, por el potencial de demanda identificado en la participación de ferias empresariales nacionales e internacionales. Sin embargo es necesario mejorar la estandarización y calidad de los productos, así como cumplir con requisitos de inocuidad y seguridad alimentaria exigidos por las normas e instituciones correspondientes, por lo que es imprescindible mejorar en dichos aspectos.  Las operaciones se realizan en Cantón San Lucas, Suchitoto. ', 69, 'Cantón San Lucas', '0614-190545-001-3', '1218819', 'Persona Natural', 'Micro-empresa', 'Turismo', 'Elaboración de vinos artesanales\r\nRopa teñida en añil\r\nTurismo rural y agroturismo\r\nSiropes de Flor de rosa de jamaica', NULL, '2015-05-23 02:28:24', '2015-09-28 23:22:14'),
(313, 'Empresa', 'Lubricantes Firestone', 'La empresa Lubricantes FIRESTONE esta ubicada en Sensuntepeque, Cabañas. Es atendida por su propietaria Cecilia Anabel Rodriguez, desde 1990, Taller automotriz, venta de equipo de agrícola, venta y reparación de motocicletas son los servicios que brinda a sus clientes de Sensuntepeque.', 19, '2°av. sur N° 20 Barrio Santa Barbara', '0902-210735-001-9', '2632-8', 'Persona Natural', 'Micro-empresa', 'Comercio', 'Servicios de taller automotriz, venta de equipo agrícola y motocicletas.', NULL, '2015-06-17 02:00:08', '2015-06-17 02:42:26'),
(314, 'Individual', 'Alba Maribel Climaco de Pocasangre', 'Alba Maribel es una empresaria que desde hace aproximadamente se dedica a la comercializacion de productos varios. Inicio con una ferretería ubicada en Cojutepeque, pero por problemas de inseguridad quito la ferreteria, a la fecha se tiene una tienda de artículos varios entre ellos productos agricolas, venenos, fertilizantes y otros. El negocio es atendido personalmente ademas de realizar todas las actividades que demanda el negocio.', 199, 'Av Salvador Platero Ba El Calvario, Municipio de Guadalupe', '1002-170676-101-8', '', 'Informal Natural', 'Subsistencia', 'Comercio', 'Venta de productos varios y productos quimicos', NULL, '2015-06-20 02:09:33', '2015-06-20 02:09:33'),
(315, 'Individual', 'Mirian Mendoza de Mejia', 'La empresaria Mirian residentee en el Municipio de San pedro Perulapan desde hace mas de 10 años se dedica a la confección y venta de ropa especialmente para niños la cual tambien vende en diferentes zonas del pais de forma ambulante, la empresaria tiene conocimientos en uso y manejo de maquinas plana, coralletera plana entre otras, actividad que aprendio cuando fue empleada de una maquila, el deseo de doña Mirian es adquirir un local donde poder vender sus prendas de vestir, en un lugar adecuado de mucha afluencia de personas.', 64, 'Colonia Santa Isabel Calle a Suchitoto km 25 Principal # 7', '1102-270677-101-3', '', 'Informal Natural', 'Subsistencia', 'Textiles y Confección', 'confección de prendas de vestir especialmente ropa para niños', NULL, '2015-06-20 04:14:15', '2015-06-20 04:14:15'),
(316, 'Individual', 'Gertrudis Villalobos Chavez', 'Doña Gertrudis es la líder de tres mujeres empresarias dedicadas a la elaboracion y venta de productos naturales como shampoo, cremas, gellatina para el cabello, pomada entre otros, representados por la marca comercial "productos Tulita".\r\nLas señoras recibieron una capacitación corta en Ciudad Mujer de San Martin, sobre la elaboración de shampoo y otros productos a la fecha siguen la actividad y venden sus productos en la comunidad y en cojutepeque, la necesidad que presentan es que desean mejorar la calidad de los productos Tulita y ademas agregar dos productos nuevos ya que sus clientes actuales se los solicitan estos son Rinse y Gotas, para ello solicitan el apoyo del CMDYPE con una Asistencia Tecnica, ya que esto les ayudaria a mejorar la calidad de sus productos, generar confianza en los clientes y vender mas. ', 66, 'San Pablo', '0712-171147-101-1', '', 'Informal Natural', 'Subsistencia', 'Química Farmaceutica', 'Elaboración y venta de shampoo y otros productos naturales', NULL, '2015-07-02 03:18:41', '2015-07-06 20:17:54'),
(318, 'Empresa', 'Panadería Josefina', 'Panadería y Pastelería Josefina, es un negocio con una gran trayectoria en la elaboración de Pan en la Ciudad de Ilobasco, funcionando desde hace muchos años como un negocio familiar, su especialidad es el pan dulce y el pan francés, actualmente están incursionando con nuevos productos como la Pastelería y otros nuevos rubros.', 16, 'B° El Calvario 1° Av Sur y 2° Calle Poniente', '0415-290985-101-6', '33873-7', 'Persona Natural', 'Pequeña Empresa', 'Agroindustrias Alimentaria', 'Elaboración de Productos de Panadería', NULL, '2015-07-09 01:30:58', '2015-07-09 01:32:35'),
(319, 'Individual', 'María Evelma Noyola', 'La empresa Verde Azul, es una empresa constituida por un grupo de mujeres que se dedican al teñido del añil en prendas de vestir con especialidad en camisetas, vestidos, faldas y ropa de niños y productos artesanales como bolsones, carteras, bufandas y vinchas para el cabello.\r\n\r\nLa empresa cuenta con 2 años de experiencia en la preparación del añil para teñido de prendas, actualmente están evolucionando en el mercado por lo que necesitan aprender  nuevas técnicas para lograr vender productos de mejor calidad con diseños innovadores que permitan acceder a sus mercados de interés.', 13, 'Calle Principal, frente al parque de Cinquera.', '0901-230664-101-9', '', 'Informal Natural', 'Subsistencia', 'Textiles y Confección', 'ELABORACION DE ARTESANIAS CONFECCIONADAS ESPECIALMENTE DE MATERIALES TEXTILES.', NULL, '2015-07-09 03:43:08', '2015-07-09 03:43:08'),
(320, 'Empresa', 'Clínica San José', 'Empresa dedicada a brindar servicios de salud a los residentes de Cabañas, ubicada en la ciudad de Ilobasco, con operaciones desde el año 2001 con médicos de diferentes especialidades y profesionales al servicio de los pacientes.', 16, 'Av. Carlos Bonilla #7', '0301-160967-101-0', '182011-7', 'Persona Natural', 'Micro-empresa', 'Otros', 'Servicios de Salud', NULL, '2015-07-10 23:39:00', '2015-07-10 23:39:00'),
(321, 'Grupo', 'Grupo IloSuchi', 'El grupo IloSuchi representado por Heidy Maringel Sánchez Gámez, esta conformado por dos iniciativas grupales de artesanas de Suchitoto y dos empresarias artesanas de Ilobasco.  Las primeras han tenido experiencia en la elaboración de bisutería en morro, bambú, coco y madera; las representantes de Ilobasco han tenido experiencia en la elaboración de bisutería en barro. Luego de identificar la oportunidad de mejorar la calidad e innovar productos que puedan trascender los mercados locales, el grupo busca capacitarse para satisfacer gustos y preferencias atendiendo a las tendencias de diseños de bisutería, combinando diferentes técnicas y materiales. En el proceso de formación participaran 10 personas.  \r\nEl lugar de desarrollo de la consultoría será en 2a Calle Pte y 4a A.V Norte #8 Barrio San José en el municipio de Suchitoto, a coordinar realizar algunas actividades en A.V Carlos Bonilla, Barrio El Calvario, municipio de Ilobasco. \r\n', 69, 'Cantón La Bermuda, caserío El Papaturro. ', '', '', 'Informal Natural', 'Subsistencia', 'Artesanias', 'Elaboración de bisutería con semillas  y materiales naturales', NULL, '2015-08-17 21:17:57', '2015-09-18 22:05:12'),
