(325, 'Empresa', 'Restaurante la Casona', 'Empresaria propietaria del Restaurante la Casona ubicado en San Isidro, departamento de Cabañas.', 18, 'Final Ba El Calvario, colonia las Brisas', '0906-140377-101-7', '177567-4', 'Persona Natural', 'Micro-empresa', 'Turismo', 'Restaurante', NULL, '2015-08-31 22:27:31', '2015-11-17 19:18:09'),
