(327, 'Grupo', 'Sonia Elizabeth Urias de Vega', 'Sonia Elizabeth Urías de Vega, es la representante de un grupo de mujeres emprendedoras dedicadas a la elaboración de alimentos, especialmente platillos típicos. CDMYPE UNICAES Ilobasco como parte del proceso de apoyo a iniciativas productivas bajo el programa de Empresarialidad Femenina, ha identificado la necesidad de fortalecer los conocimientos en la elaboración de bocadillos dulces y salados, debido a la demanda potencial en el mercado. Los clientes atendidos son Alcaldías, Escuelas y otros clientes que solicitan alimentos de manera eventual. Doña Sonia solicita al CDMYPE una asistencia técnica que ayude a la diversificacion de boquitas saladas y dulces para cocteles y otros eventos, que cumplan con los gustos y preferencias del mercado objetivo. El grupo está conformado por 15 mujeres residentes en Sensuntepeque. Se requiere que la consultoría se lleve a cabo de forma práctica los días sábados en el municipio de Sensutepeque, departamento de Cabañas.', 16, 'Colonia Miranda 1 Pje 5 # 8', '', '', 'Informal Natural', 'Subsistencia', 'Comercio', 'comercio de ropa, típicos dulces y salados', NULL, '2015-08-31 23:09:48', '2015-09-07 21:39:24'),
(328, 'Cooperativa', 'APICABAÑAS, DE R.L.', 'Apicabañas de R.L. es una asociación cooperativa que aglomera a veintiséis apicultores del departamento de Cabañas. En los últimos dos años, la cooperativa ha recibido el apoyo de programas como el Prodemor Central, Fondo de Desarrollo Territorial de FONDEPRO, entre otros. Con dichos apoyos se ha podido construir un centro de acopio, y se está en proceso de equipar un área para el desarrollo de productos derivados de la miel.\r\n\r\nEl mercado de Apicabañas es mayoritariamente de exportación, ya que ésta es parte de la Cadena de la Miel que le permite llegar a mercados internacionales, principalmente el europeo. Sin embargo, la miel se exporta a granel para ser usada como materia prima en los países destino.\r\n\r\nActualmente, la cooperativa está realizando gestiones para completar el equipamiento de la planta y adquirir capital de trabajo para echar a andar el proyecto de elaboración de derivados de la miel, con el fin de poner a funcionar la planta de producción de derivados de la miel. La planta se pretende poner en funcionamiento en enero de 2016.', 16, 'Cantón Maquilishuat, Caserío Rancho Quemado km. 60 Carretera a Sensuntepeque.', '0905-080301-102-8', '197279-0', 'Persona Juridica', 'Pequeña Empresa', 'Agroindustrias Alimentaria', 'Producción de Miel de Abeja.', NULL, '2015-09-01 03:08:33', '2015-10-27 04:19:30'),
(329, 'Empresa', 'Samuel Elias Espinoza Henriquez/ FERRETERÍA EL 7', 'Ferretería El 7, cuenta con una experiencia en el área de la construcción desde hace más de 30 años, es pionera en el ramo de la ferretería en Ilobasco.\r\nActualmente cuentan con 6 sucursales incluyendo una en la ciudad de Sensuntepeque, los propietarios de las ferreterías están conscientes de los cambios constantes del mercado y de las necesidades de sus clientes, por lo que consideran necesario e indispensable estar a la vanguardia en el mercado que se atiende, por lo que ellos tratan de mantener a su personal preparado y atento a estos cambios, para seguir brindando siempre servicio de calidad a sus clientes.\r\n', 16, 'Calle La presa 5 de noviembre, Barrio San Sebastian colonia El 7.', '0903-090784-101-3', '37627-2', 'Persona Natural', 'Pequeña Empresa', 'Construcción', 'Construcción', NULL, '2015-09-02 22:31:24', '2015-09-02 22:32:07'),
(330, 'Individual', 'Alessandra Arenivar Velasco', '', 19, 'Barrio El Calvario. 5a A.V Sur #22', '0906-210882-102-5', '', 'Informal Natural', 'Micro-empresa', 'Otros', 'Manualidades\r\nTienda de accesorios\r\nRefrigerios', NULL, '2015-09-03 03:40:53', '2015-09-03 03:40:53'),
(331, 'Cooperativa', 'ADACI, DE R.L.', 'La Asociación de Artesanos Ceramistas de Ilobasco (ADACI, DE R.L.) está conformada por un grupo de artesanos ilobasquenses experimentados en el arte del barro que, con el objetivo de fortalecer al sector artesanal, han decidido conformar una asociación que les permita potenciar los talleres de sus miembros y desarrollar el negocio en mercados de más alto valor.\r\n\r\nActualmente la asociación está en constituida y regulada por el Instituto Nacional de Fomento Cooperativo, cuenta con una tienda donde ofrece los productos elaborados en los talleres de sus miembros; sin embargo, la comercialización en otro tipo de mercados ha sido un problema que les aqueja desde su constitución. De ahí, es importante que la cooperativa cuente con su oferta propia, de tal manera, que los clientes reconozcan la calidad y la diferenciación en los diseños de ADACI.\r\n', 16, 'Av. Carlos Bonilla # 36', '0903-190514-101-0', '236996-8', 'Persona Juridica', 'Subsistencia', 'Artesanias', 'Elaboración y comercialización de artesanías en barro.', NULL, '2015-09-12 02:28:09', '2015-10-03 03:19:37'),
(332, 'Individual', 'Franklin Wilian Guardado', 'El CDMYPE-Ilobasco a través de los servicios empresariales de asistencia técnica, esta llevando acabo el proceso de contratación de la consultoría denominada "Creación de nuevas lineas decorativas de artesanías en barro para taller artesanal Franklin". Según  diagnóstico empresarial se identifica oportunidades de mercado relacionado con las rutas turísticas de Monseñor Romero y  figuras tradicionales de animales, es por ello que se necesita crear nuevas líneas de diseños decorativos artesanales en barro para ser competitivos en el mercado. El Taller Franklin, es propiedad de Franklin Wilian Guardado López, esta ubicado en Barrio Los Desamparados, Colonia El Carmen #64, municipio de Ilobasco, departamento de Cabañas.  ', 16, 'Barrio Los Desamparados, colonia El Carmen #80', '', '', 'Informal Natural', 'Micro-empresa', 'Artesanias', 'Artesanías decorativa en relieve', NULL, '2015-09-14 21:05:31', '2015-09-15 02:57:45'),
(333, 'Empresa', 'Clínica Vicentina de Especialidades', 'Clínica Vicentina de Especialidades S.A. de C.V. es una empresa formada con la visión de proveer servicios médicos en el municipio de San Vicente, se encuentra ubicada en el centro de la Ciudad de San Vicente, en 2a Av. Sur #25c Bo. San francisco. La empresa se ha formado como una sociedad anónima y brinda ademas de los servicios de salud, alquiler de locales para clínicas. ', 207, '2a Av. Sur #25c Bo. San francisco.', '0614-120615-102-6', '241597-3', 'Persona Juridica', 'Subsistencia', 'Otros', 'Servicios médicos, Alquiler de consultorios.', NULL, '2015-09-14 21:06:14', '2015-09-14 22:02:55'),
(334, 'Individual', 'Francisco Bladimir Escobar', 'El CDMYPE a través de los servicios empresariales de Asistencia Técnica, se encuentra en proceso de contratación de la consultoría "Diseño y prototipo de misterio navideño en barro para Taller Escobar". A la fecha, el propietario Francisco Bladimir Escobar, ha creado diferentes lineas decorativas en barro, sin  embargo por la falta de asesoría técnica no ha podido elaborar línea decorativa para la temporada navideña, la cual esta siendo demandada por sus clientes actuales y potenciales. Se ha identificado que dentro de los artículos navideños los nacimientos son los que tienen mayor demanda. El taller se encuentra ubicado en Barrio El Calvario, colonia Sagrado Corazón de Jesús #42, municipio de Ilobasco, departamento de Cabañas. ', 16, 'Barrio El Calvario. Col. Sagrado Corazón de Jesús #42', '', '', 'Informal Natural', 'Micro-empresa', 'Artesanias', 'Artesanías decorativas en barro', NULL, '2015-09-18 20:52:31', '2015-09-19 04:10:51'),
(335, 'Empresa', 'José Edilberto Escobar Vasquez', 'Taller de Cerámica El Teacher, es un taller de artesanías en barro ubicado en la ciudad de Ilobasco, Departamento de Cabañas,  cuentan con más de 25  años de experiencia en el barro, su principal objetivo es innovar en diseños en su taller, consiente de los cambios que genera el mercado y  la oportunidad de mantenerse en el mismo, le ha generado  la idea de trabajar un nuevo misterio conocido como nacimiento del niños Jesús, misterios muy populares en Ilobasco, con un toque innovador cada una de las piezas, ya que el empresario desea continuar desarrollando orgullosamente la representación de nuestra gente salvadoreña.\r\nLa demanda y el gusto por este tipo de artesanía es lo que ha permitido al taller requerir la ampliación de diseños y tecnificar el arte que hasta este momento llevan practicando.\r\n', 16, 'Barrio El Calvario Av. Carlos Bonilla casa #110', '0903-240260-003-9', '', 'Persona Natural', 'Micro-empresa', 'Artesanias', 'Artesanías en Barro', NULL, '2015-09-23 02:41:29', '2015-09-23 02:41:29'),
(336, 'Empresa', 'Cárnicos y Embutidos El Buen Sabor.', 'Ellas son una grupo de mujeres llamadas “Cárnicos y embutidos El Buen Sabor”, ubicadas en el departamento de Cabañas, están trabajando juntas desde el año 2014, que con el propósito de generar ingresos para sus familias se han organizado para elaborar y vender embutidos y otros productos cárnicos.\r\nActualmente poseen las herramientas básicas para trabajar y han recibido formación en elaboración de chorizos que aún están produciendo a pequeña escala, por lo que se identificó a través del diagnóstico empresarial la necesidad de fortalecerles esta actividad económica debido a la cantidad de demanda que se tiene en la zona y la capacidad técnica que tienen algunas socias en las ventas y en producción.\r\n', 16, 'Llanitos, Caserio Quesera Arriba.', '0903-120674-101-0', '', 'Informal Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Producción Embutidos', NULL, '2015-09-24 03:06:15', '2015-09-28 21:11:36'),
(337, 'Individual', 'Artesal', 'Artesal es una empresa representada por Gabriel Dagoberto López ubicada en Barrio los desamparados 6av sur salida a Sensuntepeque, Ilobasco, Cabañas,  ha surgido de la unión de dos personas emprendedoras de Ilobasco que han visto la oportunidad de la comercialización de artesanías en el país. Ellos han identificado el potencial que tienen las artesanías para la exportación por lo que han solicitado a CDMYPE el apoyo para la búsqueda de mercados internacionales. \r\n\r\nUna importante herramienta para la búsqueda de nuevos clientes internacionales es un sitio web, con el cual pueda dar a conocer las diferentes artesanías que ofrecen y vender a través del mismo. Es por eso que se están contratanto una asistencia técnica para el diseño y elaboración del sitio web', 16, 'Barrio los desamparados 6av sur salida a Sensuntepeque', '0903-020387-103-0', '', 'Informal Natural', 'Emprendedor', 'Artesanias', 'venta de artesanias', NULL, '2015-10-01 22:13:51', '2015-10-03 02:46:11');
INSERT INTO `empresas` (`id`, `categoria`, `nombre`, `descripcion`, `municipio_id`, `direccion`, `nit`, `registro_iva`, `constitucion`, `clasificacion`, `sector_economico`, `actividad`, `deleted_at`, `created_at`, `updated_at`) VALUES
(338, 'Individual', 'Claudia Catalina Flores Estrada', 'Empresa natural de subsistencia representada por doña Claudia Catalina Flores Estrada dedicada a la confección de prendas de vestir, especialmente uniformes para mujeres empleadas de la zona de Tejutepeque e Ilobasco, Los productos se comercializan de forma directa, sin embargo como parte de la estrategia de posicionamiento comercial se requiere una imagen comercial que sea competitiva para acceder a nuevos mercados. El taller esta ubicado en el centro de Tejutepeque departamento de Cabañas.', 20, 'El zapote caserío azacualpita', '0907-300485-101-3', '', 'Informal Natural', 'Subsistencia', 'Textiles y Confección', 'Confección', NULL, '2015-10-02 04:23:31', '2015-10-03 02:35:50'),
(340, 'Empresa', 'Castor Químicos de El Salvador S.A de C.V', 'El CDMYPE a través de sus servicios de asistencia técnica esta realizando el proceso de contratación de servicios de consultoría " Creación de marca, viñetas y herramientas gráficas promocionales para Castor Químicos de El Salvador S.A de C.V. \r\nLa empresa cuyo representante es Eric Mauricio González Serrano, se dedica a la elaboración de detergentes, shampoos, silicom y otros productos relacionados. Actualmente  atiende dos segmentos de mercado: Compras Gubernamentales y empresas de diferentes sectores principalmente carwash  e industria alimenticia. El producto es distribuido en seis departamentos del país. Se busca mejorar la calidad del producto y la presentación comercial del mismo, buscando acceder a otros segmentos de mercado. La empresa esta ubicada en carretera Panamericana km26, desvío El Limón, municipio El Carmen, departamento de Cuscatlán. ', 64, 'Carretera Panamericana km 26. Desvío al Limón. ', '0614-130292-102-9', '304000-0', 'Persona Juridica', 'Micro-empresa', 'Química Farmaceutica', 'Detergentes\r\nShampoo\r\nSilicom\r\n', NULL, '2015-10-02 21:51:21', '2015-10-03 02:27:26'),
