(344, 'Individual', 'Albertina Granados Flores', 'Doña Albertina es la lider de 6 mujeres dedicadas al cuido de una granja de gallinas ponedoras, la actividad actual es la comercialización de huevos de gallina.', 210, 'San Jeronimo, Limon', '1003-010156-102-4', '', 'Informal Natural', 'Subsistencia', 'Construcción', 'Comercialización de huevos', NULL, '2015-10-12 22:46:59', '2015-10-12 22:46:59'),
(345, 'Individual', 'Francisca Concepción Rodriguez de Acevedo', 'Doña Francisca se dedica a la elaboración de pasteles por encargo para diferentes ocasiones.', 198, 'San Nicolas, caserío la Hermita', '1001-031275-101-5', '', 'Informal Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Pasteleria', NULL, '2015-10-12 23:00:16', '2015-10-12 23:00:16'),
(346, 'Individual', 'Ana Elizabeth Castaneda Vda de Flores', 'La emprendedora por muchos años se ha dedicado a sus negocios entre ellos un restaurante, y otros locales que ahora tiene en alquiler. La emprendedora decidió tomar un descanzo pero ahora necesita volver a las actividades de trabajo por lo que busca en el CDMYPE, capacitarse para dedicarse a alguna actividad que aun no tiene definida, pero que esta entre elaborar pizzas y asociarse en una cooperativa para la venta de vinos.', 65, 'Barrio Concepción 2da Av. Sur casa N° 7', '0711-250557-001-6', '', 'Informal Natural', 'Emprendedor', 'Otros', 'Comercio', NULL, '2015-10-12 23:21:00', '2015-10-12 23:21:00'),
(347, 'Individual', 'María Alejandra Torres de Fernandez', 'Doña Alejandra se dedica a su negocio desde hace aproximadamente 15 años, actualmente cuenta con una empleada mujer, los servicios que ofrece son almuerzos y cenas.', 56, 'Barrio Santa Lucia calle poniente casa # 60', '0702-100157-002-1', '', 'Informal Natural', 'Micro-empresa', 'Otros', 'Comedor y pupusería', NULL, '2015-10-13 01:16:27', '2015-10-13 01:16:27'),
(348, 'Grupo', 'Mesa de Desarrollo Artesanal de Ilobasco', 'La mesa de desarrollo artesanal de Ilobasco, se ha conformado con el objetivo de apoyar y fomentar el desarrollo del artesano y del barro en Ilobasco, la constituyen 5 cooperativas ADACI, ACAACI, ACOPAREN, ACOARTE Y ARTEILOBASQUENSE, haciendo un total de 120 artesanos reunidos entre las 5 cooperativas, su tarea primordial como mesa es estar a la vanguardia en los diseños de artesanías y ofrecer productos innovadores y de calidad a sus clientes tanto a nivel local como internacional,  por lo que se ven en la necesidad de diseñar nuevas líneas de productos en barro de acuerdo a la tendencia actual del mercado.\r\n\r\nPor lo que ellos están requiriendo contar con diseños innovadores de acuerdo a la tendencia actual del mercado.\r\n', 16, 'Av Carlos Bonilla Calle Principal, Barrio El Calvario.', '', '', 'Grupo de empresas', 'Micro-empresa', 'Artesanias', 'Figuras humanas.', NULL, '2015-10-13 22:49:32', '2015-10-13 22:49:32'),
