(353, 'Individual', 'Rosa Alvina López', 'El Centro de Desarrollo para la Micro y Pequeña Empresa CDMYPE, se encuentra en proceso de contratación de servicios de consultoría, para la asistencia técnica denominada "Etiquetado nutricional para bebidas en polvo La Morenita".\r\nLos productos elaborados son: Horchata de morro, harina de maíz, harina de semilla de marañón y alguashte, están  siendo distribuido en tiendas, mercado y por ordenes de pedido en Ilobasco, Quezaltepeque y San Salvador; además de hacer envíos para Estados Unidos a través de viajeros. Actualmente la empresa esta en la etapa de mejora y desarrollo de sus productos. Esta ubicada en Barrio San Sebastián, pasaje Castellanos N° 2 municipio de Ilobasco, departamento de Cabañas. ', 16, 'Barrio San Sebastián, Pasaje Castellanos N° 2', '0903-300179-101-8', '', 'Informal Natural', 'Subsistencia', 'Agroindustrias Alimentaria', 'Elaboración de horchata de morro, harina de maíz, semilla de marañón y alguashte.', NULL, '2015-11-05 22:07:07', '2015-11-05 22:07:07'),
(354, 'Individual', 'Cleotilde Veronica Quinteros Martinez', 'Empresaria dedicada a su negocio Restaurante la Casona desde hace quince años.', 18, 'Colonia Las Brisas Final barrio el Calvario', '0906-140377-101-7', '177567-4', 'Persona Natural', 'Micro-empresa', 'Turismo', 'Restaurantes', NULL, '2015-11-17 17:31:56', '2015-11-17 17:31:56'),
