(361, 'Empresa', 'Sonia Yamileth Argueta Verdugo', 'Crafty es una nueva opción para diseñar e imprimir materiales de promoción, papelería y todo lo necesario para ejecutar la estrategia comercial de las empresas, centros escolares, alcaldías, etc.', 56, 'Barrio San Nicolás, 3a. Av. Sur, Casa # 21-B', '0702-011187-102-3', '232132-7', 'Persona Natural', 'Micro-empresa', 'Otros', 'Diseño e impresión de materiales publicitarios.', NULL, '2016-01-19 22:29:02', '2016-01-19 22:29:02'),
(362, 'Empresa', 'Academía Bet-el', 'Academia Bet-el es una empresa dedicada a la fabricación de prendas de vestir de todo tipo, como uniformes escolares, uniformes deportivos, ropa para dama, caballeros y niños. Desde el 2002 que se fundó como empresa a logrado posicionarse en el municipio de Cojutepeque ofreciendo productos de calidad y una buena atención al cliente.', 56, 'Carretera Panamericana Km. 34 1/2. Contiguo a Luz del Mundo.', '1009-050165-102-5', '212442-2', 'Persona Natural', 'Micro-empresa', 'Textiles y Confección', 'Elaboración de prendas de vestir', NULL, '2016-06-03 20:31:36', '2016-06-03 20:31:36'),
(363, 'Empresa', 'AGROPARTNER, S.A. DE C.V.', 'EMPRESA: Agropartner, S.A. de C.V. \r\nDIRECCIÓN: Calle al rio, Cantón San José, Monte San Juan, Cuscatlán.\r\nREFERENTE: Bernardo Ventura Ventura\r\nAgropartner es una empresa joven que desde hace dos años está trabajando en la producción y comercialización de productos procesados en el campo, principalmente hortalizas, frutas, cárnicos especializados, aves, entre otros. Actualmente, la empresa está atendiendo el mercado a nivel nacional en el segmento de restaurantes, hoteles, clubs sociales, entre otros.\r\n\r\nAgropartner busca posicionarse en el mercado como una empresa confiable, que ofrece productos de alta calidad a precios competitivos. Por ello, se encuentra en búsqueda constante de nuevos clientes y dentro de sus proyecciones de crecimiento, ha identificado la necesidad de contar con una imagen que refleje la calidad de su producto y brinde confianza a los segmentos más exigentes de consumidores.', 59, 'Camino al río, Cantón San José', '0614-030714-104-1', '233947-8', 'Persona Juridica', 'Micro-empresa', 'Agroindustrias Alimentaria', 'Cultivo de productos agrícolas en combinación con la cría de animales.', NULL, '2016-06-09 22:31:35', '2016-06-09 22:31:35');
