INSERT INTO `eventos` (`id`, `fecha`, `nombre`, `descripcion`, `lugar`, `tipo`, `created_at`, `updated_at`) VALUES
(3, '2014-09-23', 'Feria MYPE 2014', 'Feria donde se reunen todas las empresas del país, con el objetivo de conocer.', 'CIFCO', 'CONAMYPE', '2014-09-18 02:03:24', '2014-09-22 08:56:55'),
(4, '2014-06-24', 'Capacitación d Sensibilización', 'Paquete Empresarial', 'Unicaes', 'CONAMYPE', '2014-10-30 04:50:18', '2014-10-31 02:07:26'),
(5, '2014-11-22', 'Taller: Finanzas Básicas', 'El taller está dirigido a empresarios de la zona.\r\nHora: 8:00am a 12:md', 'Unicaes- A32', 'CDMYPE', '2014-11-18 05:22:08', '2014-11-18 05:22:08'),
(6, '2014-11-26', 'Listado de proveedores para COEXPORT', 'Los directores COEXPORT y CDMYPE se reunirán para ver qué acuerdos se pueden llevar acabo en función de generar vinculaciones comerciales con empresarios COEXPORT. Es necesario agregar a este listado aquellos clientes que puedan ser proveedores. ', 'San Salvador COEXPORT', 'CDMYPE', '2014-11-24 22:36:58', '2014-11-26 21:58:47'),
(7, '2014-12-09', 'Show Room Empresarios CDMYPE-COEXPORT', 'Se tendrá visita de Consejeros Comerciales y Directora de COEXPORT, con el objetivo de conocer cual es la oferta de productos de la zona. \r\n\r\nAtendiendo al espacio cada asesor debe confirmar con 7 empresarios. El evento será de 11:00 am a 12:00 m\r\n\r\nSi se puede confirmar a mas tardar con empresarios a mas tardar el  03 de diciembre.\r\n', 'Edificio C-Pasillo', 'CDMYPE', '2014-11-28 20:51:13', '2014-11-28 20:51:13'),
(8, '2015-01-16', 'Reunión Informativa y de Compromiso para Empresarios Estrellas.', 'Reunión informativa y de compromiso con empresarios identificados que tienen potencial de crecimiento y generación de impacto económico.', 'UNICAES, Ilobasco', 'CDMYPE', '2015-01-06 03:00:48', '2015-01-06 03:50:14'),
(9, '2015-01-27', 'Capacitación, sensibilización y socialización sobre la rueda de negocios', 'En el marco del  proyecto de Compras del Estado,​perteneciente a la Gerencia​ de Servicios Empresariales​,​ se realizaran Ruedas de negocio en el mes de febrero.', 'UNICAES, Ilobasco', 'CONAMYPE', '2015-01-13 01:38:55', '2015-01-21 23:03:24'),
(10, '2015-02-17', 'Rueda de Negocios CONAMYPE', 'El objetivo de esta actividad es vincular  a 10 empresarios que cumplan con el perfil respectivo a la Rueda de Negocios organizada por CONAMYPE.\r\n\r\nSe solicita anotar a los clientes a mas tardar el jueves 5 de febrero para gestionar la participación en la actividad.\r\n\r\nEl mensaje de invitación para el empresario debe ser: Existe oportunidad de participar en rueda de negocios con el  Estado y empresas tractoras, si el empresario considera que cumple con el perfil y están interesados en participar, explicarles que se someterán a un proceso de selección y se les comunicará si son seleccionados. ', 'Hotel Real Intercontinental', 'CDMYPE', '2015-02-02 23:31:26', '2015-02-02 23:31:26'),
(11, '2015-03-05', 'Compras Gubernamentales ', 'La actividad consiste en el desarrollo de tres jornadas de formación de Compras Gubernamentales a realizarse los días jueves, iniciando el jueves 05 de marzo de 8:00am a 12:00m. Dirigido a empresarios que cumplan con requisitos para vender al estado y que estén interesados en hacerlo, así como a empresarios que estén interesados en convertirse en proveedores potenciales del Estado. ', 'CDMYPE', 'CDMYPE', '2015-02-06 22:40:00', '2015-02-06 22:40:00'),
(12, '2015-02-10', 'Mejorando la Productividad Artesanal', 'Seminario a desarrollarse en cinco jornadas donde se implementara el modelo de 5 S y KAIZEN para iniciar el camino a la productividad de los talleres artesanales.', 'CDART', 'CDMYPE', '2015-02-09 21:38:09', '2015-02-09 21:38:09'),
(13, '2015-03-13', 'Curso de Emprendedurismo', 'El curso esta dirigido a emprendedores con idea de negocio que quieran concretar su negocio.', 'CDMYPE UNICAES Ilobasco', 'CDMYPE', '2015-02-25 04:13:08', '2015-02-25 04:13:08'),
(14, '2015-05-07', 'Capacitación "La sonrisa de afuera y la sonrisa de adentro"', 'La capacitación “La sonrisa de afuera y la sonrisa de\r\nadentro”. Está dirigida a mujeres emprendedoras y empresarias de subsistencia cuenta propia de los departamentos de Cabañas, Cuscatlán y San Vicente. La procedencia de las participantes es muy diversa, la capacitación esta orientada a conocer que cuando hablamos de sonreír estamos hablando de un proceso verdaderamente muy complejo a nivel psicológico con  Implicaciones muy grandes, tanto hacia tu propia mente y cuerpo como hacia las mentes de los que te rodean. Una sonrisa es algo verdaderamente trascendente. De hecho es una de las Expresiones más exclusivas de la muy avanzada evolución de nuestros cerebros humanos.', 'CDMYPE UNICAES Ilobasco', 'CDMYPE', '2015-04-22 20:08:52', '2015-04-22 20:08:52'),
(15, '2015-05-21', 'Comercio Exterior para Mipymes No Exportadoras', 'La capacitación se hará con el objetivo de motivar el interés de las mipymes no exportadoras en el proceso exportador, y dar a conocer los elementos y requerimientos necesarios.', 'UNICAES, Ilobasco', 'CONAMYPE', '2015-05-14 21:49:23', '2015-05-14 21:49:23'),
(16, '2015-05-28', 'Reunión Informativa', ' Reunión informativa sobre línea financiamiento de BANDESAL a través del programa BANCA MUJER.', 'UNICAES, Ilobasco, Edificio A, Aula 24', 'CDMYPE', '2015-05-21 03:10:03', '2015-05-21 03:10:03'),
(17, '2014-06-18', 'Presentación de Programa Amanecer Rural', 'El evento tiene por objetivo que las cooperativas y empresas rurales conozcan sobre las oportunidades de financiamiento no reembolsable que brinda el programa Amanecer Rural del Ministerio de Agricultura y Ganadería. Además, se tendrá la presentación de la empresa Biotecnología, S.A. de C.V. con el fin que los participantes tengan conocimientos sobre las soluciones biológicas disponibles hoy para el control de plagas y manejo de cultivos.', 'Aula A-24, UNICAES Ilobasco. Hora: 9:00 am.', 'CDMYPE', '2015-06-16 01:43:30', '2015-06-16 03:40:59'),
(18, '2015-07-16', 'Miniforo CYTED IBEROEKA', ' “Desarrollo Científico y Tecnológico para la Seguridad Alimentaria” dirigido a empresas del sector alimentos', 'Antiguo Cuscatlán en las instalaciones de FEPADE', 'CDMYPE', '2015-07-04 01:21:18', '2015-07-04 01:21:18'),
(19, '2015-09-03', '"Gestión de BPM en el área de alimentos y bebidas en restaurantes" ', ' La capacitación “Gestión de BPM en el área de alimentos y\r\nbebidas en restaurantes”. esta dirigida al personal del área de alimentos y bebidas de restaurantes y\r\nestablecimientos similares. En busca de mantener un área de trabajo organizada que cumpla con estándares\r\nde calidad e inocuidad, los empresarios y empleados de este rubro buscan mejorar el desempeño de una de\r\nlas áreas importantes del sector restauración. Participará, personal del área de cocina de restaurantes de\r\nCuscatlán, Cabañas y San Vicente.', 'UNICAES- Ilobasco', 'CDMYPE', '2015-08-29 01:24:02', '2015-08-29 01:24:02'),
(20, '2015-10-09', 'FORO: “Desafíos de las empresas agrícolas locales de cara a experiencias internacionales”', 'ANTECEDENTES\r\nDesde el año 2010, uno de los sectores que más se ha atendido en el CDMYPE UNICAES Ilobasco, ha sido el de la Agroindustria Alimentaria. Dentro de ella se ha categorizado aquellas organizaciones, principalmente cooperativas, que se dedican a la producción y comercialización de hortalizas, frutas, granos básicos entre otros. Algunas de ellas, con proyectos agroindustriales como la producción de vinos, pulpas de frutas, encurtidos y salsas, etc. \r\nGeneralmente, el tipo de atención que las cooperativas y productores agrícolas solicitan, está orientado al financiamiento de proyectos de ampliación de cultivos, por medio de fondos de capital semilla o en algunos casos, créditos. La comercialización y acceso a nuevos mercados, sigue siendo una debilidad que no ha sido atendida de forma sistemática y en ese sentido, se pretende por medio de un foro que incluya mesas de trabajo y charlas, conocer con más detalle la problemática y nivel de visión empresarial de los productores agrícolas y darles una perspectiva más amplia de cómo algunos países desarrollados abordan el tema de la producción y comercialización de sus productos agrícolas.\r\n\r\nOBJETIVO\r\nIncrementar la perspectiva y visión de desarrollo empresarial de los productores agrícolas de Cabañas y Cuscatlán hacia una cultura orientada a la consolidación de empresas rurales exitosas.\r\n', 'AULA B-24, Universidad Católica de El Salvador', 'CDMYPE', '2015-10-03 02:43:18', '2015-10-03 02:43:18'),
(21, '2015-10-09', 'Taller de costos', 'Con el taller los empresarios mejoraran las habilidades para determinar el costo de sus productos estableciendo margenes de ganancia basados en los elementos del costeo. ', 'UNICAES- Ilobasco', 'CDMYPE', '2015-10-08 01:34:28', '2015-10-08 01:34:28'),
(22, '2015-12-10', 'Capacitación ¿Cómo determinar el tamaño de mi empresa?', 'El objetivo de esta actividad es capacitar y conocer herramientas claves para determinar el tamaño de mi empresa,como hacer un flujo de efectivo y solicitar un financiamiento.', 'CDMYPE ', 'CDMYPE', '2015-12-07 16:38:55', '2015-12-07 16:42:30'),
(23, '2015-12-17', 'Desayuno empresarial "Logros y desafíos CDMYPE 2015"', 'Desayuno empresarial para la realización de un encuentro entre empresarios con potencial de crecimiento, empresas tractoras y aliados estratégicos donde se presentaran resultados, logros y desafíos de CDMYPE 2015.', 'Aula B-24. UNICAES Ilobasco', 'CDMYPE', '2015-12-10 22:07:17', '2015-12-10 22:07:17'),
(24, '2016-01-29', 'Foro de Agroindustria Alimentaria: "Innovación, Calidad y Competitividad como Herramientas Claves para el Desarrollo de la Agroindustria Alimentaria".', 'El Foro surge como una iniciativa para fomentar la búsqueda de alianzas entre los sectores estratégicos que permitan el intercambio de conocimientos y experiencias exitosas.', 'Aula B-24. UNICAES Ilobasco', 'CDMYPE', '2016-01-13 22:15:17', '2016-01-13 22:15:17'),
(25, '2016-01-08', 'Charla "Bases del Crecimiento Empresarial"', 'Esta charla tiene por objetivo dar a conocer los fundamentos para  implementar las estrategias de crecimiento empresarial para el año 2016, definir las proyecciones, descubrir la situación de partida y definir los elementos principales del plan de crecimiento.', 'Sala de reuniones, edificio C', 'CDMYPE', '2016-01-19 22:19:55', '2016-01-19 22:19:55');
