INSERT INTO `post` (`id`, `titulo`, `slug`, `contenido`, `resumen`, `imagen`, `fecha`) VALUES
(2, 'Mejorando la Productividad Artesanal', 'mejorando-la-productividad-artesanal', '<b>OBJETIVOS:</b>\r\n<ul>\r\n	<li>Implementar metodologías de calidad y productividad enfocadas en la disminución de costos de producción, mejora de rendimiento, productividad y control de calidad de sus productos.</li>\r\n	<li>Conocer y aplicar el modelo de calidad 5S y Kaizen en el taller artesanal..</li>\r\n</ul>\r\n<b> </b>\r\n\r\n<b>DIRIGIDO A:</b>\r\n\r\nDirigido para los propietarios y/o personal a cargo de talleres de artesanías, está enfocado en personas que deseen aprender metodologías de productividad y calidad que faciliten su desempeño artesanal.\r\n\r\n&nbsp;\r\n<br>\r\n<b>COMPROMISO </b>\r\n\r\nLa organización  deberá estar convencida y comprometida con la implementación de las 5 S’s en todos los niveles de la organización.\r\n\r\nSus funciones son:\r\n<ul>\r\n	<li>Liderar el Programa 5 S’s.</li>\r\n	<li>Mantener un compromiso activo.</li>\r\n	<li>Promover la participación de todos los implicados.</li>\r\n	<li>Dar seguimiento al programa.</li>\r\n</ul>\r\n<b>PLANEACIÓN Y ORGANIZACIÓN DEL PROYECTO </b>\r\n\r\nEtapa inicial que consiste en determinar las áreas a implementar, las etapas y actividades a realizar, su duración, los responsables y los recursos necesarios. Principales actividades:\r\n\r\na)      Seleccionar las áreas.\r\n\r\nb)      Designar a los miembros del equipo del proyecto de  implementación.\r\n\r\nc)      Implementar el programa de manera secuencial y/o simultánea en las áreas previstas.\r\n\r\nd)      Medir y evaluar los resultados.', 'Incrementa la calidad, productividad y disminuye los costos mejorando los rendimientos de tu empresa, aplicando el modelo de gestión 5s y el método Kaizen.', 'mejorando la productividad artesanal.png', '2015-02-10'),
(3, 'Programa de Compras Gubernamentales', 'programa-de-compras-gubernamentales', '&nbsp;\n\nOBJETIVOS:\n<ul>\n	<li>Incrementar las ventas a través de la promoción y participación de  las MYPES  en compras gubernamentales.</li>\n	<li>Implementar  un programa de seguimiento para el logro de incremento en ventas de empresarios MYPE</li>\n</ul>\nDIRIGIDO A:\n\nDirigido a empresarios que desean iniciar un proceso de búsqueda de oportunidades de venta con el Estado.\n\nCOMPROMISO:\n\nLas empresas deberán estar comprometidas en completar la formación de compras gubernamentales, para identificar oportunidades de las compras que hace el Estado  y realizar propuestas técnicas y económicas atractivas que permitan concretar ventas con el Estado.\n\nSus funciones son:\n<ul>\n	<li>Registrarse como proveedores del Estado COMPRASAL.</li>\n	<li>Identificar las instituciones de gobierno que demandan bienes y servicios.</li>\n	<li>Elaborar ofertas técnicas y económicas atractivas.</li>\n	<li>Formar parte del programa hasta obtener los resultados deseados.</li>\n	<li> Dar seguimiento al programa.</li>\n</ul>\nPLANEACIÓN Y ORGANIZACIÓN DEL PROYECTO\n\nEtapa inicial que consiste en determinar las áreas a implementar, las etapas y actividades a realizar, su duración, los responsables y los recursos necesarios.\n\nPrincipales actividades:\n\na)     Conocer y manejar la plataforma COMPRASAL.\n\nb)     Designar los encargados de monitorear la demanda de bienes y servicios que oferta el Estado.\n\nc)     Presentar ofertas técnicas y económicas atractivas a las UACIS demandantes.\n\nd)     Monitorear y dar seguimientos a las ofertas técnicas y económicas presentadas.\n\nMedir y evaluar los resultados.', 'Este programa esta dirigido a personas interesadas en venderle al gobierno. Etapa inicial que consiste en determinar las áreas a implementar, las etapas y actividades a realizar, su duración, los responsables y los recursos necesarios. ', 'compras gubernamentales CDMYPE UNICAES.png', '2015-03-10');
