(2, 'Diversificación de negocios: apertura de Mini Super', '\r\n2\r\n10000', 'Apertura de nuevo establecimiento comercial en San Isidro, el cuál consiste en un mini supermercado local que comercialice productos de primera necesidad a precios económicos.', 4, 3, 0, '2014-08-26', '2014-12-20', NULL, '2014-09-02 21:58:46', '2014-09-02 21:58:46'),
(3, 'Financiamiento para producción de calzado', '200000', 'Obtener financiamiento para aumentar la produción de calzado.\r\nContar con una sola instutición que financíe todos los proyectos de la empresa.\r\nMejorar las condiciones de financiamiento de la empresa.', 12, 12, 0, '2014-09-02', '2014-12-11', NULL, '2014-09-03 20:35:51', '2014-09-03 20:35:51'),
(4, 'Fortalecimiento empresarial y posicionamiento de servicios decorativos para diferentes eventos sociales', '-Diversificación de productos y servicios (10 productos y 2 servicios)\r\n-Posicionamiento en mercado local y municipios aledaños a Guacotecti (2 clientes nuevos por mes)\r\n', '-Mejorar las técnicas de servicios de floristería y manualidades para eventos\r\n-Implementar estrategias de promoción para acceder a nuevos mercados', 280, 4, 0, '2014-09-24', '2014-11-24', NULL, '2014-10-02 04:17:54', '2014-10-02 04:17:54'),
(5, 'Creacion de pagina web', '2000\r\n1000\r\n400000', 'masldfkasldfj alsdkfj alsdf \r\nasldfkjalskdfj alskdjf laskdfj qdf\r\nlasjdflaksdjflaskdjflaskj fas \r\n', 13, 2, 0, '2014-10-22', '2019-12-01', NULL, '2014-10-22 23:05:09', '2014-10-30 03:14:22'),
(6, 'Modelo de negocio', '2', 'asdfkjhasdfjhak sdhfak jsdhfk ajsdhf kajdf\r\nalsdfjkalsdkfjas', 13, 2, 0, '2014-10-29', '2015-07-01', NULL, '2014-10-30 03:17:15', '2014-10-30 03:17:15'),
(7, 'Mejora de calidad de servicios turísticos rurales', '5 alianzas con tour operadores\r\n5 clientes locales\r\n', '-Mejora en calidad de servicios turísticos \r\n-Posicionamiento de los servicios turístico en el mercado local\r\n', 253, 4, 0, '2015-01-08', '2015-05-08', NULL, '2015-01-09 01:18:41', '2015-01-09 02:46:58'),
(8, 'Estrategias de penetración en el mercado ', '$4135.00', 'Incremento en ventas por servicios de senderismo, paquetes de educación ambiental para grupos locales y alquiler de servicios de descanso. ', 253, 4, 0, '2015-03-02', '2015-05-02', NULL, '2015-01-14 21:07:21', '2015-01-14 21:07:21'),
(9, 'Desarrollo de producto y elaboración de viñeta para alimentos pre-envasados', 'Creación de empaque y viñeta\r\n', 'Creación de diseño de empaque de producto que cumpla con las normativas legales correspondientes', 298, 4, 0, '2015-01-23', '2015-03-23', NULL, '2015-01-17 03:34:47', '2015-01-24 02:54:12'),
(10, 'Acompañamiento para el acceso a mercados formales', '20000\r\n2\r\n5000\r\n5000', 'Proyecto de fortalecimiento de la empresa para acceder a nuevos mercados y generar así una mayor demanda para la cooperativa.', 168, 3, 0, '2015-01-20', '2015-08-29', NULL, '2015-01-20 03:15:29', '2015-01-20 03:15:29'),
(11, 'Estrategias de posicionamiento de marca en el mercado local ', '$9000', '-Reconocimiento de la marca en segmento de mercado local\r\n-Incremento en ventas anual', 298, 4, 0, '2015-01-22', '2015-02-22', NULL, '2015-01-22 01:40:16', '2015-01-22 01:45:38'),
(12, 'Posicionamiento de marca Don Vicente en supemercado', '$656,500.00', 'Incremento en ventas anual', 167, 4, 0, '2015-01-21', '2015-03-21', NULL, '2015-01-22 03:54:32', '2015-01-22 03:54:32'),
(13, 'Creación de marca para diversificación de productos', 'Arroz empacado\r\nAlguashte empacado\r\nAjonjolí empacado', 'Diversificación de productos para segmento de mercado \r\nAcceso a nuevos mercados', 167, 4, 0, '2015-01-21', '2015-01-21', NULL, '2015-01-22 04:13:11', '2015-01-22 04:13:11'),
(14, 'Fortalecimiento de herramientas que contribuyan a la gestión de fondos para proyecto turístico en laguna de Apastepeque', '12000', 'Creación de plan de negocio para gestión de fondos ', 301, 4, 0, '2015-02-02', '2015-06-02', NULL, '2015-03-10 04:07:51', '2015-03-10 04:07:51'),
(15, 'Captación y desarrollo de clientes', 'Que la empresa pueda cubrir la demanda de los clientes que tiene San Salvador y San Miguel.\r\nDesarrollar clientes en Cabañas y San Vicente.\r\nAdquirir nuevo equipo para la producción.\r\n', 'Llegar a clientes que no se han atendido antes y mantener fieles aquellos que ya se les esta vendiendo, satisfaciendo las necesidades de los clientes que ellos atienden y manteniendo una relación comercial a través de la innovación y la calidad.', 73, 8, 0, '2015-07-10', '2015-11-30', NULL, '2015-07-10 22:44:12', '2015-07-10 22:44:12'),
(16, 'Fortalecimiento en la Gestión Empresarial y Acceso a Mercados', '1 Cliente enfocado en el mercado nacional.\r\n3 Líneas de producto creadas.', 'Mejorar el volumen de negocios de la cooperativa.', 331, 3, 0, '2015-10-01', '2015-12-10', NULL, '2015-10-03 03:29:33', '2015-10-03 03:29:33'),
(17, 'Fortalecimiento Gestión Empresarial', '1 Nuevo cliente con cobertura nacional.\r\n18 Nuevos productos.', 'Incrementar el número de clientes.\r\nNuevos segmentos de mercado.', 192, 3, 0, '2015-08-28', '2015-12-18', NULL, '2015-10-03 20:42:50', '2015-10-03 20:42:50');
