--
-- Estructura para la vista `detalle_asistencias`
--
DROP TABLE IF EXISTS `detalle_asistencias`;

CREATE ALGORITHM=UNDEFINED DEFINER=`cdmype`@`localhost` SQL SECURITY DEFINER VIEW `detalle_asistencias` AS select `em`.`nombre` AS `empresario`,`e`.`nombre` AS `empresa`,`at`.`tema` AS `tema`,`at`.`estado` AS `estado`,`at`.`created_at` AS `creacion`,`at`.`fecha` AS `presentacion`,`c`.`fecha_inicio` AS `fecha_inicio`,`c`.`fecha_final` AS `fecha_final`,`amp`.`fecha` AS `ampliacion` from ((((`atterminos` `at` join `empresas` `e` on((`e`.`id` = `at`.`empresa_id`))) left join `empresarios` `em` on((`em`.`id` = `at`.`empresario_id`))) left join `atcontratos` `c` on((`c`.`attermino_id` = `at`.`id`))) left join `ampliacionescontratos` `amp` on((`amp`.`attermino_id` = `at`.`id`)));

